INSERT INTO `berita_baru` (`id_berita_baru`, `id_link`, `judul_berita`, `isi_berita`, `kategori`) VALUES
	(1, 53, 'Demi Lebaran Bersama Orangtua, Firman Rela 10 Jam. Terperangkap Macet di Brebes', 'Idul Fitri adalah hal yang dinanti-nantikan oleh umat muslim setiap tahunnya. Tak perduli jarak, waktu, hingga uang, akan dikorbankan agar bisa menghabiskan lebaran untuk mudik berkumpul dengan keluarga. Termasuk rela berjam-jam terperangkap macet. Hal ini seperti yang dirasakan oleh Firman Abielfida, pemudik dari Purwakarta yang hendak menuju kampung halamannya di Semarang. Berangkat bersama sang adik sejak pukul 15.00 WIB, Sabtu (2/7/2015), hingga saat ini Firman masih jauh dari tujuan dan terjebak macet di wilayah Brebes. "Saya sekarang di wilayah Bangsri. Lalu lintas Brebes-Tegal nyaris parkir," ujar Firman saat berbincang dengan detikcom, Minggu (3/7/2016). Perjalanan Firman pada awalnya cukup lancar. Ia keluar dari Tol Palimanan saat magrib dan terus melanjutkan hingga Kanci. Sampai di daerah Bulakamba, bapak dua anak ini lalu beristirahat untuk makan. Setelah istirahat sebentar dan hendak melanjutkan perjalanan, Firman terjebak macet parah. "Bulakamba menuju Bangsri sebenarnya hanya berjarak lebih kurang 10 km tetapi dari jam 20.05 WIB sampai dengan saat ini situasi masih sama dan stagnan," kata dia. Beruntung Firman sudah terlebih dahulu memulangkan istri dan anak-anaknya ke kampung halaman mereka. Ia tidak ingin buah hatinya yang masih kecil-kecil harus merasakan beratnya perjuangan mudik lewat jalur darat. "Karena situasinya kayak gini, kasihan kalau ikut saya. Udah seminggu lalu istri dan anak-anak saya pulangin duluan naik kereta. Kalau saya bawa mobil karena di sana bisa dipakai juga," tutur Firman. Meski harus berpeluh setiap tahun menghadapi kemacetan arus mudik, Firman tak menyerah. Tetap saja perjuangan itu ia lakoni demi berkumpul bersama keluarga, terutama agar bisa menghadap orangtua. "Mau ke rumah orangtua. Alhamdulillah orangtua saya masih lengkap. Nggak apa-apa macet-macetan, setahun sekali. Yang paling penting bisa lebaran sama orangtua dan istri anak," sebutnya. Pengalaman mudik tahun ini menurut Firman adalah yang paling parah dari empat tahun pengalaman mudiknya. Itu bisa terlihat dari bagaimana jarak Bulukamba-Bangsri yang hanya 10 km perlu ditempuhnya selama lebih dari 10 jam. Dan ia masih harus menghadapi kemacetan entah hingga pukul berapa dan tak bisa memprediksi kapan akan sampai Semarang. "Paling parah kayaknya tahun ini. Tahun kemarin saya 36 jam baru sampai, sekarang nggak tahu deh. Bisa-bisa besok baru sampai kayaknya, apalagi Pekalongan katanya juga macet," ucap Firman. Menurutnya, saat ini 4 lajur baik sisi kiri dan kanan Pantura sudah terpakai semua oleh para pemudik yang hendak menuju timur. Itu dikatakan Firman menambah kekacauan. "Rombongan pemudik motor mulai berdatangan dari jam 03.00 WIB. Ini nggak jalan sama sekali. Sebelum 4 lajur kepakai semua, masih jalan sedikit. Sekarang nggak sama sekali," terangnya. Walau terjebak kemacetan cukup parah, tampaknya ia bersama sang adik tetap semangat mudik ke kampung halaman. "Ya dijalani aja," tutup Firman sambil tergelak.', NULL),
	(2, 54, 'Subuh di Rest Area 130A Tol Cipali', 'Kepadatan masih terlihat di Tol Cipali. Saat waktu subuh tiba banyak pemudik yang membelokkan kendaraannya ke rest area. Minggu (3/7/2016), saat subuh di Rest Area 130A, sempat terjadi kesulitan mencari tempat parkir, namun petugas cukup sigap mengatur tempat parkir. Beberapa diarahkan ke mulut rest area, sementara yang lainnya diatur ke jalan keluar menuju Tol Cipali. Sehingga kepadatan di rest area cepat terurai. Fasilitas di rest area ini cukup mumpuni, walaupun belum bisa dibilang memadai. Warung makan, musala, mini market, tanpa SPBU, dan hanya 1 toilet permanen sedangkan sisanya darurat. Beberapa pemudik menunaikan hajatnya di rest area ini. Mulai dari salat, istirahat, makan minum, ke toilet, ataupun hanya sekedar ngopi-ngopi di tikar yang digelar pengusaha dadakan di atas rumput. Di Tol Cipali suasananya tidak banyak berubah, masih tetap padat. Meskipun begitu kendaraan masih bisa melaju dengan kecepatan maksimal 40 Km/jam.', NULL),
	(3, 55, 'Tol Cipali Padat Merayap, Antrean 2 Km di Gerbang Tol Palimanan', 'Arus lalulintas di Tol Cipali pagi ini padat merayap. Volume kendaraan sejak semalam terus bertambah. "Pagi ini lalulintas di Tol Cipali dari arah Jakarta menuju Jawa terpantau padat merayap," kata petugas call center Tol Cipali, Fahmi saat dihubungi, Minggu (3/7/2016) pukul 06.15 WIB. Sejak semalam, volume kendaraan terus meningkat, namun tidak menimbulkan kemacetan parah di tol terpanjang di pulau Jawa itu. Kemacetan hanya terjadi menjelang pintu Tol Palimanan karena antrean pembayaran. "Antrean menjelang pintu Tol Palimanan mencapai 2 Km," jelas Fahmi. Kondisi cuaca di Cipali saat ini sangat cerah, sehingga tidak akan menghambat perjalanan para pemudik. Sementara itu, usai dari Tol Cipali, para pemudik akan memasuki Tol Pejagan dan Tol Brebes Timur yang berujung di Brexit. Pemudik harus bersiap-siap menghadapi kemacetan, karena baik di Pejagan maupun Brexit sama-sama terjadi kemacetan panjang sejak semalam.', NULL),
	(5, 56, 'Penduduk Jakarta Banyak yang Mudik, Car Free Day Bundaran HI Ditiadakan', 'Pagi ini tidak seperti Minggu pagi biasanya. Di Minggu pagi, selalu ada kegiatan car free day di Buandaran HI. Khusus hari Minggu ini (3/7/2016) dan Minggu depan (10/7) kegiatan car free day ditiadakan. Sebagian besar penduduk Jakarta yang biasa menikmati car free day telah mudik. "Hari bebas kendaraan bermotor (HBKB/CAR FREE DAY) tanggal 3 Juli dan 10 Juli 2016 ditiadakan," kata Kasubdit Pembinaan dan Penegakan Hukum Ditlantas Polda Metro Jaya AKBP Budiyanto. Pembatalan car free day memang diizinkan dalam situasi tertentu. Pada Peraturan Gubernur Nomor 12 tahun 2016 tentang HBKP pasal 5 poin satu (1) bahwa pelaksanaan HBKB/CAR FREE DAY dapat dibatalkan jika pada waktu yang bersamaan dilaksanakan kegiatan yang bersifat khusus baik nasional maupun internasional. Pada kurun waktu 3-7 Juli, banyak penduduk Jakarta yang mudik untuk merayakan lebaran. Jalanan di Jakarta pun akan menjadi lengang. Pertimbangan itu lah yang menjadi dasar car free day yang biasa berjalan dari pukul 06.00-11.00 ditiadakan. "Dengan pertimbangan situasi tersebut, dan berdasarkan hasil koordinasi Tim Kerja HBKB tingkat Provinsi DKI, PELAKSANAAN HARI BEBAS KENDARAAN BERMOTOR / CFD di ruas Jl Sudirman dan Jl MH Thamrin pada tanggal 3 Juli dan 10 Juli 2016 DITIADAKAN," ujar Budiyanto.', NULL),
	(6, 57, 'Ada Truk Kecelakaan, Tol Cikampek Macet', ' Sebuah truk mengalami kecelakaan di KM46 Tol Cikampek. Akibatnya, arus lalulintas di Tol Cikampek macet. Kecelakaan terjadi Minggu (3/7/2016) sekitar pukul 04.50 WIB. Truk boks mengalami kecelakaan di lajur dua. Petugas pun tengah berusaha untuk mengevakuasi truk. Namun imbasnya, terjadi kemacetan sampai 8 Km lebih. "Cikarang Timur KM 37 sampai Karawang Barat KM 46+200 padat, dampak adanya penanganan kecelekaan. Silakan gunakan jalur alternatif," ujar petugas piket PT Jasamarga. Sementara itu, kemacetan di Tol Cikampek juga terjadi di titik lain, yakni di Karawang Timur KM 55- KM 57. Kemacetan terjadi karena antrean di rest area KM 57.', NULL),
	(7, 58, 'Kebakaran di Belakang Senayan City Hanguskan Puluhan Rumah Semi Permanen', 'Kebakaran yang terjadi di belakang Senayan City telah berhasil dipadamkan. Puluhan rumah semi permanen hangus dalam kejadian ini. "Sudah padam, ada puluhan rumah petak yang terbakar. Sekarang tinggal pendinginan," ujar petugas Suku Dinas Pemadam Kebakaran Jakarta Selatan, Minggu (3/7/2016). Kebakaran terjadi sejak pukul 00.30 WIB, tepatnya di dekat kawasan Simprug Golf, Kebayoran Lama, Jakarta Selatan. Api sempat membesar dan membubung tinggi karena banyak rumah yang terbuat dari kayu yang mudah terbakar. "Tadi diterjunkan sampai 38 unit pemadam kebakaran karena banyak yang terbakar," jelasnya. Api diduga berasal dari korsleting listrik di salah satu rumah yang saat itu dalam keadaan kosong. Tidak ada korban jiwa dalam kejadian ini.', NULL),
	(8, 59, '4 Rumah di Pekanbaru Hangus Terbakar', 'Sebanyak 4 unit rumah petak di Pekanbaru hangus terbakar. Namun dalam musibah ini tidak ada korban jiwa. Kebakaran rumah warga ini tepatnya di Jl Pangeran Hidayat, kawasan pusat Kota Pekanbaru. Kebakaran terjadi menjelang waktu berbuka puasa sekitar pukul 18.10 WIB. Dari keterangan saksi, Munir (76) mengatakan bahwa api pertama kali terlihat dari plafon rumah yang dia sewa. Melihat ada kobaran api, saksi lantas keluar rumah dan berteriak meminta bantuan warga. "Api dengan cepat menyambar ke plafon rumah petak lainnya. Api sulit dipadamkan warga yang menyiram air seadanya," kata Munir. Penghuni rumah petak, lanjut. Munir, hanya bisa menyelamatkan barang-barang seadanya saja. Banyak barang lainnya yang tidak terselamatkan. Dalam peristiwa ini sedikitnya 6 unit Damkar diterjunkan ke lokasi. Api baru bisa dipadamkan sekitar pukul 20.00 WIB. Tidak ada korban jiwa dalam musibah ini. Ada dugaan kebakaran terjadi karena korsleting listrik. ', NULL),
	(9, 60, 'Brexit Macet Parah, Brebes Nyaris \'Parkir\'', 'Pemudik yang menuju ke arah Jawa Tengah dan sekitarnya harus ekstra bersabar untuk bisa sampai rumah. Ada cobaan baru di jalur mudik tahun ini bernama Brexit atau Brebes Timur Exit. Dibutuhkan waktu berjam-jam untuk bisa keluar di pintu tol yang baru saja dioperasikan ini. Bahkan, kemacetan karena antrean pembayaran mencapai 15 Km. Selepas dari Brexit, pemudik tidak bisa langsung tancap gas. Pasalnya, kemacetan selanjutnya sudah menunggu. Polres Brebes memang melakukan rekayasa lalulintas selepas Brexit. Pengendara diwajibkan masuk ke Kota Brebes sebelum mengarah ke jalur Pantura arah Tegal. Masalahnya, sistem ini justru menimbulkan kemacetan panjang. Beberapa pemudik mencoba menghindari kemacetan Brexit dengan keluar di pintu tol Pejagan. Namun, yang dihadapi lebih menantang, pemudik yang melewati Bulakamba, Brebes justru terjebak berjam-jam. Mobil mereka parkir tak bisa bergerak. "Sampai dengan saat ini saya hanya menempuh jarak 10 km dalam 4 jam," kata seorang pembaca detikcom, Heru Sadmiko, Minggu (3/7/2016) pukul 03.45 WIB. Heru sudah sejak sore tadi sekitar pukul 19.00 WIB memasuki Bulakamba. Dan hingga pukul 04.00 WIB, dia masih terjebak di antara ratusan mobil yang parkir. Di titik lain di Brebes nasibnya juga tak jauh berbeda. Bagi para pemudik yang menuju Yogyakarta, Purworejo dan lainnya harus melalui Ketanggungan sampai ke pertigaan Klonengan. Kendaraan sejak keluar dari pintu Tol Pejagan langsung parkir. Sejak sore hingga saat ini, kendaraan berjalan tak lebih dari 5 Km.', NULL),
	(10, 61, 'Jalan Licin dan Kurang Penerangan, Banyak Pemotor di Ketanggungan Terpeleset', 'Jalur alternatif Brebes arah Purwokerto masih macet parah hingga jelang subuh ini. Di saat kendaraan roda empat atau lebih \'parkir\' di Jalan Ketanggungan, pemotor yang masih bisa melaju banyak yang jatuh akibat jalanan licin. "Dimatikan semua mesin mobilnya, saking parahnya macet. Sunyi senyap di tengah jalan. Pemudik pada keluar dari mobil," ujar seorang pemudik yang \'parkir\' di Ketanggungan, Tiwi saat berbincang dengan detikcom, Minggu (3/7/2016) dini hari. Tiwi sudah keluar dari Tol Pejagan sejak pukul 19.30 WIB, Sabtu (2/7) dan hingga kini masih stuck di Ketanggungan. Mudik bersama sang suami, Tiwi masih harus berjuang menembus kemacetan hingga melewati pertigaan Klonengan untuk sampai ke tempat tujuannya yaitu Yogyakarta. "Sepi, kanan-kiri sawah. Polisi nggak kelihatan. Mana toilet susah, SPBU belum nemu. Ini udah mepet juga bensinnya," tuturnya. Di wilayah Ketanggungan sempat turun hujan deras malam tadi. Saat ini cuaca belum benar-benar cerah dan menyebabkan jalanan basah dan tidak kering-kering. "Motor masih bisa lewat, nyelap-nyelip. Ini mobil yang parah banget. Mereka nyelap-nyelip di mobil yang pada berhenti ini," jelas Tiwi. "Beberapa motor sempat jatuh saking mepetnya, terus jalanan juga licin. Ujan masih rintik-rintik," imbuh karyawati swasta itu. Meski begitu belum diketahui adanya korban pemotor yang terluka parah akibat terjatuh. Namun dikhawatirkan kurangnya penerangan jalan dapat menyebabkan korban terpeleset semakin banyak. "(Penerangan) kurang banget. Lha kanan-kiri sawah. Tanah licin," kata Tiwi. Wilayah Brebes menjadi pusat macet paling parah untuk arus mudik hari ini. Beberapa titik kemacetan seperti di Ketanggungan, pintu keluar Tol Brebes Timur Exit atau Brexit, dan sejumlah titik lainnya. Di jalur Pantura utama pun menurut pembaca pasangmata, Muhammad Alf Lim, kemacetan semakin malam semakin parah. Salah satunya di sekitar Jembatan Sungai Pemali yang berada di ruas Brebes-Tegal itu. "Ditambah kondisi jalan yang basah setelah diguyur hujan. Diharap buat para pemudik harap berhati-hati, jalanan licin," imbau Alf, Minggu (3/7).', NULL),
	(11, 63, 'Prajurit Lanud Roesmin Nurjadin Pekanbaru Bersih-bersih Sampah di Pasar', 'Persoalan sampah menjadi perhatian Lanud Roesmin Nurjadin Pekanbaru. Di hari bakti TNI AU ke 69, mereka menggelar bakti sosial di antaranya membersihkan sampah. Pelaksanaan bakti sosial ini digelar, Senin (25/7/2016) di Pasar Pagi Arengka, Pekanbaru. Sebanyak 120 personel pasukan AU ini diterjunkan ke pasar tradisional tersebut. Lokasi pasar ini hanya berjarak sekitar 500 meter dari Markas TNI AU di Pekanbaru. Pasar Pagi Arengka, dalam tiga bulan terakhir juga tak luput dari persoalan sampah. Karena itu, TNI AU turut membantu membersihkan sampah yang berserakan di lokasi pasar yang ramai itu. "Kita menggelar bakti sosial turut membersihkan sampah dalam rangka HUT TNI AU ke 69," kata Kepala Penerangan dan Perpustakaan (Kapentak) Lanud Roesmin Nurjadin, Mayor (Sus) Rizwar kepada detikcom. Dalam membersihkan sampah ini, Komandan Lanud Rsn, Marsma Henri Alfiandi terjun langsung ke lokasi. Perwira bintang satu ini memantau langsung jalannya bakti sosial. Begitu juga Komandan Batalyon Komando (Yonko) 462 Phaskas (Pasukan Khas) Mayor (Pas) Ruly Arifian juga memboyong pasukannya terjun ke lokasi. Pasukan elit TNI AU itu tak ketinggalan berjibaku membersihkan sampah di pasar pagi tersebut. "Kita turut membantu membersihkan sampah sehingga masyarakat bisa beraktivitas dengan nyaman. Selain membersihkan sampah, kita juga menggelar donor darah," kata Rizwar. Sebagai diketahui, persoalan sampah di Pekanbaru sempat menjadi sorotan banyak pihak. Ini karena adanya polemik antara perusahaan pemenang tender angkutan sampah dengan pihak Pemkot Pekanbaru. Persoalan itu berujung adanya penundaan gaji para karyawan angkutan sampah. Akhirnya berimbas pada aksi mogok kerja yang enggan mengangkut sampah. Terjadilah penumpukan sampah dimana-mana selama tiga bulan terakhir. Belakangan Pemkot Pekanbaru memutus kontrak dengan pihak perusahaan. Kini pengelolaan sampah diambil lagi dinas kebersihan yang mulai berangsur normal. ', NULL),
	(12, 64, 'Soroti Bidang Ekonomi, Golkar: Kami Sangat Siap Bantu Presiden di Kabinet', 'Isu reshuffle berhembus makin kuat menyusul adanya imbauan agar menteri anggota Kabinet Kerja tak meninggalkan Jakarta pada minggu ini. Salah satu spekulasi soal reshuffle itu terkait dengan kursi bagi Golkar dan PAN duduk di kabinet. Ketua DPP Golkar Agun Gunanjar menyatakan sekiranya ada reshuffle, tentu kader Partai Golkar sangat siap untuk membantu Presiden Jokowi di Kabinet Kerja. "Golkar sangat siap dengan sejumlah kader-kader kompetennya untuk bantu Presiden mensejahterakan rakyat melalui penyelengaraan pemerintahan dan penyerapan anggaran yang semakin efektif dan efisien," kata Agun Gunanjar kepada detikcom, Senin (25/7/2016). Anggota DPR RI itu menyoroti kinerja bidang perekonomian Kabinet Kerja yang menurutnya masih perlu ada perbaikan. Meski tak serta merta juga kritik ini diartikan keinginan untuk menempati kursi bidang ekonomi. "Perbaikan perekonomian yang berkaitan dengan kemampuan daya beli rumah tangga miskin dan kesempatan usaha dan lapangan kerja, harus menjadi perhatian serius Pemerintahan Jokowi-JK apabila ingin melakukan reshuffle kabinet," terang Agun. "Disertai perbaikan kinerja pelayanan aparatur dan penegakan hukum yang lebih menjamin adanya keadilan dan kepastian hukum," imbuh politisi asal Jawa Barat itu. Menurut Agun, penyerapan anggaran diprediksi akan lebih baik dengan diterapkannya secara maksimal UU Administrasi Pemerintahan dengan telah diintruksikannya Kapolri dan Jaksa Agung untuk memahami UU tersebut terkait penegakan hukum korupsi. "Untuk itu reshuffle kalau akan dilakukan harus bersifàt komprehensip dan yang terakhir," saran Agun. Alasannya karena Pemerintahan Jokowi-JK sudah mendapat kepercayaan dan dukungan yang sangat besar dari masyarakat maupun partai politik di parlemen. Setidaknya konteks dukungan masyarakat itu tergambar di survei soal kepuasaan kinerja Presiden Jokowi. "Inilah kesempatan untuk memperbaiki dan meningkatkan kinerjanya untuk rakyat," tegas politisi yang juga dikenal sebagai salah satu ideolog Partai Golkar itu.', NULL),
	(13, 65, 'Foto RI 81 Masuk Jalur TransJ, Boleh?', 'Alvin Lie, komisioner Ombudsman Republik Indonesia (ORI) mengunggah foto di akun twitternya. Sebuah mobil Toyota Royal Saloon dengan pelat RI 81 masuk ke ruas jalur TransJ. "Mobil dinas Stafsus Presiden mau saingan dengan bus TransJakarta? Gak malu?" kicau Alvin dalam akun @alvinlie21, Senin (25/7/2016). Alvin yang dikonfirmasi detikcom, mengaku foto itu diambil salah satu anggota Ombudsman pagi ini. "Itu diambil Bu Nini fotonya di salah satu ruas jalan di Jakarta. Ini ramai dibahas di grup WA (whatsapp)," terang Alvin. Alvin sendiri mempertanyakan pelat RI 81 itu masuk ke ruas TransJ. Menurut dia, hal seperti itu tak patut dilakukan. Dia pun mengunggah di akun twitter miliknya. Belum diketahui siapa yang duduk di bangku RI 81 itu. Dan tak diketahui juga atas alasan apa masuk ke ruas TransJ yang merupakan jalur khusus. Gubernur DKI Jakarta Basuki T Purnama atau Ahok sendiri pernah menyampaikan, kecuali ambulans dan pemadam kebakaran, serta pelat RI 1, kendaraan lain tak diperkenankan masuk jalur khusus ini.', NULL),
	(14, 66, 'Menanti Eksekusi Mati Freddy, Pencopet yang Jadi Gembong Narkoba Kelas Wahid', 'Palu Mahkamah Agung (MA) yang menolak permohonan peninjauan kembali (PK) Freddy Budiman membuat jaksa cepat-cepat berangkat ke Pulau Nusakambangan, Cilacap. Dikabarkan dalam hitungan hari tim eksekutor akan menembak mati Freddy. Siapakah Freddy? Berdasarkan catatan detikcom, Senin (25/7/2016), sejarah Freddy susah terlacak. Jejak hidupnya hanya bisa didapati dari diceritakan teman-temannya yang juga mendekam di penjara.  "Saya sudah kenal Freddy Budiman alias Budi sebagai bos saya. Sebelumnya sama-sama berprofesi sebagai tukang copet di Surabaya," kata Ahmadi (38). Tukang copet itu digeluti Freddy pada akhir 80-an menuju 90-an awal. Freddy dan Ahmadi sama-sama beroperasi di terminal-terminal di Surabaya. Pada 90-an awal, keduanya hijrah ke Jakarta. Ahmadi dan Freddy tetap sebagai tukang copet. Profesi mereka lalu berkembang yaitu Ahmadi nyaru menjadi penjaga toilet, padahal jualan narkoba. Barang haram itu ia dapati dari Freddy, tukang copet yang merambah menjadi penjual sabu, ekstasi, kokain dan sejenisnya. Freddy akhirnya tertangkap petugas dan dijebloskan ke penjara pada 1997. Tapi penjara bukannya mengajari Freddy kembali ke jalan yang benar, ia malah menjadi pemain kakap. "Saya sudah di LP sejak 1997 karena menjadi pengedar," kata Freddy. Ahmadi kembali bertemu Freddy saat membesuk temannya di LP Cipinang pada 2011. Setelah itu, keduanya kembali menjaliln komunikasi. Pertemanan lama yang sempat terputus pun kembali dijalin erat.  "Saya sering mengantarkan makanan ke Freddy di LP Cipinang," cerita Ahmadi, Kedekatan ini berubah menjadi simbiosis mutualisme. Freddy menjadikan Ahmadi sebagai kaki tangannya di luar penjara untuk menggerakkan roda bisnis narkobanya. Freddy pun mandi uang dalam penjara. "Dari LP saya masih dapat mengendalikan jual beli narkoba melalui anggota saya," ujar Freddy. Ahmadi juga terlibat dalam operasi penyelundupan 1,4 juta pil ekstasi pada 2013 yang akhirnya membuka tabir Freddy. Komplotan itu digulung BNN. Berikut hukuman yang diterima jaringan mafia Freddy: Kasus Impor 1,4 Juta Butir Ekstasi 1. Freddy Budiman divonis mati. 2. Ahmadi divonis mati. 3. Chandra Halim divonis mati. 4. Teja Haryono divonis mati. 5. Hani Sapto Pribowo dipenjara seumur hidup. 6. Abdul Syukur dipenjara seumur hidup. 7. Muhtar dipenjara seumur hidup. 8. Anggota TNI Serma Supriadi divonis 7 tahun penjara dan telah dipecat. Kasus Pabrik Sabu di LP Cipinang 1. Wakil Kepala Pengamanan Gunawan Wibisono dijatuhi hukuman 8 tahun penjara 2. Aris Susilo dijatuhi hukuman 5 tahun dan 10 bulan penjara 3. Cecep Setiawan Wijaya dihukum mati di kasus impor 6 kg sabu. 4. Haryanto Chandra belum dipublikasikan Kasus Pembelian 50 Ribu Butir Ekstasi dan Rencana Membuat Pabrik Sabu Freddy mengontrol jaringan narkoba miliknya dan anak buahnya tersebut dihukum: 1. Suyatno dihukum 20 tahun penjara. 2. Suyatno alias Gimo dihukum 20 tahun penjara. 3. Aries Perdana dihukum 20 tahun penjara. 4. Latief (adik Freddy Budiman) dihukum penjara seumur hidup', NULL),
	(15, 67, 'Sempat Berusaha Kabur, WN AS Frank Amado Tak Masuk Daftar Tereksekusi Mati', 'Jelang pelaksanaan eksekusi mati terhadap para gembong narkoba, sejumlah terpidana mati sudah dipindah ke LP Nusakambangan. Belum ada waktu pasti kapan eksekusi mati akan dilakukan dan siapa saja terpidana narkoba yang akan dihadapkan ke regu tembak. Tapi dipastikan, dalam eksekusi mati gelombang III ini, bos sabu asal Amerika Serikat, Frank Amado tak akan dihadirkan ke regu tembak. Hal itu dikarenakan proses hukum Frank Amado belum rampung hingga tingkat peninjauan kembali (PK). "Yang bersangkutan kan belum mengajukan PK," ucap Kasie Pidum Kejari Jakpus, Agus Setyadi, saat dikonfirmasi detikcom, Senin (25/7/2016). Namun Agus tak mau berpolemik lebih lanjut mengapa Frank tak diajukan ke regu tembak meski sudah inkrah. Dia mengatakan, hal tersebut adalah kewenangan dari Kejaksaan Agung sepenuhnya. "Silakan untuk detailnya ditanya ke Kejagung saja," ucapnya. Frank ditangkap polisi bersama temannya, Payman, seorang WN Iran di Apartemen Royal Park Jalan Gatot Subroto, Jakarta, pada 19 Oktober 2009 lalu. Pria kelahiran Maryland itu diamankan karena terlibat perdagangan sabu seberat 5,6 kg. Frank telah menyelundupkan sabu enam kali selama 2010 melalui penerbangan Bangkok-Jakarta. Selama di Jakarta, Frank selalu berpindah-pindah tempat tinggal baik di apartemen maupun hotel di Jl Gunung Sahari, Jl Gajah Mada, Jl Rasuna Said dan Jl Gatot Subroto. Dia mengaku bekerja sebagai desainer web selama di Jakarta, selain mengajar komputer. Frank berperan menjadi kurir sabu bersama Payman, yang tertangkap pada hari yang sama. Selama menjadi kurir, Frank selalu mengantar sabu ke kamar hotel yang telah dipesan sebelumnya baik di Jakarta Pusat, Selatan dan Barat. Frank selalu memakai celana pendek dengan kaos saat masuk ke kamar hotel sehingga sekilas nampak seperti turis asing yang sedang berlibur dan menginap di hotel. Kurir ini selalu menggunakan jalur terputus dalam transaksi dan pembayaran barang melalui jasa bank. Frank lalu diadili dan dijatuhi hukuman mati oleh PN Jakarta Pusat dengan ketua majelis Dehel K Sandan pada 4 Agustus 2010. Frank menjadi WN AS pertama yang dijatuhi hukuman mati di Indonesia. Hingga tingkat kasasi hukuman Frank tetap hukuman mati.Saat ini dia sedang mengajukan grasi dan belum mencoba peruntungan di jalur PK. Frank berusaha kabur pada 2016 ini saat sedang berobat ke RS Polri tetapi berhasil ditangkap oleh sipir yang mengawalnya.', NULL),
	(16, 68, 'Jadi Saksi di Sidang Kasus Reklamasi, Ahok: Saya akan Jawab yang Saya Tahu', 'Gubernur DKI Basuki Tjahaja Purnama (Ahok) menyatakan dipanggil Jaksa KPK untuk menjadi saksi di persidangan Tindak Pidana Korupsi, hari ini. Dia menjadi saksi memberatkan pihak tersangka dugaan kasus dugaan suap pembahasan Rancangan Peraturan Daerah terkait reklamasi. "Pukul 15.00 WIB, saya diminta jadi saksi oleh jaksa penuntut dari KPK," kata Ahok di Balai Kota, Jl Medan Merdeka Selatan, Jakarta, Senin (25/7/2016). Ahok mengaku tak melakukan persiapan secara khusus, dokumen yang diperlukan tentu dipersiapkan oleh stafnya. Ahok akan menyampaikan yang dia tahu dan yang ditanya di persidangan nanti.  "Saya akan jawab yang saya tahu saja. Yang pasti kalau jaksa penuntut KPK minta saya jadi saksi, pasti saksi yang memberatkan Ariesman (Presdir PT Agung Podomoro Land terdakwa kasus ini). Tapi kan dia punya pengacara, kalau pukul 15.00 WIB mulai, mudah-mudahan saja enggak debat-debat kusir lah, bisa sampai pukul 19.30 WIB atau sampai malam sidangnya itu," tutur Ahok. Kasus ini diproses hingga mengorek keterangan soal suap dari Pimpinan DPRD DKI. Diduga, meskipun telah dibantah pihak DPRD DKI dalam persidangan, ada aliran suap dari pengembang untuk para anggota dewan. Disinyalir, perkara suap-suap inilah yang mempengaruhi dua Raperda menjadi tak kunjung disahkan. Namun Ahok sendiri mengaku tak tahu menahu soal sebab terus tertundanya pengesahan Raperda itu. "Enggak tahu. Pokoknya anggotanya enggak cukup aja (rapat paripurna DPRD DKI tidak kuorum)," kata Ahok. Dia tak berspekulasi soal hal itu. "Enggak tahu, kayak yang kita dengar-dengar di berita saja, kayak yang kalian (media) bilang ada tuduh-menudur," kata Ahok. Ada pasal soal kontribusi tambahan sebesar 15 persen dalam Raperda itu yang menjadi masalah. Menurut Ahok, besaran itu punya dasar yakni perjanjian Ahok selaku Gubernur dengan pengembang. Namun DPRD menolaknya. Polemik lantas mengemuka saat dulu, saat pembahasan Raperda berjalan. "Saya juga bingung, pengusahanya juga mau kok, pengusahanya enggak keberatan tanda tangan (soal kontirbusi tambahan)," ujar Ahok.', NULL),
	(17, 69, 'Perempuan ini Ditemukan Tewas di Ciliwung, Ada yang Kenal? Silakan Kontak Polisi', 'Polres Depok, Jawa Barat merilis foto perempuan yang ditemukan tewas di Ciliwung, Depok. Bagi Anda yang kenal dengan perempuan ini dipersilakan agar menghubungi kantor polisi terdekat. Seperti dirilis Divisi Humas Polri di akun instagram, Senin (25/7/2016), jenazah perempuan itu ditemukan pada Minggu 24 Juli kemarin. Rambut hitam ikal, tinggi 148, memakai baju pink, berat 60 Kg, memakai celana jeans. Bagi yang mengenal atau tahu identitas perempuan ini diharapkan melapor ke kantor polisi. Diketahui sesosok mayat perempuan ditemukan mengambang di Kali Ciliwung, Sukmajaya, Depok. Terdapat luka menganga di bagian kepala korban. "Ada luka (di bagian kepala), tapi belum bisa disimpulkan apakah luka karena luka kebentur batu atau akibat kekerasan," ujar Kapolsek Sukmajaya Kompol Supriyadi saat dikonfirmasi detikcom, Minggu (24/7). Mayat tersebut ditemukan pada Minggu pagi, oleh Ustaz Rojiun yang hendak ke Kali Ciliwung, tepatnya di belakang perumahan Pesona Khayangan. Saat ditemukan, mayat perempuan itu tersangkut di bebatuan. Selanjutnya, saksi melaporkan temuan tersebut ke pihak kepolisian. Polisi telah melakukan identifikasi dan mengevakuasi mayat tersebut ke RS Polri, Kramatjati, Jakarta Timur. "Kita mana ngerti hamil apa tidaknya, namanya di air kan bisa saja karena air, kan harus diautopsi dulu," imbuhnya.', NULL),
	(18, 70, 'Kartu BPJS Dipalsukan, Ketua DPR: Sektor Kesehatan Kok Serba Palsu', 'Kartu berlabel Badan Penyelenggara Jaminan Sosial (BPJS) Kesehatan yang dianggap palsu beredar di Desa Kertajaya, Kabupaten Bandung Barat, Jabar. Ketua DPR Ade Komarudin mengaku kaget karena lagi-lagi ada pemalsuan di sektor kesehatan. "Saya kaget juga. Ini sektor kesehatan kok serba palsu. Ini rupanya sektor empuk untuk dipalsukan," kata Ade di Gedung DPR, Senayan, Jakarta Pusat, Senin (25/7/2016). Sebelumnya, masyarakat dibikin resah dengan beredarnya vaksin palsu. Menurut Ade, maraknya praktik pemalsuan karena kesehatan adalah hal utama yang dibutuhkan masyarakat. "Kesehatan itu kebutuhan pokok, mungkin karena itu bisnis yang menggiurkan. Kok semuanya dipalsukan," ujar politikus Golkar ini. Ade meminta Komisi IX yang membidangi kesehatan untuk mendalami adanya kasus pemalsuan kartu BPJS ini. "Praktik-praktik pemalsuan kesehatan kok makin merajalela," keluhnya. Komisi IX sebelumnya sudah membentuk Panja Vaksin Palsu untuk mendalami peredaran vaksin palsu di berbagai lokasi. Dengan adanya kasus baru di bidang kesehatan ini, dia menilai pansus akan lebih efektif. "Saya akan sampaikan ke Komisi IX. Kalau terlalu banyak, selain panja bila perlu pansus. Agak kesetrum kalau pansus. Mereka akan terpikir betul," ucap Ade. Sebelumnya diberitakan, 230 warga Desa Kertajaya, Kecamatan Padalarang, Kabupaten Bandung Barat, mengaku kecewa karena memiliki kartu BPJS palsu. Padahal, warga membuat kartu BPJS Kesehatan tersebut dengan cara dikolektifkan melalui aparatur desa.  Saat dikonfirmasi, Kepala Desa Kertajaya Fauzy Samsul membenarkan telah memfasilitasi pembuatan kartu BPJS Kesehatan bagi warga kurang mampu. Namun, yang mengejutkan aparatur desa malah menyerahkan pembuatan kartu tersebut ke pihak kedua yakni Rumah Peduli Duafa (RPD) dengan menarik iuran warga Rp 100 ribu/orang.', NULL),
	(19, 71, 'Reshuffle Makin Dekat, PKB Yakin Menterinya Tak Dikurangi Jokowi', 'Presiden Joko Widodo (Jokowi) melarang para menterinya pergi ke luar kota pada pekan ini. Meski dengan alasan ada rapat kabinet paripurna, larangan ini memunculkan spekulasi menguatnya sinyal reshuffle Kabinet Kerja.  Politisi Partai Kebangkitan Bangsa Maman Imanulhaq sebagai salah satu pengusung Jokowi-Kalla tak bisa memastikan bahwa akan ada reshuffle dalam waktu dekat ini. Namun dia yakin kalaupun ada reshuffle, paling hanya reposisi. Dia juga optimistis kader PKB di kabinet tak akan ada yang dicopot.  "Menurut saya kalau pun ada pergantian, paling reposisi dan PKB yakin keputusan Presiden memberikan yang terbaik untuk PKB, tidak ada pengurangan kursi," kata Maman kepada detikcom, Senin (25/7/2016). Meski begitu, Maman mengatakan bahwa dua tahun pemerintahan Jokowi-JK sudah menunjukan kinerja yang baik dan solid, maka tidak perlu ada reshuffle. Justru mendorong agar kabinet kerja lebih giat. "Tidak perlu ada reshuffle, saatnya kita mendorong para menteri tetap bekerja lebih giat lagi agar apa yang dicanangkan Presiden tercapai," ujarnya. Soal masuknya Golkar dan PAN dalam barisan pendukung pemerintah yang dispekulasikan dapat kursi menteri, Maman meyakini kedua partai itu tidak melulu menginginkan kursi menteri atas duukungan ke pemerintah. "Kalau saya mengacu pendapat Sekjen Golkar Pak Idrus Marham begitu juga teman-teman PAN, tidak harus selalu sisi menteri. Mereka punya keahlian di bidang tertentu yang bisa membantu Presiden Jokowi," terang Maman. "Kita hormati PAN dan Golkar, tapi bukan harus punya kursi di kabinet," imbuh anggota DPR RI itu. Soal kinerja menteri-menteri PKB, Maman mengklaim selama ini sudah sangat baik. Yaitu Menteri Desa Marwan Jafar, Menteri Ketenagakerjaan Hanif Dakhiri, Menpora Imam Nachrowi, dan Mendikti M Nasir. "(Reshuffle) itu hak Presiden, kami tekankan pad menteri-menteri kami terus bekerja," kata Maman.', NULL),
	(20, 72, 'Ahok Dijadwalkan Jadi Saksi di Sidang Suap Raperda Reklamasi', 'Gubernur DKI Jakarta Basuki Tjahaja Purnama (Ahok) dijadwalkan menjadi saksi dalam sidang lanjutan perkara suap pembahasan Raperda reklamasi. Ahok akan bersaksi untuk terdakwa eks bos PT Agung Podomoro Land (APL), Ariesman Widjaja. "Saksi sekitar 5 orang. Ada (dari) APL, kalau nggak salah Ahok datang," kata anggota tim pengacara Ariesman, Ibnu Akhyat, saat dikonfirmasi, Senin (25/7/2016). Sidang akan digelar pukul 15.00 WIB sore nanti di Pengadilan Tindak Pidana Korupsi (Tipikor) Jl Bungur, Jakarta Pusat. Ahok sebelumnya menyatakan siap memberi keterangan sebagai saksi di persidangan bila dibutuhkan. Ariesman menjalani sidang dengan dakwaan menyuap Mohamad Sanusi agar membantu mempercepat pembahasan dan pengesahan Raperda tentang Rencana Tata Ruang Kawasan Strategis Pantai Utara Jakarta. Jaksa pada KPK menyebut suap total Rp 2 miliar diberikan agar Ariesman memiliki legalitas melaksanakan pembangunan di Pulau G kawasan reklamasi pantai utara Jakarta. Suap ini diberikan ke Sanusi melalui anak buah Ariesman, Trinanda Prihantoro.', NULL),
	(21, 73, 'Pulau Sangat Kaya Oksigen Minim Listrik dan Air Bersih', 'Selain dijuluki sebagai pulau oksigen, Pulau Giliyang di Sumenep, Madura juga punya kekhasan lainnya. Pulau mungil yang berada di Timur Pulau Madura tersebut hanya memiliki angkutan umum tiga roda atau odong- odong yang biasa digunakan mengangkut orang maupun barang. Di Giliyang, odong-odong akan berjejer di pintu pelabuhan yang siap mengantarkan orang yang baru saja menjangkau pulau yang biasanya menggunakan perahu motor. Motor dengan roda tiga itu dimodifikasi dengan bangku panjang yang terbuat dari kayu yang dipasang di bagian kanan dan kiri sebagai tempat duduk penumpang. Setiap odong-odong akan bisa mengangkut hingga delapan orang. Bahkan lorong tengah juga kadang diisi dua penumpang dengan berdiri. Para penumpang bisa naik dengan ongkos Rp3 ribu. Namun jika diangkut dengan barang memenuhi odong-odong, maka harus membayar hingga Rp30 ribu. Warga sekitar mengatakan bahwa odong-odong memang sudah lama menjadi sarana transportasi. Tidak ada mobil sejenis angkutan kota (angkot). Namun ada alternatif ojek motor. "Dulu pernah diaspal (jalanan di pulau) tapi selalu cepat rusak," kata Abu Nawi, warga Giliyang kepada VIVA.co.id beberapa waktu lalu. Saat ini hanya ada satu jalan utama yang ada di pulau yang dibangun dengan batako. Menurut pantauan VIVA.co.id tak hanya kesulitan dalam hal transportasi, warga di pulau itu juga kesulitan mendapatkan air bersih. Pasalnya penyulingan air tawar belum disiapkan pemerintah. Selain itu, warga juga sangat terbatas mendapatkan pasokan listrik sehingga harus membeli genset maupun pembangkit listrik tenaga surya. Padahal pulau ini adalah salah satu pulau yang kandungan oksigennya paling tinggi di dunia sehingga di pulau tersebut tak sulit menemukan lanjut usia berumur hingga 100 tahun. Diprediksi, Pulau Giliyang akan makin banyak dikunjungi para wisatawan.', NULL),
	(22, 74, 'Dua WNI Korban Kapal Tenggelam di Johor Teridentifikasi', 'Konsulat Jenderal RI Johor Baru tengah mengupayakan pemulangan Warga Negara Indonesia (WNI) yang menjadi korban selamat maupun meninggal, dari peristiwa tenggelamnya kapal di Pantai Batu Layar, Johor, Malaysia Sabtu pekan lalu. Hingga pagi ini, otoritas penyelamat Malaysia telah menemukan kembali dua jenazah pria. "Dari 10 jenazah, hingga saat ini baru ada dua yang berhasil diidentifikasi secara visual oleh keluarga mereka di Malaysia. Dengan demikian hingga saat ini, total ada 10 jenazah dan satu bayi," tulis keterangan resmi Konjen RI Johor Baru, Senin, 25 Juli 2016. Sebagaimana dalam kasus serupa sebelumnya, salah satu tantangan dalam identifikasi adalah kondisi jenazah serta tidak adanya tanda pengenal yang dapat dijadikan rujukan. Dengan penemuan baru tersebut, berarti masih ada sekitar 18 penumpang yang hingga kini belum ditemukan.  Dari 34 orang yang berhasil diselamatkan, diketahui beberapa di antaranya berasal dari NTB (10 orang), Jawa Timur (sembilan orang), Aceh (empat orang), Sumatera Utara (empat orang), NTT (tiga orang), Banten (dua orang), Jambi (satu orang), dan Sumatera Barat (satu orang). Kapal yang tenggelam tersebut diketahui tengah dalam perjalanan dari Johor menuju Batam, dengan membawa 62 orang. Diduga kuat kapal yang tenggelam adalah kapal yang berlayar secara tidak resmi, atau melalui jalur belakang. Sejak tahun 2013, sekurangnya sudah terjadi 7 kali peristiwa tenggelamnya kapal pengangkut TKI yang tidak memiliki dokumen, melalui jalur tidak resmi. Dari tujuh peristiwa tersebut, tercatat sekurangnya 152 orang meninggal dunia dan hilang.', NULL),
	(23, 75, 'Anak Indonesia Dihantui Situasi Pengebirian Masa Depan', 'Anggota Komisi VIII DPR RI Ledia Hanifa mengingatkan pemerintah, bahwa ada hal yang sangat penting di luar masalah kebiri bagi pelaku kejahatan, yaitu kebiri masa depan anak bangsa yang tengah terjadi secara intens di negeri ini. Menurut Ledia, saat ini anak Indonesia tengah dihantui situasi pengebirian masa depan dari berbagai sudut yang kian meningkat. Misalnya, penyalahgunaan narkoba di kalangan remaja, kekerasan pada anak, kejahatan seksual, paparan pornografi semakin mudah ditemui, minimnya keteladanan, hingga kian lemahnya hubungan sosial yang positif baik di lingkungan keluarga, sekolah, dan keseharian. "Bahkan, modal sosial kesalehan anak-anak kita yang bisa menempanya menjadi generasi penerus yang berbudi luhur, kini semakin tergerus," kata Ledia di Senayan, Senin 25 Juli 2016. Di sisi lain, Politisi PKS ini melihat, Perppu Nomor 1 Tahun 2016 tentang Perlindungan Anak, hingga kini masih belum mendapat kepastian akan disahkan menjadi Undang-Undang. Beberapa pihak memilih untuk merevisi Undang-undang Perlindungan Anak secara lebih komprehensif ketimbang sekedar meresmikan Perppu yang lebih dikenal sebagai Perppu Kebiri itu sebagai Undang-undang. "Pada dasarnya semua memiliki argumen untuk melindungi anak Indonesia. Hanya tinggal dikaji mana yang bisa memberikan perlindungan maksimal bagi anak Indonesia," ucapnya. Karena itu, Ledia berharap ada kebijakan yang bisa diambil pemerintah bersama pihak legislatif yang secara lebih sistematis, simultan, dan komprehensif bisa memberikan perlindungan kepada anak Indonesia. Ledia menguraikan beberapa peraturan perundangan terkait perlindungan anak misalnya belum memasukkan konteks pengasuhan dan ketahanan keluarga yang bisa menjadi pondasi penguatan modal sosial dan modal kesalehan kepribadian anak. "Kebijakan ramah anak juga belum menjadi bagian dari indikator pembangunan, sementara konsep kota/kabupaten layak anak masih menggunakan ukuran kuantitatif data," jelasnya. Ledia yakin kesadaran untuk menjadikan kebijakan ramah anak sebagai salah satu indikator pembangunan ini dapat meminimalisir pelanggaran hak anak, sementara penegakan hukum yang jelas dan tegas dapat meminimalisir terjadinya kekerasan atau kejahatan pada anak. "Kalau berorientasi pada yang terbaik bagi anak, kita tak akan mentolerir lagi misalnya, lagu-lagu, iklan, sinetron, film, game, situs, aplikasi, bacaan, komunitas yang mengajarkan pelecehan pada teman, guru dan orangtua, atau yang mengajarkan mudahnya mengumbar amarah, hasad, hasut, iri dan dengki, apalagi yang sampai berisi nilai-nilai kekerasan, porno dan kebebasan yang melanggar norma masyarakat dan nilai agama," ujarnya.  (Webtorial)', NULL),
	(25, 76, 'Menko Darmin Klaim Ekonomi RI Bergerak Positif', 'Menteri Koordinator Bidang Perekonomian, Darmin Nasution, optimistis bahwa kondisi perekonomian Indonesia pada tahun ini akan jauh lebih menggeliat dibandingkan 2015. Darmin menyebutkan, perlahan tapi pasti, pergerakan positif dari beberapa indikator pertumbuhan ekonomi nasional mulai terlihat secara jelas. Hal ini tercermin dari sejumlah data ekonomi makro nasional yang menunjukkan perbaikan. "Data year on year memang belum terlihat ada pergerakan. Tapi, kalau dilihat lebih jauh, makin sudah terlihat pergerakan ekonomi kita," ujar Darmin dalam sambutan di kantornya, Jakarta, Senin 25 Juli 2016. Misalnya, dijelaskan Darmin, seperti sektor ritel yang dalam beberapa bulan terakhir cenderung melemah, namun pada kuartal II-2016 justru mengalami perbaikan cukup signifikan. Di sisi lain, penjualan mobil ikut menggeliat di tiga bulan kedua tahun ini. Hal senada turut disampaikan oleh Direktur Eksekutif Departemen Kebijakan Ekonomi dan Moneter Bank Indonesia, Juda Agung, yang dalam kesempatan ini ikut menjadi pembicara dalam sesi diskusi di kantor Kemenko Perekonomian. Menurut Juda, sektor ritel sejak kuartal III-2015 tumbuh relatif rendah. Bahkan, sempat terjadi kontraksi pada rentang 2008-2009. Pencapaian pada kuartal II-2016 cukup positif. "Good news dari ritel, penjualan durable goods dari komponen perlengkapan rumah tangga meningkat. Artinya, ada ekspektasi bahwa penghasilan akan meningkat," kata Juda. Begitu juga dengan penjualan mobil yang hingga kuartal II-2016 tercatat mampu tumbuh 6,5 persen. Meski begitu, pemerintah dan otoritas moneter tetap menyepakati bahwa tidak semua indikator pertumbuhan mampu tumbuh positif. "Walaupun memang, kalau dilihat dari penjualan semen, masih belum begitu meyakinkan," ujar Darmin. Secara agregat, ia menjelaskan, kondisi ekonomi nasional pada tahun ini sudah bergerak cukup baik. Apalagi, pemerintah pun terus berupaya melakukan berbagai cara untuk kembali menggairahkan ekonomi Indonesia. "Akhir-akhir ini, kami sedang giat-giatnya menggerakkan kebijakan pengampunan pajak. Semoga berjalan dengan baik," kata Darmin.', NULL),
	(26, 77, 'Lakukan Empat Langkah Mudah Ini agar Anda Tetap Sehat', 'Keluarga bahagia ditandai oleh berbagai indikator. Salah satu indikatornya adalah gaya hidup anggota keluarga. Anda bersama anggota keluarga lainnya jarang atau bahkan terhindar dari ancaman berbagai penyakit, akibat pola hidup yang keliru. Keluarga bahagia cenderung menunjukkan perilaku hidup sehat. Ini mengingatkan kita pada salah seorang anggota keluarga yang sering sakit. Sudah pasti mengganggu ketenteraman jiwa anggota keluarga lainnya. Apalagi saat ini biaya pengobatan bukannya semakin murah. Dengan pengeluaran biaya untuk berobat, akan berpengaruh pada perjalanan ekonomi keluarga, apalagi bagi keluarga menengah ke bawah. Di sinilah pentingnya penerapan gaya hidup sehat dalam sebuah keluarga. Ada 4 ciri khas gaya hidup sehat dan murah dalam keluarga. Keempat ciri khas gaya hidup sehat ini sangat mudah dan tidak perlu biaya mahal. 1.Pola makan sehat dan seimbang Pola makanan sehat tidak harus dengan makanan yang mahal. Namun yang penting adalah susunan menu seimbang. Yaitu menu yang terdiri dari unsur-unsur nutrisi yang dibutuhkan oleh tubuh. Misalnya, unsur karbohidrat sebagai pembangkit energi kimia dalam tubuh. Kemudian unsur protein sebagai pembangun sel-sel tubuh. Sedangkan unsur lemak berfungsi untuk memberi panas tubuh dalam jumlah terbatas. Unsur-unsur penting tersebut harus dilengkapi dengan vitamin dan mineral sebagai pelancar proses metabolisme dalam tubuh. 2.Minum air putih yang cukup Agar proses metabolisme berjalan lancar dan mencegah dehidrasi, setiap anggota keluarga perlu minum air putih yang cukup. Tidak ada takaran pasti berapa katagori cukup. Namun disesuaikan kebutuhan masing-masing anggota keluarga. 3.Istirahat yang cukup Istirahat yang paling baik adalah tidur. Orang dewasa minimal tidur selama lebih kurang 8 jam setiap hari. Itu sudah termasuk tidur pada siang hari. Manfaat tidur pada siang hari sekadar memberi suasana santai pada fisik dan psikis dari kegiatan rutin yang melelahkan. 4.Olahraga yang teratur Teratur dalam pengertian ini adalah rutin melakukan olahraga. Tidak mesti dalam waktu lama atau melakukan olahraga berat. Yang penting adalah olahraga ringan dan menyenangkan hati. Misalnya jalan kaki, ini olahraga yang paling murah atau tidak mengeluarkan biaya. Menyapu halaman setiap pagi secara rutin juga termasuk olahraga ringan yang tidak membutuhkan biaya. Tentu masih banyak contoh lainnya yang dapat dilakukan oleh setiap anggota keluarga.', NULL),
	(27, 78, 'Rio Haryanto Fokus ke GP Jerman Ketimbang Posisinya di Manor', 'Masa depan Rio Haryanto di Manor Racing masih belum menemui kejelasan. Walau posisinya terancam diambil alih pembalap lain, pembalap asal Indonesia ini tetap fokus untuk gelaran balap GP Jerman. Beredar kabar bila GP Hungaria yang berlangsung pada Minggu 24 Juli 2016, adalah balapan terakhir Rio bersama Manor. Ini tak lain karena pembalap berusia 23 tahun tersebut belum melunasi sisa pembayaran kepada tim asal Inggris ini, sebesar 7 juta euro. Hingga saat ini, Rio masih kesulitan mendapatkan sponsor untuk melunasi sisa pembayarannya tersebut. Di sisi lain, pemerintah Indonesia melalui Menpora sudah pasrah dalam pencarian dana, dan menyerahkan semuanya kepada Manor. Manor sendiri menyatakan ingin Rio tetap membalap semusim penuh pada musim balapan tahun ini. Akan tetapi, mereka juga sudah memiliki beberapa rencana lain bila Rio tak bisa melunasi utang tersebut. Dengan kondisi yang belum jelas ini, Rio mengaku tidak terlalu memikirkannya. Pembalap asal Solo ini hanya fokus kepada balapan selanjutnya di Jerman pada 31 Juli mendatang, demi bisa meraih hasil terbaik. "Dari sisi saya sekarang hanya fokus untuk Jerman, dan juga tim [Manor] juga fokus untuk Jerman," kata Rio, seperti dilansir Reuters. Hingga 11 seri yang sudah berlangsung, penampilan Rio memang belum memuaskan. Dia terdampar di dasar klasemen tanpa poin, dan sudah tiga kali gagal melanjutkan balapan, sedangkan Pascal Wehrlein yang menjadi rekan setimnya berada di posisi 17.', NULL),
	(28, 79, 'Ganjil Genap Bakal Diterapkan, Warga Lebih Suka 3 In 1', 'Sistem ganjil genap akan diuji coba di sejumlah ruas jalan di Jakarta mulai Rabu, 27 Juli 2016. Uji coba akan berlangsung hingga 26 Agustus 2016. Ganjil genap bakal diberlakukan mulai 30 Agustus 2016. Sistem itu diterapkan untuk menggantikan aturan three in one (3 in 1) yang telah dihapus dari Jakarta. Sejumlah warga tak setuju dengan pemberlakuan sistem ganjil genap. Riomar, mahasiswa sebuah perguruan tinggi swasta di Jakarta, misalnya. Menurut dia, lebih baik sistem 3 in 1 daripada sistem ganjil genap. "Ya kalau ganjil genap gini pemakaian mobilnya jadi enggak maksimal. Ke kampus saja sudah susah. Belum lagi kalau saya lagi narik online jauh, lebih mending 3 in 1," kata pria yang juga berprofesi sebagai pengemudi taksi online itu. Hal senada disampaikan Adinda, pegawai swasta di kawasan Sudirman, Jakarta. "Gue sih enggak tiap hari bawa mobil. Tapi kalau orang yang tiap hari bawa kasihan juga harus selang-seling bawa mobilnya. Kan sistem ganjil genap gini susah aja gitu," ujarnya. Seperti diketahui, sistem genap ganjil merupakan konsep pembatasan kendaraan yang mengacu pada dua nomor terakhir pelat nomor kendaraan. Sebelumnya, Gubernur DKI Jakarta Basuki Tjahaja Purnama telah menghapus aturan three in one. Sebagai pengganti three in one direncanakan akan diterapkan electronic road pricing (ERP). Namun, lantaran pembangunan infrastruktur sistem ERP masih terkendala, Pemerintah Provinsi DKI akan memberlakukan sistem ganjil genap lebih dulu. Sistem ganjil genap diberlakukan di ruas jalan yang semula diterapkan three in one di DKI Jakarta. Ruas jalan tersebut di antaranya di Jalan Sisingamangaraja, Jalan Sudirman, Jalan Thamrin, Jalan Medan Merdeka Barat dan sebagian Jalan Gatot Subroto. Aturan ini diberlakukan pada Senin-Jumat, pukul 07.00-10.00 WIB dan 16.00-20.00 WIB. Saat aturan diberlakukan, pada tanggal ganjil hanya kendaraan dengan dua nomor terakhir berakhiran ganjil yang dapat melintasi jalan-jalan tersebut. Kemudian, pada tanggal genap hanya kendaraan dengan dua nomor akhir berakhiran genap yang bisa melintasi ruas jalan itu.', NULL),
	(29, 80, 'Empat Ribuan Tentara Jadi Korban Kecelakaan', 'SAAT pertamakali diajak bro Willy, region commander Tiger Riders Club (Tric) Indonesia untuk membahas keselamatan jalan (road safety) di kalangan Tentara Nasional Indonesia (TNI), saya merespons antusias. Saat itu yang terlintas di benak saya adalah menyeberangkan pemahaman road safety di kalangan penjaga kedaulatan Republik Indonesia. Menularkan pemahaman sekaligus menggugah peran TNI dalam mewujudkan lalu lintas jalan yang aman dan selamat. Maklum, data Korlantas Mabes Polri menyebutkan, dalam rentang 2010-2014 sekitar 4.300 anggota TNI menjadi korban kecelakaan lalu lintas jalan. Korban tersebut mencakup meninggal dunia, luka berat, dan luka ringan. Sedangkan dari sisi pelaku jalan, tercatat sekitar 3.100 anggota TNI yang terlibat kecelakaan. Oh ya, komposisi TNI sebagai korban maupun pelaku kecelakaan memang amat minim, yakni masing-masing sekitar 1% dari total korban maupun pelaku kecelakaan. Ajakan bro Willy akhirnya terwujud pada Minggu, 24 Juli 2016. Kami mengunjungi Markas Komando Sektor Pertahanan Udara Nasional I/Jakarta (Kosekhanudnas I), di Lanud Halim Perdanakusuma, Jakarta Timur. Instansi tersebut bagian dari Kohanudnas yang kini memiliki empat sektor. Wilayah tanggung jawab Kosek Hanudnas I meliputi Riau, Laut Cina Selatan, Kalimantan bagian Barat, Laut Jawa, Jawa Barat, Jawa Tengah, dan sebagian Samudera Indonesia. Laman kohanudnas.mil.id menyebutkan, Kohanudnas adalah Komando Gabungan Khusus yang merupakan Kotama Utama Operasi TNI dengan komponen TNI AU sebagai kekuatan inti, diperkuat dan dibantu oleh unsur-unsur kekuatan angkatan lain.  Kohanudnas juga merupakan Komando Utama Pembinaan TNI AU  yang berkedudukan langsung di bawah Panglima TNI dalam bidang pembinaan kesiagaan operasi dan pelaksanaan Operasi Pertahanan Udara, di wilayah udara nasional , dan Kasau dalam bidang pelaksanaan pembinaan administrasi dan kesiapan unsur TNI AU untuk operasi Hanud. Komando Sektor Pertahanan Udara Nasional merupakan Komando pelaksana operasi pertahanan udara yang dipimpin oleh seorang Panglima dan bertanggung jawab kepada Panglima Komando Pertahanan Udara Nasional (Pangkohanudnas). “Kami menjadi penjaga langit Indonesia,” tutur Panglima Kosekhanudnas I, Marsekal Pertama TNI Novyan Samyoga, dalam paparannya, Minggu pagi. Bagi saya, ini adalah kali pertama memaparkan soal road safety di kalangan TNI. Mengajak TNI, khususnya TNI Angkatan Udara (AU) untuk andil dalam keselamatan jalan menjadi pengalaman tersendiri. Bagi saya, TNI memiliki keunggulan dari warga sipil. Ada tiga hal utama yang dapat menjadi bekal besar TNI dalam mendukung terwujudnya lalu lintas jalan yang aman dan selamat. Ketiganya mencakup disiplin yang tinggi, jiwa nasionalisme yang kuat, dan figur teladan. Khusus yang terakhir, maksudnya, bila TNI mampu memberi contoh yang baik kepada publik akan mudah ditiru oleh masyarakat kebanyakan. Soal yang kedua tentu tidak bisa dibantah mengingat TNI punya sistem yang solid dan berdisiplin kuat. Bila hal ini diterapkan juga di jalan raya, tentu menjadi bekal yang dahsyat. Maklum, kedisiplinan pula yang kini menjadi persoalan di lalu lintas jalan. Begitu juga dengan persoalan nasionalisme. Di dada TNI merah putih adalah mutlak. Rasa cinta Tanah Air diwujudkan dengan menyerahkan jiwa raga untuk keutuhan Ibu Pertiwi. Manakala kecelakaan lalu lintas jalan mengancam kehidupan anak bangsa yang sepanjang 20 tahun terakhir merenggut lebih dari 300 ribu jiwa, TNI bisa menjadi garda terdepan. Khususnya, lewat figur teladan dengan mencontohkan kedisiplinan yang tinggi saat berlalu lintas jalan. Tentu saja, salah satu wujud kedisiplinan adalah dengan mentaati aturan yang berlaku saat ini. “Hal ini perlu terus disosialisikan dan saya ingin ikut mensosialisasikan di kalangan saya,” tutur Panglima saat berdialog dengan saya di ajang diskusi bertajuk ‘Peran TNI dalam Keselamatan Jalan’. Tapi, tambah Panglima, dirinya juga berharap Tric ikut mensosialiasikan keselamatan jalan di kalangan anggota pesepeda motor. Sontak hal itu ditimpali bro Willy bahwa pihaknya terus aktif mensosialisasikan road safety di kalangan pengguna jalan, termasuk di kalangan anggota kelompok pesepeda motor. Diskusi itu bagian dari kunjungan Tric ke Kosekhanudnas I yang digelar Minggu. “Kami ingin sesuatu yang berbeda dan ingin menjadikan kegiatan ini sebagai fortofolio kami,” tutur bro Dave Masri, region comander Tric Indonesia saat berbincang dengan saya seusai diskusi.', NULL),
	(30, 81, 'Empat Permainan Ini Lebih Berbahaya dari Pokemon Go', 'Banyak orang yang menyukai permainan Pokemon Go. Walaupun begitu, permainan ini dianggap berbahaya dan bisa mengancam nyawa para pemainnya. Kenapa bisa begitu? Pokemon Go mengharuskan para pemainnya untuk berjalan di dunia sungguhan dalam usaha untuk menangkap monster Pokemon. Hal itulah yang bisa menempatkan para pemainnya dalam bahaya. Kadang beberapa orang terlalu fokus menatap layar smartphone mereka, sementara kondisi sekitar yang mereka lewati tidak diperhatikan. Yang lebih berbahaya lagi, banyak pengguna yang bermain Pokemon Go sambil mengemudi. Karena fokus pada permainan sementara jalanan tidak diperhatikan, tidak menutup kemungkinan akan terjadi kecelakaan. Karena hal itu, Pokemon Go dianggap sebagai permainan yang berbahaya. Selain Pokemon Go, ada beberapa permainan lain yang dianggap lebih berbahaya lagi. Jika sudah bermain dalam permainan ini, berarti para pemainnya sudah siap berada dalam situasi berbahaya. 4. Grand Thef Auto (GTA) Kalian pasti sudah tahu kenapa game besutan Rockstar Games ini dianggap berbahaya. Game ini mampu mendorong seseorang untuk melakukan kejahatan seperti yang dilakukan karakter dalam game ini. Misalnya saja membunuh, memerkosa, atau mencuri. Pada tanggal 7 Juni 2013, seorang pria bernama Devin Moore ditangkap polisi karena telah mencuri mobil. Ketika hendak ditangkap, pemuda itu meraih salah satu pistol petugas polisi dan kemudian menembakannya kepada dua orang polisi dan satu orang operator. Tiga orang itu tewas ditembak dalam insiden mengerikan ini. Setelah diselidiki secara fsikologis, ternyata Moore nekad melakukan hal itu karena terinspirasi dari permainan GTA. Selain itu, masih banyak lagi kejahatan yang terjadi akibat permainan GTA. 3. Bermain game online PC Game online PC lain lagi dengan game online yang ada di smartphone. Game online PC lebih berbahaya lagi karena bisa memboroskan segala hal, mulai dari waktu, uang, dan tenaga. Seseorang bisa menipu orang tuanya demi mendapatkan uang agar bisa lama-lama di warnet. Selain itu, berlama-lama di warnet bisa membuat kondisi kesehatan menurun. Beberapa waktu lalu saja, seorang pria asal China ditemukan dengan kondisi kaki membusuk setelah nonstop main game online di warnet selama 6 hari. Game online PC bisa membuat seseorang malas bekerja. 2. Main \'Pacar-Pacaran\' Ada perbedaan spesifik antara pacaran dengan pacar-pacaran. Pacaran boleh saja didasari atas nama cinta, sedangkan pacar-pacaran bisa saja didasari atas nama nafsu. Kalian pasti sudah tahu apa akibatnya jika segala sesuatu didasari dengan nafsu. Awalnya sih memang nikmat, tapi akhirnya melarat. 1. Main saham Bermain saham bisa untuk besar jika untung, tapi jika rugi bisa rugi besar. Harta benda kamu bisa habis dalam sekejap karena salah bermain saham. Yang pada akhirnya bisa membuat kamu depresi hingga nekad melakukan tindakan bunuh diri. Jadi, teliti yah kalau main saham. Nah, itulah beberapa permainan yang lebih berbahaya dari Pokemon Go. Menurut kamu mana yang paling berbahaya? Kalau menurut aku sih nomor 2', NULL),
	(31, 82, 'Nolito Menolak Barcelona demi ManCity', 'Gelandang Spanyol, Nolito, menolak tawaran Barcelona dan memilih bergabung dengan Machester City. Nolito beralasan, ia ingin bermain di bawah manajer Pep Guardiola dan ingin meraih kesuksesan bersama ManCity.  Nolito sempat bimbang ketika Barcelona dan ManCity sama-sama menginginkannya. ManCity tertarik dengan Nolito, setelah ia tampil impresif di Piala Eropa 2016.   "Saya telah berbicara dengan keluarga, teman, dan manajemen. Saya pikir ini adalah keputusan terbaik saya dan karier," kata Nolito dilansir dari Dailymail, Senin 25 Juli 2016. Sosok Guardiola tidak asing bagi Nolito. Guardiola pernah memberikan kesempatan bermain sebanyak dua kali kepada Nolito di La Liga, musim 2010-2011.  Ketika itu, Nolito masih memperkuat Barcelona B. Nolito pernah memperkuat Barcelona B tahun 2008-2011, sebelum ia hijrah ke Benfica.  "Saya beruntung bisa bermain di Barcelona B. Sekarang saya bersemangat bermain di ManCity. Saya datang ke Etihad Stadium untuk bermain di bawah Guardiola," tutur pemain berusia 29 tahun ini. Nolito percaya, The Citizen akan meraih gelar Premier League di musim pertamanya Guardiola bersama ManCity. ManCity memiliki modal untuk meraih kesuksesan, yaitu skuat yang mumpuni.', NULL),
	(32, 83, 'VIDEO: Hujan Meteor Paling Aktif di 2016', 'Bagi penikmat keindahan astronomi, dalam waktu dekat ini akan disuguhkan hujan meteor Perseid yang akan menghiasi langit pada Agustus. Hujan meteor Perseid tersebut merupakan puncak hujan meteor yang terjadi pada 2016. Sekitar 150-200 meteor per jamnya akan meluncur dalam hujan meteor Perseid. Menurut American Meteor Society, jumlah angka meteor dalam hujan meteor Perseid itu merupakan yang terbesar dan teraktif pada tahun ini, sebab biasanya jumlah meteor sekitar 50-75 meteor. Namun, tahun ini bisa mencapai dua kali lipatnya. Dilansir Patch, Senin, 25 Juli 2016, ahli meteor dari Badan Antariksa Amerika Serikat (NASA), Bill Cooke, mengatakan puncak Perseid tersebut merupakan yang pertama kali sejak 2009. Diperkirakan hujan meteor Perseid terjadi selama 13 Juli hingga 26 Agustus, dengan puncak hujan meteor Perseid akan terjadi pada 12-13 Agustus. Untuk menikmati hujan meteor Perseid, pengamat harus berada jauh dari cahaya kota. Dikarenakan, cahaya lampu-lampu kota yang terpancar akan mengurangi penglihatan saat terjadinya hujan meteor. Setelah itu, bisa menggunakan alat bantuan seperti teleskop yang kemudian mengarahkannya ke bagian timur laut di langit malam. Pada area tersebut akan terpampang konstelasi Perseus. Tengah malam menjadi waktu yang terbaik untuk merasakan keindahan alam ‘melukis’ malam.', NULL),
	(33, 84, 'Siapa Bilang Ganti Kabel Kopling Itu Mahal?', 'Kabel kopling memang menjadi peranti yang terpenting. Tentu saja, kalau sudah putus otomatis motor tidak dapat digunakan. Karena fungsi kabel kopling ini untuk menarik pelat kopling agar kampas bisa bergerak secara halus kalau piring penekanan atau cluth pressure plate sudah rapat. Nah, khusus untuk kabel kopling Kawasaki Ninja RR kalau sudah putus, jangan khawatir ada solusinya nih jika tidak ingin merogoh kocek dalam-dalam. Sebab, menggunakan kabel kopling milik Kawasaki Ninja R juga bisa dan harganya lebih murah. Penelusuran VIVA.co.id ke beberapa bengkel spare parts di kawasan Ciledug, Tangerang. Untuk harga kabel kopling Ninja RR rata-rata dibanderol Rp67 ribu, sedangkan Ninja R hanya Rp30 ribu. Menurut Isa, punggawa Karya Makmur Motor (KMM) bengkel yang biasa menangani Ninja khusus balap, pada dasarnya kabel kopling RR dan R sama saja. Yang berbeda adalah bentuk di tekukan kabel pada handle kopling dan kabel milik Ninja RR lebih panjang, sedangkan Ninja R lebih pendek sekitar 1 sentimeter.   “Panjang pendeknya tidak memengaruhi, malah lebih enak saja kabel kopling RR diganti dengan R, selain lebih murah, pergerakan kawat ', NULL),
	(34, 85, '6 Manfaat Sehat Jadikan Kucing Hewan Peliharaan', 'Kucing cukup lama dikenal sebagai hewan yang banyak dipelihara manusia. Tak hanya sekadar lucu dan menggemaskan, memelihara kucing ternyata juga bisa memberikan banyak manfaat untuk manusia. Berikut manfaatnya, seperti dilansir laman Genius Beauty. 1. Usir sepi Jika ada kucing di rumah, seseorang tidak akan pernah merasa kesepian. Tak hanya lucu, memiliki kontak dengan kucing memberikan banyak manfaat. Siapapun yang merasa kesepian, bisa menjadikan kucing sebagai teman bermain di rumah. Ini tidak hanya akan meringankan kesepian, tapi juga bermanfaat bagi kesehatan Anda. 2. Terapi Autisme Sejumlah penelitian menemukan, membelai kucing memiliki efek menenangkan pada sistem saraf anak-anak autis. Hewan ini bukan hanya bisa menjadi teman untuk si kecil, tetapi juga bisa menjadi obat alami penyembuh autisme. Para ilmuwan pun percaya, memelihara kucing adalah salah satu faktor paling penting dalam pengobatan banyak penyakit sistem saraf. 3. Terapi tulang dan sendi Dengkuran kucing ternyata juga memiliki manfaat, yakni menenangkan saraf bahkan juga bisa menyembuhkan nyeri. Perlu diketahui, seekor kucing mendengkur dengan frekuensi 25-150 Hz. Dan diakui para peneliti, ini bisa dijadikan terapi untuk sendi dan tulang. Oleh karena itu suara kucing mendengkur bisa mengurangi rasa sakit, bengkak, menyembuhkan otot dan ligamen. Mendengkur merupakan bukti lain melakukan interaksi dengan kucing membawa manfaat. 4. Meningkatkan kekebalan tubuh Ini terutama membantu meningkatkan kekebalan anak-anak. Jika hewan peliharaan hidup dengan anak-anak dari lahir dan tumbuh di samping mereka, hal ini membantu untuk memperkuat sistem kekebalan tubuh. Bahkan, bisa meminimalisasi risiko anak mengidap penyakit menular dan mengurangi risiko alergi penyakit pernapasan. Menempatkan kucing di sebelah anak selama tahun pertama hidupnya bisa melatih kekebalan anak, yang menghasilkan antibodi. 5. Meningkatkan suasana hati Waktu yang dihabiskan dengan kucing, memiliki efek menguntungkan pada suasana hati kita. Jika Anda marah, bermain dengan kucing  tau mengelusnya, bisa meredakan emosi. Dengan cara ini, Anda meningkatkan produksi serotonin, hormon yang bisa membuat suasana hati merasa gembira. Tak hanya itu, bermain dengan kucing juga bisa meredam stres. Seperti diketahui, stres berbahaya bagi kesehatan karena bisa menyebabkan sejumlah penyakit, seperti jantung, sakit kepala, depresi. 6. Menurunkan tekanan darah Para ilmuwan telah mengungkapkan, mereka, yang telah lama memelihara kucing di rumah, memiliki puncak tekanan darah lebih terkontrol oleh tubuh. Mereka yang memiliki kucing di rumah 30 persen lebih kecil kemungkinannya untuk menderita stroke atau serangan jantung. Dan perlu diketahui memelihara hewan di rumah membantu melawan stres dan memiliki efek menenangkan pada sistem saraf.', NULL),
	(35, 86, 'Plus Minus Sistem Proporsional Tertutup dan Terbuka', 'Anggota Komisi II Dewan Perwakilan Rakyat (DPR), Hetifah Sjaifudian, mengakui masih adanya polemik dalam persiapan revisi Undang Undang (UU) Pemilihan Umum (Pemilu) mendatang. Polemik tersebut utamanya terkait sistem pemilihan anggota DPR dari tingkat pusat hingga daerah, dengan sistem proporsional tertutup atau terbuka. "Saat ini ada banyak kritik terhadap kaderisasi partai. Maka seharusnya partai memastikan orang-orang yang memiliki kapasitas, integritas dan kapabilitas untuk dikader dan dicalonkan. Setelah duduk agar ikut memperbaiki kualitas Parlemen kita," kata Hetifah saat dihubungi, Senin, 25 Juli 2016. Politikus Partai Golkar ini menjelaskan bahwa salah satu kekeliruan partai saat ini adalah kurangnya internalisasi nilai-nilai parpol terhadap kadernya, termasuk bagi yang masuk ke Parlemen.    "Hal ini salah satunya akibat sistem pemilu proporsional terbuka, sehingga kampanye lebih terfokus pada popularitas individu, bukan pada program-program dan kinerja partai," paparnya. Namun, Hetifah mengatakan, sistem proporsional terbuka mempunyai kelebihan yaitu, adanya peluang yang sama bagi setiap kader yang dicalonkan untuk dipilih. "Rakyat memiliki kedaulatan penuh untuk menentukan siapa yang akan duduk di Parlemen sesuai pilihannya. Caleg (calon legislatif) terpilih lebih dekat dengan konstituen dan harus merawat hubungannya dengan pemilih," ujar Hetifah. Dia mengatakan, baik sistem proporsional tertutup maupun terbuka memiliki kelebihan masing-masing. Sistem proporsional tertutup membuat partai politik lebih berperan. Sementara itu, saat ini yang diberlakukan adalah sistem proporsional terbuka. "Prinsipnya kita harus belajar dari pengalaman dan terus memperbaiki sistem yang ada untuk mendapatkan hasil Pemilu yang terbaik," kata Hetifah. (ase)', NULL),
	(36, 87, 'Enam Manfaat Sehat Pelihara Kucing', 'Kucing dikenal sebagai hewan yang banyak dipelihara manusia. Tak hanya sekedar lucu dan menggemaskan, memelihara kucing ternyata juga bisa memberikan banyak manfaat untuk manusia. Berikut manfaatnya seperti dilansir laman Genius Beauty. 1. Usir sepi Jika ada kucing di rumah, seseorang tidak akan pernah merasa kesepian. Tak hanya lucu, memiliki kontak dengan kucing memberikan banyak manfaat. Siapapun yang merasa kesepian, bisa menjadikan kucing sebagai teman bermain di rumah. Ini tidak hanya akan meringankan kesepian, tapi juga bermanfaat bagi kesehatan Anda. 2. Terapi Autisme Sejumlah penelitian menemukan, membelai kucing memiliki efek menenangkan pada sistem saraf anak-anak autis. Hewan ini bukan hanya bisa menjadi teman untuk si kecil, tetapi juga bisa menjadi obat alami penyembuh autisme. Para ilmuwan pun percaya, memelihara kucing adalah salah satu faktor paling penting dalam pengobatan banyak penyakit sistem saraf. 3. Terapi tulang dan sendi Dengkuran kucing ternyata juga memiliki manfaat, yakni menenangkan saraf bahkan juga bisa menyembuhkan nyeri. Perlu diketahui, seekor kucing mendengkur dengan frekuensi 25-150 Hz. Dan diakui para peneliti, ini bisa dijadikan terapi untuk sendi dan tulang. Oleh karena itu suara kucing mendengkur bisa mengurangi rasa sakit, bengkak, menyembuhkan otot dan ligamen. Mendengkur merupakan bukti lain melakukan interaksi dengan kucing membawa manfaat. 4. Meningkatkan kekebalan tubuh Ini terutama membantu meningkatkan kekebalan anak-anak. Jika hewan peliharaan hidup dengan anak-anak dari lahir dan tumbuh di samping mereka, hal ini membantu untuk memperkuat sistem kekebalan tubuh. Bahkan, bisa meminimalisir risiko anak mengidap penyakit menular dan mengurangi risiko alergi penyakit pernafasan. Menempatkan kucing di sebelah anak selama tahun pertama hidupnya bisa melatih kekebalan anak, yang menghasilkan antibodi. 5. Meningkatkan suasana hati Waktu yang dihabiskan dengan kucing, memiliki