	(37, 88, 'Keuntungan dari Pokemon Go Terbatas, Saham Nintendo Anjlok', 'Saham Nintendo Co akhirnya keok setelah sejak awal bulan ini meroket, terdongkrak euforia game Pokemon Go, yang membuat heboh seluruh dunia. Meskipun, permainan itu baru diluncurkan di beberapa negara.   Dilansir dari Reuters, Senin 25 Juli 2016, pada perdagangan hari ini, saham Nintendo merosot 18 persen. Pelaku pasar keuangan merespons negatif pernyataan resmi perusahaan yang menyebutkan bahwa Pokemon Go hanya memiliki dampak terbatas pada pendapatan.  Nintendo mengatakan hal tersebut pada Jumat pekan lalu, setelah penutupan pasar saham pada Jumat. Perkiraan pendapatan tahunan pun direvisi, walau masih ada potensi kenaikan pendapatan dari fitur baru perangkat Pokemon Go Plus yang baru diluncurkan.  Pokemon Co dan Niantic Inc telah menerima lisensi serta keuntungan dari game tersebut. Kondisi tersebut yang dikatakan membuat keuntungan yang diterima Nintendo terbatas.  Perusahaan yang memiliki 32 persen saham Pokemon Co itu akan melaporkan pendapatan kuartal pertamanya pada Rabu mendatang.  Meski turun, saham Nintendo masih menguat sekitar 60 persen jika dibandingkan dengan awal bulan ini, sebelum game itu diluncurkan. Pokemon Go dirilis pada 6 Juli lalu di Amerika Serikat, Australia, dan Selandia Baru.', NULL),
	(38, 89, 'Cheese in the Trap Buka Audisi Cari Pemeran Utama Wanita', 'Kesuksesan webtoon dan drama Cheese in the Trap di Korea Selatan rupanya menarik minat para pembuat film. Cheese in the Trap akhirnya akan diangkat ke layar lebar dan menjadi proyek kolaborasi China dan Korea. Film ini nantinya masih akan merekrut Park Hae Jin sebagai aktor utama. Menariknya, dilansir Yibada, akan dilakukan audisi untuk menjadi bintang utama wanitanya. Audisi terbuka akan digelar di Korea Selatan dan juga China pada awal Agustus nanti. Perwakilan rumah produksi di Korea Selatan, Mountain Movement Story, mengungkapkan akan mencari aktris wanita untuk memerankan karakter Hong Seol. Dia yang terpilih akan beradu akting dengan Park Hae Jin. Akan tetapi, calon pelamar bukan sembarang wanita. Dia harus sudah bekerja sebagai seorang aktris atau setidaknya memiliki pengalaman dalam dunia seni peran. Para pelamar akan melalui tiga tahap proses seleksi. Pendaftaran untuk audisi terbuka ini bisa melalui situs resmi Mountain Movement Story dan beberapa situs di China yang sudah bekerjasama. Dia yang terpilih bukan hanya membintangi film Cheese in the Trap tapi juga mendapat kontrak endorsment selama satu tahun. Salah satu dari 10 kandidat teratas akan menjadi teman dari Hong Sul, Nam Joo Yeon. Cheese in the Trap movie akan ditangani sutradara Lee Dong Ho yang pernah menggarap Architecture 101. Proses syuting akan dilakukan pada awal 2017.', NULL),
	(39, 90, 'Beredarnya Kartu BPJS Palsu Akibat Sosialisasi yang Minim', 'Beredarnya kartu BPJS palsu di Kabupaten Bandung Barat, Jabar, jadi koreksi tersendiri bagi BPJS sebagai penyelenggaran jaminan kesehatan. Sosialisasi yang selama ini minim sejak diluncurkan menimbulkan banyak akibat. Salah satunya adalah beredar kartu BPJS palsu di masyarakat. Demikian disampaikan Anggota Komisi IX DPR RI Okky Asokawati dalam rilisnya, Senin 25 Juli 2016. “Munculnya kartu BPJS palsu ini merupakan dampak dari sosialisasi yang tidak paripurna di masyarakat. Masyarakat belum sepenuhnya mengetahui tentang prosedur pendaftaran BPJS. Kondisi ini harus menjadi catatan serius bagi manajemen BPJS untuk melakukan pembenahan dan perbaikan,”ujarnya. Menurut Sekretaris Dewan Pakar DPP PPP tersebut, terungkapnya kartu BPJS palsu ini merupakan masalah serius sekaligus jadi bahan koreksi bagi manajemen BPJS. Kinerja Dewan Pengawas (Dewas) BPJS, sambung Okky lagi, juga dinilai tidak maksimal. Dewas pun diimbau agar meningkatkan perannya. “Peristiwa ini menunjukkan kinerja Dewas BPJS tidak maksimal. Komitmen Dewas BPJS yang bakal bekerja maksimal saat uji kelayakan dan kepatutan di DPR, tidak dibuktikan dengan munculnya kartu BPJS palsu. Ke depan, Dewas BPJS agar lebih meningkatkan perannya dalam melakukan pengawasan. Dewas BPJS harus memastikan ke depan tidak ada lagi kasus serupa muncul di lapangan,” ujar Okky. BPJS juga diharapkan segera mengecek peredaran kartu palsu tersebut agar tidak terus merugikan masyarakat. Karena ada peristiwa ini, Okky justru mengusulkan agar anggaran negara untuk BPJS dipisahkan dari anggaran Kemenkes yang selama ini masih menyatu. Pemisahan ini diharapkan bisa dimulai pada APBN 2017 mendatang.  (www.dpr.go.id)', NULL),
	(40, 91, 'Kartu BPJS Palsu Beredar, DPR Meradang', 'Anggota Komisi IX DPR RI Okky Asokawati mengatakan, ada kartu BPJS Kesehatan palsu yang beredar, salah satunya di Kabupaten Bandung Barat. BPJS diminta segera bertindak cepat untuk mengecek dan memastikan di lapangan atas munculnya kartu BPJS palsu tersebut. "Bisa saja, kartu palsu BPJS tersebut tidak hanya muncul di Bandung, tapi di daerah-daerah lainnya. Oleh karenanya, BPJS harus bergerak cepat untuk mengecek di lapangan. Yang pasti kartu BPJS palsu tersebut sangat merugikan masyarakat," kata Okky di Senayan, Jakarta, Senin, 25 Juli 2016. Okky menilai, munculnya kartu BPJS palsu ini merupakan dampak dari sosialisasi yang tidak paripurna di masyarakat. Masyarakat kata dia, belum sepenuhnya mengetahui tentang prosedur pendaftaran BPJS. "Kondisi ini harus menjadi catatan serius oleh manajemen BPJS untuk melakukan pembenahan dan perbaikan. Kartu BPJS palsu jangan dianggap masalah sepele, harus menjadi bahan koreksi manajemen BPJS," ujarnya menambahkan.  Menurut dia, peristiwa ini juga menunjukkan kinerja Badan Pengawas BPJS tidak maksimal. Komitmen Dewas BPJS yang bakal bekerja maksimal saat uji kelayakan dan kepatutan di DPR, seharusnya tidak dibuktikan dengan munculnya kartu BPJS palsu. "Ke depan, Dewas BPJS agar lebih meningkatkan perannya dalam melakukan pengawasan. Dewas BPJS harus memastikan ke depan tidak ada lagi kasus serupa muncul di lapangan," kata Okky. Okky mengusulkan, anggaran negara untuk BPJS sebaiknya dipisah dari Kementerian Kesehatan. Pemisahan itu dimaksudkan agar pengelolaan BPJS seperti dalam hal sosialisasi dapat lebih maksimal. "Harapannya, pemisahan anggaran BPJS dari Kementerian Kesehatan dapat dilakukan dalam APBN 2017 mendatang.”', NULL),
	(41, 92, '24 Negara Ikut Pelatihan SAR se-Asia Pasifik di Yogyakarta', 'Badan SAR Nasional sebagai salah satu anggota International Search and Rescue Advisory Group (Insarag) dan UN Office for the Coordination of Humanitarian Affairs (UN-OCHA), bersama 24 negara anggota Insarag Asia Pasifik, menggelar latihan SAR berkelas internasional dengan tajuk Insarag Asia Pasific Regional Earthquake Response Exercise 2016 yang berlangsung di Yogyakarta pada 25 Juli hingga 29 Juli 2016. "Kegiatan latihan SAR berkelas internasional ini untuk menguji atau memperkuat sistem koordinasi dan pengendalian operasi SAR dalam bencana, antara Basarnas dan lembaga atau instansi terkait secara nasional dan internasional," kata Kepala Basarnas Marsekal Madya FHB Soelistyo di Yogyakarta, Senin, 25 Juli 2016. Menurutnya latihan SAR Insarag ini akan dipusatkan di dua lokasi, yaitu Hotel Ina Garuda untuk teori, sedangkan kegiatan lapangan digelar di lapangan Gudang Garam Jombor, Sleman. "Penyelenggaraan latihan SAR Insarag ini sekaligus mengenang 10 tahun bencana gempa bumi yang melanda Yogyakarta pada Mei 2 06 silam, serta napak tilas ke Gunung Merapi yang erupsi pada tahun 2010," ungkapnya. Soelistyo menjelaskan pelatihan SAR berkelas internasional ini akan diikuti 344 orang, terdiri dari 174 peserta dalam negeri dan 170 peserta luar negeri. Sementara itu, Gatot Saptadi, Asisten Perekonomian dan Pembangunan Sekretaris Daerah DIY, mengungkapkan potensi bencana di Indonesia sebagai negara kepulauan yang memiliki pertempuan empat lempeng tektonik. Kondisi ini membuat ancaman bencana gempa bumi dan tsunami selalu ada, sehingga menilai latihan gabungan SAR semacam ini menjadi hal yang positif dan diperlukan. "Kurun waktu 2004-2010 Indonesia peringkat ke tujuh paling banyak dilanda bencana alam di dunia dengan merenggut ribuan nyawa, harta benda milik penduduk," katanya. Yogyakarta menempati peringkat ke 18 dalam indeks kerawanan bencana alam di Indonesia, dengan tingkat kerawanan mencapai 68 persen. Sebagai pengingat, pada 2006 bencana gempa bumi merenggut lebih dari 6000 jiwa, dan di 2010 erupsi Merapi menghilangkan 300 nyawa. "Perlu usaha tanggap dini terhadap bencana alam yang selalu mengintai warga Yogyakarta," ujarnya. Gatot berharap pelatihan SAR berkelas internasional ini menjadi pembelajaran bagi para pemangku kepentingan, dalam upaya menanggulangi bencana, termasuk mengorganisasi bantuan bencana dari luar negeri.', NULL),
	(42, 93, 'Enam Keutamaan di balik Proses Pencarian Nafkah Halal', 'Mencari nafkah menjadi salah satu kewajiban yang harus dilakukan kepala keluarga ketika sudah berumah tangga. Nafkah ini mencakup pemenuhan kebutuhan keluarga yang ditanggungnya, seperti makanan, minuman, sandang, dan tempat tinggal. Akan tetapi, tidak semua orang mengerti akan hal ini. Masih banyak yang justru menelantarkan keluarga mereka. Tidak hanya itu, ada pula orang yang mencari nafkah dengan cara yang salah, sehingga menyebabkan ia dan keluarganya terjerumus dalam api neraka. Padahal, penting bagi kita untuk mencari nafkah lewat cara yang halal bagi keluarga. Selain akan lebih berkah, ternyata mencari nafkah juga memiliki banyak keutamaan. Lalu apa saja keutamaan yang akan diperoleh? Berikut informasi selengkapnya.  1. Nafkah Kepada Keluarga Lebih Afdhol Dari Sedekah Tathowwu’ (Sunnah) Keutamaan pertama yang akan diperoleh dari mencari nafkah yang halal untuk keluarga adalah nafkah tersebut lebih afdhol dari sedekah tathowwu’ (sunnah). Selain itu, orang yang mencari nafkah juga akan mendapatkan pahala yang jauh lebih banyak. Dari Abu Hurairah, Nabi shallallahu ‘alaihi wa sallam bersabda,“Satu dinar yang engkau keluarkan di jalan Allah, lalu satu dinar yang engkau keluarkan untuk memerdekakan seorang budak, lalu satu dinar yang engkau keluarkan untuk satu orang miskin, dibandingkan dengan satu dinar yang engkau nafkahkan untuk keluargamu maka pahalanya lebih besar (dari amalan kebaikan yang disebutkan tadi)” (HR. Muslim no. 995). Imam Nawawi membuat judul untuk hadits ini, “Keutamaan nafkah bagi keluarga dan hamba sahaya, serta dosa bagi orang yang melalaikan dan menahan nafkahnya untuk mereka”. Dalam Syarh Muslim (7: 82), Imam Nawawi mengatakan, “Nafkah kepada keluarga itu lebih afdhol dari sedekah yang hukumnya sunnah”. Syaikh Muhammad bin Sholeh Al \'Utsaimin rahimahullah pernah menjelaskan, “Sebagian orang tatkala bersedekah untuk fakir miskin atau yang lainnya maka mereka merasa bahwa mereka telah mengamalkan amalan yang mulia dan menganggap sedekah yang mereka keluarkan itu sangat berarti. Adapun tatkala mengeluarkan harta mereka untuk memberi nafkah kepada keluarganya maka seakan-akan perbuatan mereka itu kurang berarti, padahal memberi nafkah kepada keluarga hukumnya wajib dan bersedekah kepada fakir miskin hukumnya sunnah. Dan Allah lebih mencintai amalan wajib daripada amalan sunnah.” (Sebagaimana penjelasan beliau dalam Riyadhus Shalihiin) 2. Jika Mencari Nafkah Dengan Ikhlas, Akan Menuai Pahala Besar Seperti yang sudah dijelaskan di atas bahwasanya mencari nafkah halal bagi keluarga lebih afdhol dari pada sedekah yang hukumnya sunnah. Tidak hanya itu, apabila seseorang mencari nafkah secara ikhlas maka ia akan memperoleh pahala besar dari Allah SWT.  Dari Sa’ad bin Abi Waqqosh, Nabi shallallahu ‘alaihi wa sallam bersabda, “Sungguh tidaklah engkau menginfakkan nafkah (harta) dengan tujuan mengharapkan (melihat) wajah Allah (pada hari kiamat nanti) kecuali kamu akan mendapatkan ganjaran pahala (yang besar), sampai pun makanan yang kamu berikan kepada istrimu.” (HR. Bukhari no. 56). 3. Memberi Nafkah Termasuk Sedekah Tidak hanya akan membuat orang yang mencari nafkah mendapatkan pahala, ternyata amalan yang satu ini juga temasuk dalam sedekah. Dari Al Miqdam bin Ma’dikarib, ia berkata bahwa Rasulullah shallallahu ‘alaihi wa sallam bersabda: “Harta yang dikeluarkan sebagai makanan untukmu dinilai sebagai sedekah untukmu. Begitu pula makanan yang engkau beri pada anakmu, itu pun dinilai sedekah. Begitu juga makanan yang engkau beri pada istrimu, itu pun bernilai sedekah untukmu. Juga makanan yang engkau beri pada pembantumu, itu juga termasuk sedekah” (HR. Ahmad) 4. Harta yang Dinafkahi Semakin Barokah dan Akan Diberi Ganti Ketika seseorang bersemangat untuk mencari nafkah yang halal untuk keluarga mereka, maka harta yang diperolehnya tersebut akan lebih berkah. Tidak hanya itu, Allah SWT juga akan memberi pengganti harta yang telah diberikan kepada keluarga dalam bentuk nafkah tersebut.  Dari Abu Hurairah, Nabi shallallahu ‘alaihi wa sallam bersabda, “Tidaklah para hamba berpagi hari di dalamnya melainkan ada dua malaikat yang turun, salah satunya berkata, “Ya Allah, berilah ganti kepada orang yang senang berinfak.” Yang lain mengatakan, “Ya Allah, berilah kebangkrutan kepada orang yang pelit.” (HR. Bukhari no. 1442 dan Muslim no. 1010). 5. Bentuk Tanggungjawab Kepada Keluarga Keutamaan selanjutnya dari mencari nafkah yang halal bagi keluarga adalah sebagai bentuk tanggungjawab kepada keluarga. Dari Anas bin Malik, Rasul shallallahu ‘alaihi wa sallam bersabda, “Allah akan bertanya pada setiap pemimpin atas apa yang ia pimpin” (HR. Tirmidzi no. 1705) Seorang pemimpin  akan dimintai pertanggungjawaban atas orang-orang yang dipimpinnya, termasuk dalam hal ini kepala keluarga. Mereka akan dimintai pertanggungjawaban atas apa yang mereka nafkahkan kepada keluarganya.  Dalam riwayat Ibnu Hibban disebutkan, “Allah akan bertanya pada setiap pemimpin atas apa yang ia pimpin, apakah ia memperhatikan atau melalaikannya” (HR. Ibnu Hibban 10: 344). 6. Memperhatikan Nafkah Keluarga Akan Mendapat Penghalang Dari Siksa Neraka Keutamaan terakhir yang akan diperoleh dari mencari nafkah halal bagi keluarga ternyata bisa menjadi penghalang dari siksaan api neraka.  ‘Adi bin Hatim berkata, “Selamatkanlah diri kalian dari neraka walau hanya melalui sedekah dengan sebelah kurma” (HR. Bukhari no. 1417) ‘Aisyah radhiyallahu \'anha berkata, “Ada seorang ibu bersama dua putrinya menemuiku meminta makanan, akan tetapi ia tidak mendapati sedikit makanan pun yang ada padaku kecuali sebutir kurma. Maka aku pun memberikan kurma tersebut kepadanya, lalu ia membagi sebutir kurma tersebut untuk kedua putrinya, dan ia tidak makan kurma itu sedikit pun. Setelah itu ibu itu berdiri dan pergi keluar. Lalu masuklah Nabi shallallahu \'alaihi wa sallam, maka aku pun mengabarkannya tentang ini, lantas beliau bersabda,  "Barangsiapa yang diuji dengan sesuatu dari anak-anak perempuan lalu ia berbuat baik kepada mereka, maka mereka akan menjadi penghalang baginya dari api neraka" (HR. Bukhari no 1418 dan Muslim no 2629). Ummu Salamah, istri Nabi shallallahu ‘alaihi wa sallam, ia berkata bahwa Rasulullah shallallahu \'alaihi wa sallam bersabda, “Barangsiapa mengeluarkan hartanya untuk keperluan kedua anak perempuannya, kedua saudara perempuannya atau kepada dua orang kerabat perempuannya dengan mengharap pahala dari Allah, lalu Allah mencukupi mereka dengan karunianya, maka amalan tersebut akan membentengi dirinya dari neraka” (HR. Ahmad) Demikianlah informasi mengenai enam keutamaan yang akan diperoleh ketika seseorang mencari nafkah bagi keluarganya. Maka dari itu, carilah nafkah yang halal untuk keluarga tercinta di rumah. Sebab Allah SWT memberikan ganjaran luar biasa bagi orang yang melakukannya.', NULL),
	(43, 94, 'IDI Tolak Eksekusi Kebiri, Kemenkes Diminta Cari Alternatif', 'Ketua DPR Ade Komarudin memberikan komentar soal penolakan Ikatan Dokter Indonesia (IDI) sebagai eksekutor dalam pelaksanaan Perppu kebiri. "Ya seharusnya Kementerian Kesehatan mengambil jalan alternatif. Kalau pemerintah kan tentu bisa memberikan jalan untuk hal itu, kalau DPR posisinya tentu bagaimana masyarakat berikan masukan," kata Ade di Gedung DPR, Jakarta, Senin 25 Juli 2016. Menurutnya, kebijakan jalan alternatif sudah menjadi hal yang biasa dalam pengambilan keputusan. Hal itu dinilai perlu dilakukan agar dapat mengakomodasi semua pemangku kepentingan. Sebelumnya, Komisi VIII DPR mendapatkan tugas untuk membahas penerimaan maupun penolakan DPR terhadap penerbitan Perppu kebiri. Di tengah penerbitan Perppu ini, IDI menyatakan menolak menjadi eksekutor kebiri kimia. Kementerian kesehatan pun belum mau menjawab siapa pihak yang berwenang menggantikan IDI sebagai eksekutor ketika Perppu ini disahkan. Alternatif yang berkembang, eksekutor berasal dari tenaga kesehatan atau pun dokter kepolisian. Tapi hal tersebut masih menjadi polemik', NULL),
	(44, 95, 'Tangkap 4.269 Monster, Akun Ini Jadi Master Pokemon', 'Seorang pengguna Reddit asal Amerika Serikat mengaku telah menjadi pengguna pertama yang dinobatkan sebagai Master Pokemon. Dia meraih gelar itu setelah menangkap semua monster yang ada di North American Pokedex. Pengguna itu memiliki akun bernama ftb_hodor. Dia mengklaim telah memiliki semua pocket monster yang ada di Amerika. Sebelum menjadi master, dia mendapat tambahan 142 Pokemon dan harus banyak berjalan sampai sekian ratus kilometer. Dilansir melalui Telegraph, trainer Pokemon yang berbasis di New York itu mengaku telah berada di level 31. Untuk mencapai level itu dia mengklaim telah berjalan sepanjang 153,2 kilometer dan berhasil menangkap total 4.269 monster pocket, menghabiskan 303 eggs. Namun ada beberapa hal yang patut dipertanyakan. Pasalnya, ada beberapa monster penting yang tidak dimiliki ftb_hodor, terutama yang tersebar di negara-negara lain dan tidak ada di AS. Ada sembilan Pokemon yang belum didapatnya seperti Ditto, Articuno, Zapdos, Moltres, Mewtwo dan Mew. "Dia bahkan belum menangkap tiga Pokemon yang eksklusif ada di beberapa benua. Misalnya Farfetch\'d yang hanya ada di Asia, Kangaskhan yang hanya ada di Australia dan New Zealand, serta Mr.Mime yang ada khusus di Eropa," tulis akun lain di Reddit mengomentari klaim ftb_hodor. Usaha ftb_hodor ini ternyata bukan tanpa tujuan. Setelah mengklaim menjadi master pertama di game Pokemon, ftb_hodor langsung menjajakan akunnya. Akun Pokemon ftb_hodr tersebut dijual beberapa pounds di eBay. (ase)', NULL),
	(45, 96, 'Jadi Saksi Suap Bos Agung Podomoro, Ahok Tak Mau Debat Kusir', 'Gubernur DKI Jakarta, Basuki Tjahaja Purnama alias Ahok, akan menjadi saksi dalam sidang kasus dugaan suap penyusunan dua Rancangan Peraturan Daerah (Raperda) DKI soal reklamasi dengan terdakwa Presiden Direktur Agung Podomoro Land, Ariesman Widjaja. Ahok dijadwalkan akan bersaksi dalam persidangan yang digelar di Pengadilan Tindak Pidana Korupsi (Tipikor) pada pukul 15.00 WIB. "Jam 15.00 (bersaksi). Diminta dari jaksa penuntut KPK," ujar Ahok di Balai Kota DKI, Senin, 25 Juli 2016. Ahok mengatakan, ia berharap tidak memberi kesaksian dalam waktu yang lama. Pasalnya, ia akan menjadi saksi yang memberatkan. Ahok enggan beradu argumen dengan kuasa hukum Ariesman. "Kalau jam 15.00 WIB mulai, mudah-mudahan (persidangan) enggak jadi debat kusir. Bisa sampai jam 19.30 WIB atau sampai malam sidangnya," ujar Ahok. Seperti diketahui, dalam persidangan sebelumnya, Agung Podomoro Land disebut telah membayar kontribusi tambahan terkait proyek reklamasi atau pembuatan pulau di Pantai Utara Jakarta. Padahal, Raperda mengenai reklamasi tersebut masih dibahas dan belum disahkan. Hal tersebut diungkapkan Mohamad Sanusi saat bersaksi untuk terdakwa Presiden Direktur Agung Podomoro, Ariesman Widjaja dan stafnya, Trinanda Prihantoro di Pengadilan Tindak Pidana Korupsi (Tipikor), Senin 18 Juli 2016. Sanusi mengaku, mendengar informasi tersebut dari Ariesman Widjaja yang bercerita kepadanya. "Bahwa dia (Agung Podomoro) sudah melakukan tambahan kontribusi, sesuai arahan Pak Gubernur (Basuki Tjahaja Purnama atau Ahok)," kata Sanusi. Sanusi mengaku, bahwa dia kaget mendengar ucapan Ariesman itu. Lantaran belum ada dasar hukum yang melandasi tambahan kontribusi. "Saya kaget, karena enggak ada dasar hukumnya," kata Sanusi. Sanusi sendiri mengaku, poin tambahan kontribusi sebesar 15 persen dalam Raperda Reklamasi menjadi penyebab pembahasan menjadi alot. Menurut Sanusi, pihaknya memang mempertanyakan tambahan kontribusi tersebut lantaran dinilai tidak ada payung hukumnya. Selain itu, besaran tambahan kontribusi juga dinilai dewan tidak jelas. Sanusi menyebut, pihak eksekutif tidak bisa menjelaskan saat ditanyakan mengenai hal tersebut. Sanusi lantas menyebut, pada akhirnya eksekutif dan legislatif sepakat jika poin tambahan kontribusi itu nantinya akan diatur dalam Peraturan Gubernur (Pergub). "DPRD bersama eksekutif sepakat maka besarannya diatur dalam Pergub. Besaran nilai, cara bayar dan mekanismenya diserahkan kepada Pemprov DKI. DPRD dan eksekutif sudah diketuk," kata Sanusi.', NULL),
	(46, 97, 'Honda Beri Kejutan di GIIAS Agustus Mendatang', 'Ajang tahunan perhelatan otomotif Gaikindo Indonesia International Auto Show (GIIAS) 2016, yang akan berlangsung di ICE BSD Tangerang Selatan, menjadi momentum bagi para produsen untuk unjuk gigi. Tak luput, pabrikan sepeda motor PT Astra Honda Motor (AHM) juga akan menampilkan berbagai produk terbarunya yang penuh kejutan. Produk baru yang dirilis Senin 25 Juli 2016 itu CBR250RR. Meski sedang tertimpa masalah dugaan pengaturan harga alias kartel, Honda lewat Deputy Head of Corporate Communication AHM, Ahmad Muhibuddin, mengatakan, akan memberikan kejutan di GIIAS Agustus mendatang. "Kami akan bergabung di GIIAS. Pasti kami akan berikan kejutan," kata Muhib. Saat ditanya kejutan yang akan diberikan, Muhib memilih merahasiakannya. "Programnya apa, konsepnya apa, lihat saja nanti," kata dia. Terkait kasus kartel, menurut Muhib, tidak akan mengganggu jalannya persiapan Honda dalam mengikuti ajang tahunan tersebut. "Kami tetap mengikuti prosesnya itu seperti apa nantinya, kami sedang diskusikan konsepnya," kata dia.', NULL),
	(47, 98, 'Satu Tahun Umi Delima Ikut Pelarian Santoso', 'Kepolisian Daerah Sulawesi Tengah belum melakukan pemeriksaan terhadap Jumiatun Muslim alias Umi Delima, istri kedua dari pimpinan Mujahid Indonesia Timur (MIT) Santoso alias Abu Wardah. Setelah penangkapan pada Sabtu lalu, 23 Juli 2016, Umi Delima hingga hari ini, Senin, 25 Juli 2016, masih menjalani perawatan kesehatan di Rumah Sakit Bhayangkara Polda Sulteng. Pemeriksaan terkait dugaan keterlibatan dengan jaringan teroris akan dilakukan setelah kesehatannya pulih.   Menurut juru bicara Polda Sulawesi Tengah, AKBP Hari Suprapto, setelah ditangkap di Desa Tambarana Kecamatan Poso Pesisir Utara, Kabupaten Poso, Umi Delima langsung dibawa ke Rumah Sakit Bhayangkara karena kondisinya yang tidak memungkinkan untuk langsung dilakukan pemeriksaan. "Saat ditangkap kondisinya pucat dan kurus. Makanya langsung dibawa ke Rumah Sakit Bhayangkara untuk penanganan kesehatan dan diperlakukan dengan baik," ujar Hari. Setelah kesehatan Umi Delima pulih, polisi baru akan melakukan pemeriksaan pada yang bersangkutan. Tentunya terkait dengan jaringan Santoso. Diketahui, Jumiatun Muslim alias Umi Delima yang baru berusia 20 tahun, adalah istri kedua dari Santoso alias Abu Wardah, orang paling dicari negara dan telah tewas dalam penyergapan di hutan kawasan Tambarana. Dengan statusnya ini, Umi Delima dipastikan banyak tahu tentang pergerakan dari kelompok Santoso, sebelum dan sesudah suaminya itu ditembak mati. Selama satu tahun terakhir, Umi Delima ikut dipastikan ikut dalam pelarian Santoso di Gunung Biru, Tamanjeka, Poso. "Jadi kalau sudah sehat, kami akan melanjutkan pemeriksaan karena kita ketahui bahwa Umi Delima ini adalah orang terdekat dari Santoso. Tentunya dia banyak tahu tentang pergerakan mereka selama ini," kata Hari yang juga menjabat sebagai Kepala Satuan Operasi Tinombala 2016. (ase)', NULL),
	(48, 99, 'Seribu Perpustakaan Duafa, Impian Asma Nadia', 'Banyak menelurkan karya lewat buku-buku dan filmnya yang menginspirasi, Asma Nadia ternyata punya mimpi lain yang lebih besar, yaitu membuka perpustakaan untuk kaum duafa. Begitu mulia niat seorang penulis berusia 44 tahun ini yang ingin selalu berbagi dengan kaum duafa. Cita-citanya tersebut pertama kali muncul karena pengalaman pahitnya di masa lalu. “Dahulu (penampilan) saya lusuh banget, jadi enggak berani masuk dan baca buku ke Gramedia,” ujar Asma yang ditemui di kawasan Thamrin, Jakarta, Jumat 22 Juli 2016. Meski kesulitan untuk mencari bahan bacaan, ternyata ibunda Asma selalu mencari cara agar anak-anaknya bisa belajar membaca. Sehingga, hal tersebut membuatnya merasakan perjuangan sang ibunda dalam memberikannya banyak bahan bacaan. “Mamih saya selalu usahakan anak-anaknya bisa membaca, meski saat itu hanya membaca dari koran bekas bungkusan cabai,” tambahnya. Pengalaman pilunya tersebut membuatnya kini bertekad untuk bisa memberikan media tempat belajar membaca bagi siapa saja yang membutuhkan terutama kaum duafa. Ia berharap, dengan membaca maka akan membuka wawasan para anak bangsa. “Alhamdulillah sudah 203 perpustakaan, dan semoga bisa bertambah jadi 1.000. Karena saya ingin anak Indonesia membaca,” kata dia.', NULL),
	(49, 100, 'Buat Postingan Instagram Lebih Menarik dengan PicsArt', 'Punya akun Instagram akan lebih seru jika memiliki banyak follower. Salah satu syarat wajib mendapat banyak follower adalah memiliki postingan foto yang menarik dan bervariasi. Sebab jika fotonya begitu-gitu saja bakal mebosankan follower, bukannya bertambah, follower malah berkurang. Saya memiliki cara tersendiri dalam memperkaya postingan dan membuat followers bertambah. Buktinya follower saya saat ini sudah hampir seratus ribu. Jarang-jarang blogger punya follower sebanyak itu. Postingan saya di Instagram saat ini menggabungkan dua materi foto dan teks. Nah untuk menghasilkan editing foto yang bagus saya percayakan aplikasi PicsArt mebantu saya. Jadi sebelum mulai ngulik materi ini, jangan lupa unduh dulu aplikasi PicsArt ini langkahnya. 1. Unduh aplikasi PicsArt 2. Siapkan dua materi gambar terdiri: foto  dan teks (bisa dibuat dengan aplikasi teks) 3. Masuk ke PicsArt 4. Klik \'Edit\' 5. Pilih Foto 6. Klik \'Edit\' di kanan atas 7. Pilih effect untuk mengubah foto, jika tidak mau tidak apa-apa. 8. Geser bagian bawah sampai ke tool \'Draw\' 9. Pilih tool ke tujuh bergambar foto dengan tanda plis 10. Akan muncul dua pilihan \'Photo\' dan \'Clipart\' 11. Klik \'photo\' 12. Pilih gambar teks yang sudah dibuat. 13. Klik Nest\' 14. Silakan edit ukuran tapi jika tidak langsung klik tanda centang. 15  Atur posisi teks pada foto 16. Klik ikon di bawah urutan ke delapan. 17. Atur transparansi teks sehingga seperti menyatu dengan foto. 18. Jika sudah selesai klik tanda centang 19. Hasil edit foto sudah jadi dan bisa langsung dishare di Instagram. Jangan lupa beri caption yang menggoda orang untuk berkomentar, misalnya dengan pertanyaan. Selamat mencoba. Oh, sebaiknya buatlah teks yang menyentuh dan mengundang orang untuk ikut komentar mengenai postingan kita. Karena saya seorang penulis, bisa mengarang sendir. Kalau nggak bisa, bisa salin kutipan dari buku ataupun lagu.', NULL),
	(50, 101, 'Bisa Saingi Instagram, Aplikasi Prisma Bikin Foto Jadi Keren', 'Para pengguna ponsel Android kini bisa bernafas lega. Pasalnya, kini di Google Play telah hadir aplikasi baru yang sedang populer, Prisma. Dalam beberapa pekan terakhir, Prisma memang menyedot perhatian. Aplikasi ini bisa mengubah foto asli menjadi foto layaknya karya seni atau lukisan model vintage. Dalam beberapa pekan sebelumnya, aplikasi tersebut masih tersedia dalam versi Beta dan kini sudah muncul di Android. Dikutip dari The Next Web, Senin, 25 Juli 2016, bicara soal popularitas aplikasi tersebut, bisa dilihat dari data dan faktanya. Salah satu pendiri Prisma menyebutkan, kini lebih dari 400 juta foto yang telah diolah Prisma. Aplikasi itu telah diunduh lebih dari 10,6 juta kali di App Store, pengguna aktif harian Prisma kini menembus 1,55 juta dan unduhan harian maksimal mencapai 700 ribu kali. Prisma memang bukan aplikasi pertama yang mengubah foto pengguna menjadi layaknya karya seni atau lukisan. Bedanya, Prisma menyulap foto dengan menggunakan kecerdasan buatan sehingga membuat foto akhirnya mirip dengan objek yang diciptakan manusia. Foto hasil dari Prisma berbeda dengan aplikasi sejenisnya yang mengubah foto dengan bermodal algoritma yang sederhana. Prisma versi Android punya fitur yang sama pada versi iOS, yaitu termasuk lebih dari 30 filter dan pendukung untuk pengambilan foto baru atau memilih file foto yang sudah ada dari galeri ponsel pengguna. Prisma akan menghadirkan fitur baru, yakni pendukung video dalam waktu dekat, sepekan lagi dan Prisma mengatakan fitur video live juga akan dihadirkan dalam jangka menengah.', NULL),
	(51, 102, 'Rosberg Tak Cemas Digeser Hamilton dari Puncak Klasemen F1', 'Nico Rosberg terpaksa tergeser dari puncak klasemen sementara ajang Formula 1 (F1). Ini menyusul kemenangan rekan setimnya di Mercedes, Lewis Hamilton, pada seri GP Hungaria. Rosberg sebenarnya memiliki kans cukup besar untuk menjuarai balapan di Sirkuit Hungaroring, Minggu 24 Juli 2016. Pembalap asal Jerman ini berhasil meraih pole position, namun Hamilton berhasil menyalipnya pada tikungan pertama. Alhasil, Rosberg harus puas finis di peringkat kedua pada balapan 70 lap tersebut. Hasil tersebut membuat dia turun ke posisi dua klasemen sementara dengan 186 poin, atau kalah enam angka dari Hamilton yang naik ke peringkat satu. Walau tergeser posisinya oleh Hamilton, Rosberg mengaku tidak cemas. Menurutnya, balapan masih panjang dengan menyisakan sembilan seri lagi, dan semua hal bisa terjadi serta peluangnya untuk jadi juara dunia masih tetap terbuka. "Ini sangat tipis. Ini akan jadi musim yang bagus sampai sejauh ini. Seperti yang saya katakan, saya tak pernah menghitung poin, kejuaraan masih jauh dan apapun masih mungkin terjadi," kata Rosberg, seperti dikutip Crash. "Saya cuma ingin fokus memenangkan balapan. Hari ini, saya kurang beruntung sebab tergelincir di tikungan pertama. Perlombaan diputuskan di sana (tikungan pertama)," sambungnya. Rosberg memiliki kesempatan untuk kembali merebut puncak klasemen pada GP Jerman, 31 Juli mendatang. Pembalap berusia 31 tahun ini pun mengaku akan langsung fokus pada seri tersebut, terlebih dia akan membalap di hadapan publiknya sendiri. "Sekarang saya memindahkan fokus untuk Hockenheim, yang merupakan balapan kandang saya. Saya sudah menantikan balapan di sana, saya suka treknya," ujar runner-up musim lalu ini.', NULL),
	(52, 103, 'Tiga Tas Hermes Ini Paling Laku', 'Rumah mode asal Paris, Hermes, terkenal dengan fesyen mewah, terutama untuk produk kulit, seperti tas. Dan hingga paruh pertama tahun ini, produk kulit dan pelana menjadi kontributor terbesar pendapatan perusahaan. Ada tiga tas Hermes yang paling laku di pasaran, meski tidak sepopuler seperti tas Birkin dan Kelly. Ketiga tas produk Hermes yang memberi kontribusi terbesar kepada pendapatan perusahaan sepanjang semester satu tahun ini, yakni tas Constance, Halzan, dan Lindy. Harga ketiga tas ini berkisar Rp65,7-131 juta. "Ini didukung oleh kecepatan produksi yang berkelanjutan dan peningkatan kapasitas pada tiga lokasi di Charente, Isere, dan Franche-Comte," kata perusahaan dalam sebuah pernyataannya, seperti dilansir dari Fashionista. Barang-barang kulit dan pelana mencatat kenaikan penjualan sebesar 7,2 persen. Ini membuat perusahaan mencatat total pendapatan sepanjang tahun ini sebesar Rp35,5 miliar. Selain produk tas kulit mewah, produk lainnya yang memberi kontribusi pendapatan perusahaan terbesar adalah parfum. Penjualan parfum tumbuh 3,7 persen sepanjang tahun ini, dengan dirilisnya parfum baru Eau de neroli dore dan Eau de rhubarbe ecarlate. Kendati untuk koleksi siap pakai produk wanita mengalami kenaikan, namun divisi pria menurun. Penjualan divisi ini turun 1,7 persen pada semester pertama tahun ini, dan 1,5 persen pada kuartal kedua yang berakhir pada 30 Juni 2016. Dalam laporan itu, Hermes menyatakan bahwa penurunan untuk produk divisi pria kontras dengan keberhasilan koleksi siap pakai dan sepatu wanita.', NULL),
	(53, 104, 'Telat Apel, Belasan Polisi Dihukum Dorong Truk', 'Begini jadinya kalau seorang anggota polisi datang terlambat saat upacara. Di Wonogiri Jawa Tengah, belasan anggota polisi muda yang tergabung dalam pasukan Dalmas (Pengendali Massa) ini harus ketiban sial. Maklum mereka diharuskan mendorong sebuah truk polisi yang sedang dalam kondisi mati dan diharuskan mendorongnya mengelilingi markas Polres Wonogiri. "Yang terlambat apel, lima menit saja harus mendapatkan sanksi," kata AKP Agus Samsyudin, komandan Dalmas Sat Sabhara Polres Wonogiri seperti dikutip di tribratanews, Senin, 25 Juli 2016. Pemberian sanksi dorong truk yang dijatuhkan kepada 11 anggota Sat Sabhara Polres Wonogiri ini diketahui terjadi pada Minggu 24 JUli 2016. Saat itu, seperti biasa meski libur seluruh anggota memang diwajibkan untuk tetap mengikuti apel pagi pada pukul 06.00. Namun sial, sepertinya kesebelas anggota polisi muda ini sepertinya datang tidak tepat waktu. "Bagi pergerakan pasukan pengendali massa, tidak boleh terlambat pada saat dibutuhkan kehadirannya," tulis tribratanews.', NULL),
	(54, 105, 'Wakil Ketua Komisi VIII Janjikan Beasiswa Kuliah Siswa MAN', 'Wakil Ketua Komisi VIII DPR Iskan Qolba Lubis mengatakan, tidak boleh anak-anak di Madrasah Aliyah Negeri Medan sampai tidak melanjutkan ke perguruan tinggi negeri karena alasan tidak mampu. Pasalnya, dalam RAPBN 2016 juga akan diperbanyak terkait beasiswa. "Seandainya ada anak-anak disini terkendala karena tidak memilki biaya, tolong sampaikan kepada kami. Tentunya akan segera kami tindak lanjuti" kata Politisi PKS dari Dapil Sumatera II dihadapan ratusan anak-anak MAN 2 di Medan, Jum\'at 22 Juli 2016. Ia menambahkan, beasiswa saat ini memiliki dua jalur, pertama dari pemerintah dan  ada yang dari swasta. Hampir rata-rata Anggota DPR di Komisi VIII  memiliki jaringan beasiswa ke beberapa negara.Sehingga melalui jaringan  tersebut bisa dimanfaatkan. "Yang sudah kerjasama dengan saya adalah Kampus  Sekolah Tinggi Ekonomi Islam (STEI) SEBI  di Depok dan Universitas Sumbawa. Semuanya dibiayai gratis sampai lulus, pokoknya saya janji kalian semua masuk ke perguruan tinggi" Menurut Iskan, ada sekitar 70 negara yang sudah siap menampung anak-anak yang akan mendapatkan beasiswa seperti di Jeddah, Malaysia dan Turki. Selain itu, anak-anak yang terdaftar disini juga nilainya bagus-bagus,  artinya mereka memang anak yang pintar. Sementara itu, Kepala Sekolah MAN 2 Medan Burhanuddin mengatakan, lulusan MAN 2 Medan ini sudah  hampir diterima diseluruh Perguruan Tinggi Negeri ternama di Indonesia, bahkan tahun lalu ada yang mendapatkan beasiswa ke Jerman dan Mesir. (www.dpr.go.id)', NULL),
	(55, 106, 'Rumah Singgah Julia Perez Akan Dibuka 17 Agustus 2016', 'Julia Perez tak sabar untuk segera membuka Rumah Singgah yang sedang dibangunnya di kawasan Jakarta Timur. Wanita yang akrab disapa Jupe itu memang sudah beberapa bulan ini menyiapkan Rumah Singgah yang diperuntukkan bagi mereka yang kekurangan biaya untuk berobat karena penyakit kanker. Pemain film Gending Sriwijaya itu mengunggah video persiapan Rumah Singgah tersebut. Terlihat kondisi dalam rumah tersebut yang mulai rapih dan siap dipergunakan. Jupe berencana membukanya pada 17 Agustus 2016. 130 ribu netizen menyukainya. "Horey rumah singah hampir selesai.. Ubin2 semua uda di ganti.. Tinggal di cet.. Toilet juga.. Renovasi..Agustus 17 2016 opening yaa ?? #rumahsinggahjuliaperez #supportbabyswithcancer #anak2pejuangcancer #survivorcancer," tulis Jupe. Jupe mengatakan, jika Rumah Singgah yang sudah dibangunnya satu tahun belakangan ini akan diresmikan langsung oleh Gubernur DKI Jakarta, Basuki Tjahaja Purnama (Ahok). "Sebentar lagi jadi rumah singgahnya. Di mana saya sudah ada rumah dan telah lebih dari cukup. Rumah singgah ini pas lah buat saya bisa sumbangkan untuk adik-adik penderita kanker yang biasa tidur di rumah sakit, kan kasihan," kata Jupe. Rumah singgah Jupe yang berlokasi di Cilangkap sekitar Cijantung juga sedang mencari donatur untuk kebutuhan mobil. "Tadinya mau sewain dulu angkot untuk sementara. Ini rumahnya bisa lebih untuk 10 orang," ujar wanita bernama lengkap Yuli Rachmawati ini. Jupe melanjutkan, para penderita kanker itu berasal dari seluruh daerah yang ada di Indonesia.', NULL),
	(56, 107, 'Perjalanan Lintas Waktu dengan Meditasi', 'Saya yakin pasti sebagian besar dari Anda masih terheran-heran, benarkah perjalanan lintas waktu (time travel) bisa dilakukan?. Berbagai pertanyaan muncul berkecamuk di dalam benak pikiran. Dapatkah seseorang pergi ke masa depan atau masa lalunya yang sudah lama Ia lupakan?. Jawabannya bisa relative, namun dalam kondisi tertentu saya bisa mengatakan bahwa hal itu memang benar “Ya”, perjalanan lintas waktu memang nyata dan bisa dilakukan oleh siapapun yang mampu melakukannya. Untuk melakukan perjalanan lintas waktu kita tidak memerlukan Mesin Waktu seperti yang ada di film-film sci-fi. Namun disini kita akan menggunakan metode Meditasi. Tentu istilah Meditasi sudah tidak asing lagi kita dengar, bahkan sudah banyak dimanfaatkan oleh banyak ahli pengobatan holistic untuk mengatasi berbagai problem kesehatan fisik dan mental. Cara ini hampir mirip dengar perjalanan Astral (pikiran dan jiwa) namun ada sedikit perbedaan. Anda atau siapapun yang melakukan cara ini dengan benar akan mampu melakukan perjalanan lintas waktu ke masa lampau, masa sekarang, atau bahkan ke masa depan. Dan mampu kembali ke masa sekarang kapan saja sesuai yang diinginkan. Catatan penting yang perlu Anda ingat, metode ini tidaklah benar-benar membawa diri anda secara fisik melintasi waktu, melainkan secara astral dan visualisasi (gambaran pikiran). Jika Anda pernah mendengar istilah “Past life regression” dalam hipnoterapi, ya hampir-hampir mirip seperti itu. Langkah awal dan penting, pertama Anda harus bisa dan sudah menguasai meditasi dengan baik dan benar. Jika Anda belum bisa melakukannya dengan benar, maka Anda harus belajar terlebih dahulu dari awal. Oke, sekarang yang harus Anda lakukan adalah masuk ke dalam kondisi meditasi yang dalam dan bersihkan hati serta pikiran dari segala beban kehidupan sehari-hari. Jangan dipaksakan, biarkan semua mengalir apa adanya dan benar-benar hilang secara perlahan. Setelah masuk dalam kondisi meditasi yang dalam, Sekarang kita masuk ke bagian yang terpenting. Disini kita memerlukan sebuah tempat khusus untuk dituju, sebagai contoh bayangkanlah sebuah bangunan di tengah lapangan luas yang kosong dan tidak ada apapun selain bangunan gedung itu sendiri. Bangunan ini digunakan sebagai sarana atau alat kapanpun saat kita akan melakukan perjalanan lintas waktu. Bangunan ini bisa berbentuk apapun, persegi, piramida, atau apapun yang paling Anda sukai. Selain itu, bangunan ini juga tidak boleh memiliki jendela satupun alias bangunan utuh yang tertutup rapat. Jadi pastikan di dalam visualisasi Anda bahwa yang ada di dalam bangunan tersebut adalah Anda sendiri dan tidak ada orang lain atau apapun yang mengganggu. Di dalam bangunan tersebut tidak perlu mewah-mewah. Bayangkan hanya ada sebuah ruangan dan satu buah kursi khusus untuk duduk.  Kursi tersebut berwarna hitam besar yang memiliki beberapa tombol control di bagian samping atau pegangannya. Tombol ini berfungsi untuk mengatur dan membawa anda ke suatu tempat (waktu) yang diinginkan. Anda dapat mengatur tombol ini dengan konfigurasi tertentu. Misalnya, ‘tombol masa lalu’, ‘tombol masa sekarang’, dan ‘tombol masa depan’. Kita akan menambahkan lagi sebuah control berupa ‘LED Display’ dilengkapi dengan keypad yang terdiri dari angka 1 – 10 dan tombol Enter. Keypad ini diperlukan apabila kita ingin melakukan perjalanan ke tahun tertentu sesuai yang dinginkan. Misalnya Anda lahir di tahun 1976 dan ingin mampir ke tahun 1980 untuk melihat bagaimana kehidupan masa kecil pada waktu itu. Visualisasikan di dalam ruangan ini juga ada sebuah layar film raksasa (seperti yang ada di bioskop). Di layar inilah semua gambaran waktu yang Anda inginkan ditampilkan. Jadi sebelum melakukan meditasi, alangkah baiknya jika Anda mempersiapkan terlebih dahulu seperti apa gambaran bangunan, kursi beserta tombol-tombolnya, dan layar dinginkan. Ide ini semakin diperjelas dengan teknik visualisasi saat melakukan meditasi. Setelah segala sesuatunya telah dipersiapkan, maka kini saatnya untuk melakukan perjalanan ke waktu tertentu yang kita inginkan. Sedikit mengulangi proses di awal, masuklah ke dalam keadaan meditasi yang mendalam. Biarkan semua anggota tubuh serileks mungkin, mulai dari ujung kepala sampai kaki. Atur ritme pernafasan selambat mungkin dan nikmati keluar masuknya nafas secara perlahan dari hidung. Dengarkan detak jantung semakin santai dengan ritme yang lambat dan teratur. Setelah itu, berangkatlah menuju ke bangunan di awal tadi. Masuklah ke dalamnya dan duduk santai di atas kursi. Jangan terburu langsung menekan tombol, namun santailah beberapa menit di kursi tersebut. Setelah benar-benar siap, kemudian tekanlan tombol tertentu (tombol masa lampau, sekarang, atau masa depan) yang anda ingingkan dan lihatlah yang muncul di layar. Atau juga bisa menekan tombol keypad pada Led Display untuk masuk ke tahun tertentu. Santai saja tetap rileks (jangan terlalu memaksakan diri) dan biarkan gambar di layar secara perlahan-lahan semakin jelas dan terang. Amati bagaimana bagaimana kondisi dan keadaan pada masa itu mempengaruhi pada masa sekarang. Sebagian orang ada yang langsung berhasil mempraktekannya, namun sebagian lagi mengaku masih kesusahan. Jika Anda termasuk orang yang belum berhasil hari, maka teruslah mencoba dan jangan menyerah. Jika Anda tekun, kurang dari satu minggu dijamin sudah menguasai benar teknik ini. Jangan menyerah, pasti Anda bisa. Jika Anda ingin kembali ke masa sekarang, maka tinggal menekan saja tombol ‘masa sekarang’ pada kursi yang Anda duduki. Setelah Anda merasa cukup puas dengan hasilnya, maka Anda bisa bangun dari kursi, kemudian berjalan keluar dari gedung dan kembali lagi ke tubuh fisik dimana Anda berada saat meditasi. Meditasi sebaiknya dilakukan di tempat-tempat yang sunyi, sepi, dan tidak seorangpun yang mengganggu. Bisa itu di kamar pribadi atau bahkan di luar rumah, yang penting tidak ada gangguan dari luar. Jika Anda percaya dengan keberadaan roh tertentu, maka metode ini juga bisa digunakan untuk berkomunikasi dengan makhluk astral tersebut dan belajar sesuatu hal yang ingin Anda kuasai. Caranya masih sama seperti di awal, namun disini Anda meminta kepada sosok roh tersebut untuk menunjukkan melalui layar perihal apapun yang ingin Anda ketahui atau pelajari. Beberapa orang ada yang menyebut metode ini sebagai “ILMU LADUNI”. Semoga berhasil dan jangan lupa berdo’a kepada Tuhan.', NULL),
	(57, 108, 'DPR Gelar Rapat Paripurna Bahas RAPBN 2017', 'Dewan Perwakilan Rakyat (DPR) menggelar Rapat Paripurna dengan agenda laporan Badan Anggaran (Banggar) terhadap hasil pembahasan tentang pembicaraan pendahuluan Rancangan Anggaran, Pendapatan dan Belanja Negara (RAPBN) 2017 dan Rancangan Kerja Pemerintah (RKP) 2017. Dalam rapat juga akan dilakukan pengambilan sejumlah keputusan terkait agenda paripurna tersebut.   Agenda lainnya adalah tanggapan pemerintah terhadap pandangan fraksi-fraksi terkait materi Rancangan Undang Undang (RUU) tentang pertanggungjawaban atas pelaksanaan APBN di tahun anggaran 2015. "Kemarin kan tahapan antara semua 10 fraksi sudah menyampaikan, tinggal tanggapan pemerintah soal itu," kata Ketua DPR Ade Komarudin di Gedung DPR, Senayan, Jakarta, Senin 25 Juli 2016. Terkait pembahasan agenda paripurna ini, Politikus Partai Golkar ini yakin tidak akan hambatan yang berarti dalam pengambilan keputusan. "Saya kira akan berjalan lancar sebagaimana mestinya," ujar Ade.', NULL),
	(58, 109, 'Lindsay Lohan Hampir Dibunuh Tunangannya?', 'Setelah mengamuk di media sosial, menuduh sang tunangan berselingkuh dan bahkan menyerang akun Instagram terduga selingkuhan tunangannya, Lindsay Lohan dikabarkan menerima panggilan telepon dari polisi. Ya, polisi dikabarkan menelepon mantan artis cilik Amerika itu setelah menyadari adanya kerusakan di pagar rumah Lindsay di Kensington, London, Inggris. Ternyata para tetangga rumahnyalah yang menghubungi polisi setelah dikagetkan dengan suara teriakan Lindsay. Menurut para tetangga, Lindsay berteriak dan mengatakan sang tunangan, Egor Tarabasov mencoba untuk membunuhnya saat bertengkar pukul 5 pagi waktu setempat. "Tolong, tolong, tolong. Dia (Egor) baru saja mencekik saya. Dia hampir membunuh saya. Semua orang akan tahu. Keluar dari rumah saya," ujar Lindsay dalam sebuah video yang direkam salah seorang tetangganya, dikutip dari Daily Mail. "Lakukan. Saya menantangmu. Kamu benar-benar gila. Kamu gila. Kamu butuh bantuan. Ini rumah saya, keluar," teriak Lindsay. 10 menit setelah tetangga melapor, polisi pun datang dan berusaha masuk ke rumah tersebut. Namun, keduanya sudah pergi dan tidak ada penangkapan yang dilakukan polisi. Polisi awalnya sempat menghubungi kediaman Lindsay pasca wanita berusia 30 tahun itu mengamuk di Instagram, menyerang sang tunangan dan menuduhnya berselingkuh di sebuah pesta di klub malam bersama wanita yang disebut \'pelacur Rusia oleh Lindsay. Ia juga menuliskan bahwa sang tunangan tidak pulang ke rumah mereka. Namun, pukul 5 pagi sang tunangan pulang ke rumah Lindsay dan keduanya terlibat pertengkaran. Setelah menelepon, polisi yang mendatangi rumah Lindsay mendapati pintu depan rumah rusak. "Ada tanda-tanda kerusakan dan bekas pukulan di pintu kayu," demikian menurut laporan The Sun. Menurut salah seorang tetangganya, ia terbangun setelah mendengar teriakan Lindsay. "Dia (Lindsay) membangunkan kami dengan teriakannya. Saya sangat khawatir. Banyak mobil polisi tiba dan seluruh tetangga di jalan ini terbangun melihat ke jendela," ujar sang tetangga. Seperti yang telah diberitakan sebelumnya, Lindsay mengungkapkan kemarahannya di akun Instagram pribadinya. Ia menuduh tunangannya telah berselingkuh dengan teman Lindsay sendiri yang merupakan perancang busana Rusia, Dasha Pashevkina. Bintang film Mean Girls itu juga mengungkapkan di Twitter bahwa saat ini ia tengah berbadan dua.', NULL),
	(59, 110, 'Tips Seimbangkan Karier dan Rumah Tangga ala Dewi Motik', 'Salah satu insan seni yang telah banyak menyumbangkan karya untuk dunia hiburan, Dewi Motik, memaparkan cara jitu untuk para ibu rumah tangga yang ingin tetap berkarier di usia produktifnya. Dewi berujar, tidak ada larangan untuk wanita yang telah berkeluarga agar tetap aktif dalam karier dan membuka usaha. Namun, hal itu harus diimbangi dengan perhatian untuk sang suami dan anak-anak tercinta. "Ingat perempuan yang dinikahi Rasul? Keduanya adalah career woman dengan tidak melupakan sosoknya sebagai istri dan ibu," ujar Dewi saat ditemui di kawasan Thamrin, Jakarta, Jumat 22 Juli 2016. Menurut Dewi, tidak sulit untuk mengimbangi waktu antara bekerja dan keluarga. Cukup satu rahasia yang dibagi oleh Dewi yaitu ibadah salat lima waktu. "Harus sembahyang lima waktu. Kalau sudah bisa mengatur salat dengan tepat waktu, Insya Allah para wanita bisa mengatur waktu lainnya," ujarnya. Apalagi, menurut wanita yang pernah menyabet gelar None Jakarta itu, saat ini, teknologi sudah sangat mempermudah para wanita untuk bisa bekerja di mana saja. Meski demikian, Dewi menyarankan agar para istri tetap patuh dengan suami untuk ragam aktivitas bekerja yang akan dijalankan. "Jangan takut untuk berkarya, tapi tidak lupa juga selalu hormat pada suami," kata dia.', NULL);
INSERT INTO `berita_training` (`id_berita_training`, `judul_berita`, `isi_berita`, `kategori`) VALUES
	(1, 'JK Jelaskan Alasan Pemerintah Bakal Beri Remisi ke Koruptor', 'Rancangan revisi atas Peraturan Pemerintah (PP) Nomor 99 Tahun 2012 – tentang perubahan kedua atas PP Nomor 32 tahun 1999 tentang Syarat dan Tata Cara Pelaksanaan Hak Warga Binaan Pemasyarakatan – menyebutkan bahwa ketentuan justice collabolator (JC) sebagai syarat remisi bagi pelaku tindak pidana korupsi, terorisme, dan narkotika, akan dihilangkan.\r\nImplikasinya, terpidana kasus tersebut bisa mendapat remisi, hanya dengan dua syarat pokok, yakni berkelakuan baik dan telah menjalani sepertiga masa pidananya.\r\nTerkait hal itu, Wakil Presiden (Wapres) Jusuf Kalla (JK) setuju atas rencana perubahan pemerintah yang sedang digodok Kementerian Hukum dan Hak Asasi Manusia. Alasannya adalah faktor kemanusiaan.\r\n"Semua orang yang telah dihukum, dipenjara tentu mempunyai juga sisi-sisi kemanusiaan. Apapun (kasusnya). Kami tidak membedakan lagi (kasus narapidana)," ujar JK di Kantor Wakil Presiden, Jalan Medan Merdeka Utara, Jakarta Pusat, Jumat 12 Agustus 2016.\r\nMeski demikian, JK mengakui bahwa remisi tersebut akan sangat sulit untuk diberikan kepada koruptor. Namun menurutnya remisi bisa menjadi hal yang membuat koruptor dan pelaku tindak kejahatan lainnya bertobat.\r\n"Walaupun tentu kami agak berat. Gunanya remisi sebenarnya, intinya agar mereka itu memperlihatkan disiplin, merasa katakanlah bertobat dari sisi moral atau berkelakuan baik. Itulah syarat remisi itu," kata JK.\r\nDia membandingkan jika narapidana dengan kasus pembunuhan yang menghilangkan nyawa orang saja masih diberikan remisi, lantas koruptor juga seharusnya memiliki hak tersebut. Perlakuan yang sama harus diberikan agar negara tidak dianggap diskriminatif.\r\n"Kalau pembunuh saja bisa (mendapat remisi), kemudian koruptor tidak bisa diberikan reward karena disiplinnya karena kelakuan baiknya, tentu juga kita terjadi diskriminatif," lanjut JK.\r\nApalagi kata JK, selama ini banyak koruptor yang telah dijatuhi hukuman berat dengan masa kurungan yang lama.  \r\n"Walaupun kita tahu korupsi itu kejahatan besar tapi narkoba dan pembunuhan juga kejahatan besar juga efeknya terhadap negara. Jadi kita lihat dari sisi kemanusiaan. Kalau dia tobat berkelakuan baik, makin baik dia punya perilaku. Bukan lihat lagi dari sisi apa yang dia buat karena ringan beratnya hukuman kan sudah ada UU-nya, sudah ada pengadilannya," kata Wapres.\r\nOleh karena itu perilaku saat dan setelah narapidana menjalani hukuman kata JK adalah pertimbangan penting.', 'Politik'),
	(2, 'Sekjen PDIP Sebut Pertemuan di \'Teuku Umar\' Tak Bahas Cagub', 'Partai Demokrasi Indonesia Perjuangan (PDIP) dikabarkan bakal membahas bakal calon gubernur (cagub) DKI Jakarta hari ini. Setelah sebelumnya, Partai Moncong Putih juga telah melakukan rapat internal di Kantor Dewan Pimpinan Pusat (DPP), PDI Perjuangan dua hari lalu.\r\nNamun, Sekretaris Jenderal PDIP, Hasto Kristiyanto yang siang ini baru saja meninggalkan kediaman Ketua Umum PDIP, Megawati Soekarnoputri di Jalan Teukur Umar, Menteng, Jakarta Pusat, membantahnya.\r\n"Hari ini rapat rutin partai, Kamis dan Jumat persoalan internal seperti pilkada, kaderisasi, penegakan disiplin partai. Jumat, lebih pada kondisi eksternal. Jadi, hari ini tidak ada pembahasan Pilkada DKI," jelas Hasto di Jakarta, Jumat 12 Agustus 2016.\r\nLebih lanjut, Hasto menjelaskan, kondisi eksternal yang dia maksud adalah hal strategis soal pengelolaan pemerintahan.\r\n"Eksternal itu hal-hal strategis, misal menerima undangan Lemhannas (Lembaga Ketahanan Nasional), undangan-undangan (ke partai) yang masuk kami sampaikan. Skenario sudah ada tinggal mengambil keputusan akhir," kata dia lagi.\r\nHasto juga membantah informasi yang beredar tentang kedatangan Wali Kota Surabaya Tri Rismaharini Jakarta hari ini.\r\n"Dan, terkait Risma yang akan datang ke Ibu Kota itu tidak benar," katanya.\r\nSebelumnya, Hasto juga membantah bahwa PDIP akan mengumumkan nama bakal calon gubernur yang bakal diusung di Pilkada 2017 dalam waktu dekat.\r\n" Tidaklah, kami mencari momentum yang baik terhadap pengumuman calon kepala daerah tersebut," kata Hasto. (asp)', 'Politik'),
	(3, 'Hanura: Dua Partai Politik Akan Gabung dengan Ahok', 'Ketua DPD Hanura DKI Jakarta Muhammad "Ongen" Sangaji mengatakan akan ada dua partai politik lagi yang bergabung dengan koalisi pendukung Gubernur Basuki Tjahaja Purnama atau Ahok maju lagi dalam Pilkada DKI 2017.\r\n\r\nSaat ini sudah ada tiga partai politik yang mendukung Ahok, yakni Hanura, Golkar, dan Nasdem.\r\n\r\n"Saya sudah sampaikan kemarin kan, dalam waktu menjelang 10 hari ini ada dua partai yang bergabung dan itu pasti," kata Ongen di Gedung DPRD DKI Jakarta, Jumat (12/8/2016).\r\n\r\nNamun, Ongen tak menyebutkan partai mana yang akan bergabung dalam koalisi pendukung Ahok. Menurut dia, saat ini kedua partai itu menjadi informan bagi koalisi pendukung Ahok untuk memantau pergerakan "Koalisi Kekeluargaan".\r\n\r\n"Pokoknya biarkan kami titip mereka di dalam 10 hari biar lebih tahu apa yang terjadi di antara tujuh partai itu," kata Ongen.\r\n\r\nTujuh partai dalam Koalisi Kekeluargaan adalah PDI-P, Gerindra, PKS, PPP, Demokrat, PKB, dan PAN.\r\n\r\nKoalisi itu baru diputuskan di tingkat DPD dan belum ada perjanjian hitam di atas putih untuk membuat Koalisi Kekeluargaan.', 'Politik'),
	(4, 'Hendra/Ahsan yang Underperform', 'Ganda putra Indonesia Hendra Setiawan/Mohammad Ahsan tampil buruk sehingga kalah dari Endo Hiroyuki/Kenichi Hayakawa. Hendra/Ahsan memang underperform.\r\n\r\nHendra/Ahsan secara mengejutkan kalah dari pasangan Jepang itu dalam duel tiga gim 17-21, 21-16, 14-21. Padahal, di sembilan pertemuan sebelumnya, mereka selalu berhasil memetik kemenangan.\r\n\r\nSatu hal yang menjadi sorotan adalah seringnya service foul yang dilakukan Hendra. Tercatat sembilan kali pelanggaran itu terjadi yang artinya poin cuma-cuma untuk lawan.\r\n\r\n"Hendra/Ahsan memang tampil underperformed. Ada rasa nervous, walaupun sebagai pemain senior seharusnya nggak boleh nervous, tapi ini kan olimpiade, kejuaraan besar. Hendra/Ahsan kelihatan sering terburu-buru dan kurang tenang, mainnya tidak lepas dan banyak melakukan kesalahan sendiri," ujar Kepala Pelatih Ganda Putra PP PBSI Herry Iman Pierngadi. \r\n\r\n"Hari ini Hendra banyak melakukan kesalahan di servis. Sebetulnya kami sudah mengantisipasi hal ini, waktu di karantina. Bahkan ada latihan servis khusus untuk Hendra. Namun kalau lagi tanding, yang tahu perasaannya kan Hendra sendiri."\r\n\r\n"Ahsan sebetulnya terpengaruh, mungkin dia mencoba untuk menutupi dengan dua tiga kali pukulan, tetapi lawan tidak mudah ditembus, akhirnya Ahsan membuat kesalahan sendiri," imbuh dia dalam rilis yang diterima dari PP PBSI.\r\n\r\nSituasi sulit dihadapkan pada Hendra/Ahsan. Keduanya wajib menang atas wakil China Chai Biao/Hong Wei. Akan tetapi, kemenangan pun akan menempatkan Hendra/Ahsan sebagai runner-up Grup D yang mana berpotensi melakoni laga berat karena berjumpa dengan juara dari grup-grup lain.\r\n\r\n"Tentunya besok harus lebih maksimal dan ini tidak gampang, tekanan pasti tinggi. Siapa yang bisa mengatasi tekanan, dialah yang akan menang. Kami akan mengevaluasi penampilan Hendra/Ahsan dan fokus melawan Chai/Hong. Kalau menang, perjuangan di perempat final sebagai runner up memang lebih berat," demikian Herry.', 'Olahraga'),
	(5, 'Tontowi/Liliyana Menang Lagi, Lolos ke Perempatfinal', 'Ganda campuran Tontowi Ahmad/Liliyana Natsir tak mengalami kesulitan berarti untuk meraup kemenangan kedua. Hasil ini meloloskan Tontowi/Liliyana ke perempatfinal.\r\n\r\nBermain di lapangan 1 Riocentro, Jumat (12/8/2016), Tontowi/Liliyana menghadapi pasangan Thailand Bodin Isara/Savitree Samitrapai di Grup C. Hanya dalam 32 menit, Tontowi/Liliyana menang dua gim langsung 21-11, 21-13.\r\n\r\nTontowi/Liliyana tampil begitu dominan di gim pertama. Keduanya melesat dengan keunggulan 16-4 sebelum memenangi laga 21-11.\r\n\r\nAkan tetapi, gim kedua tidak berjalan mudah bagi Tontowi/Liliyana. Setelah sempat tertinggal, pasangan Thailand mampu meraup lima poin beruntun untuk berbalik unggul 11-6.\r\n\r\nMeski demikian, Tontowi/Liliyana mampu menyusul bahkan berbalik unggul 14-13 setelah pengembalian lawan menyangkut di net.\r\n\r\nTontowi/Liliyana terus melesat dan sergapan Liliyana memastikan match point. Pasangan Indonesia akhirnya memenangi pertandingan usai smash keras Tontowi tidak dapat dikembalikan Samitrapai.\r\n\r\nDi pertandingan terakhir Tontowi/Liliyana akan menghadapi pasangan Malaysia Chan Peng Soon/Goh Liu Ying untuk memperebutkan gelar juara grup C.', 'Olahraga'),
	(6, 'Ketua DPR Minta Pemerintah Tak Obral Remisi', 'Rencana pemerintah merevisi Peraturan Pemerintah (PP) Nomor 99 tahun 2012 tentang perubahan kedua atas Peraturan Pemerintah Nomor 32 tahun 1999 menjadi kontroversi. Revisi PP itu tentang Syarat dan Tata Cara Pelaksanaan Hak Warga Binaan Pemasyarakatan yang bakal memuat syarat pemotongan masa hukuman terhadap koruptor selain terpidana narkoba dan teroris.\r\nRencana aturan remisi ini dinilai kurang bijaksana. Pemerintah diharapkan tidak kompromi terhadap tiga kejahatan khusus, kejahatan narkoba, korupsi dan terorisme.\r\n"Kalau saya sih kurang bijaksana. Kita tidak boleh terlalu kooperatif terhadap keputusan-keputusan hukum yang berkaitan dengan tiga hal, satu narkoba, dua korupsi, tiga terorism," kata Ketua Dewan Perwakilan Rakyat (DPR), Ade Komarudin, di Kompleks Parlemen Senayan, Jumat 12 Agustus 2016.\r\nMenurut Ade, para pelaku tiga kejahatan itu bakal tak takut melakukan kejahatan jika mereka memiliki kesempatan mendapatkan keringanan hukuman.\r\n"Kalau mencuri HP, mencuri ayam, bolehlah dapat remisi, kemudian klepto di swalayan tapi untuk tiga hal (kejahatan) itu kurang bijaksana ya, apalagi ngobral," ujar Ade lagi.\r\nPolitikus Partai Golkar tersebut mengakui bahwa latar belakang rencana revisi itu tak lain karena adanya kelebihan kapasitas di lembaga pemasyarakatan (lapas) sehingga rentan gesekan hingga potensi kerusuhan khususnya di antara terpidana narkoba. Namun Ade menilai bahwa yang perlu digencarkan pemerintah saat ini adalah melakukan langkah pencegahan.\r\n"Nah itu, makanya pemberantasan narkoba itu bukan hanya mengejar-ngejar yang pakai narkoba itu tapi harus ada langkah preventif," kata dia lagi.', 'Politik'),
	(7, 'PSSI Beberkan Agenda Uji Coba Timnas Senior dan U-19', 'Pelaksana Tugas (Plt) Ketua Umum PSSI, Hinca Panjaitan, membeberkan agenda tim nasional Indonesia, baik tingkat U-19 maupun senior, untuk 2016. Hal itu disampaikan oleh Hinca di kantor PSSI di kawasan Kuningan, Jakarta, pada Kamis (11/8/2016).\r\n\r\nMenurut Hinca, untuk tahun ini, timnas Indonesia hanya akan mengikuti dua turnamen internasional, yakni Piala AFF U-19 (untuk Timnas U-19) dan Piala AFF (untuk timnas senior).\r\n\r\nPiala AFF U-19 akan dilangsungkan di Vietnam pada 11-24 September 2016. Adapun Piala AFF, fase penyisihan grup diselenggarakan di Myanmar dan Filipina pada 19 November hingga 17 Desember 2016.\r\n\r\nMenurut Hinca, sebelum mengikuti kedua ajang tersebut, tim nasional dijadwalkan menjalani partai persahabatan yang semuanya digelar di Stadion Manahan, Solo.\r\n\r\nTimnas U-19 akan melakukan laga uji coba melawan Filipina pada 20 Agustus 2016. Sementara itu, timnas senior bakal menghadapi Malaysia pada 6 September 2016.\r\n\r\n"Kita akan melawan musuh bebuyutan, yakni Malaysia. Tak ramai rasanya kalau di Asia tak ada Indonesia dan Malaysia. Mudah-mudah tidak berubah lagi tempatnya, di Stadion Manahan Solo," ujar Hinca.\r\n\r\nSebelumnya, 24 dari 47 pemain sudah diseleksi untuk masuk timnas senior pada 9 dan 10 Agustus 2016 di Stadion Pakansari, Cibinong, Kabupaten Bogor.\r\n\r\nSisanya, 23 pemain masuk seleksi tahap kedua pada 16 dan 17 Agustus 2016.', 'Olahraga'),
	(8, 'Persija Puas Bisa Curi Poin di Kandang Persegres Tanpa Pilar Penting', 'Bermain di Stadion Petrokimia yang merupakan kandang Persegres Gresik United, Persija Jakarta sukses mengakhiri pertandingan dengan skor imbang 2-2, Jumat (12/8/2016) malam WIB. Skor akhir dalam rangkaian pekan ke-15 TSC 2016 itu membuat pelatih caretaker Persija Jan Saragih merasa puas.\r\n\r\nPadahal, Persija sempat kecolongan lebih dulu melalui gol Muhammad Rifqi. Tuan rumah sudah unggul 1-0 saat pertandingan baru berjalan satu menit.\r\n\r\n"Hasil ini membuat kami puas, meski masih ada pekerjaan rumah yang harus diperbaiki setelah pertandingan,” kata Jan dalam sesi konferensi pers selepas pertandingan, Jumat (12/8/2016) malam WIB.\r\n\r\nTersengat dengan gol yang diciptakan Rifqi, Persija mampu menahan imbang Persegres dengan dua gol yang dipersembahkan oleh Gunawan Dwi Cahyo pada menit ke-7 dan menit ke-73.\r\n\r\n"Selain puas dengan skor akhir, saya juga puas karena beberapa peluang yang kami ciptakan dalam pertandingan, sudah sesuai dengan skema yang biasa kami lakukan saat latihan. Itu termasuk gol-gol yang dicetak oleh Gunawan,” tuturnya.\r\n\r\nMeski demikian, Jan tak menutupi jika dirinya sempat terkejut dengan gol pertama Persegres yang dicetak oleh Rifqi, usai menyambut tendangan bebas Agus Indra Kurniawan. Menurut Jan, skuad asuhannya kala itu dianggap masih dalam tahap adaptasi terhadap atmosfer pertandingan.\r\n\r\n"Kami sempat syok dengan gol itu, karena para pemain saya lihat juga belum siap. Ini menjadi evaluasi bagi kami dan tetap akan coba kami perbaiki,” ujar Jan.\r\n\r\nNamun ke depan, sebagai persiapan menghadapi pertandingan selanjutnya, Jan tidak hanya fokus dalam memperbaiki kinerja lini pertahanan. Dia juga akan memperbaiki kinerja tim secara keseluruhan.\r\n\r\n"Sebab sepak bola itu satu kesatuan yang tidak bisa dipisah. Jadi, akan saya perbaiki secara keseluruhan, secara lini per lini dan tidak hanya pertahanan saja,” ucapnya.\r\n\r\nTambahan satu poin, membuat Persija tetap menempati peringkat ke-14 dengan torehan 14 poin dari 15 kali bertanding. Hasil ini sudah cukup maksimal mengingat dalam pertandingan tersebut, tim Macan Kemayoran tidak diperkuat Hong Soon Hak, Ismed Sofyan, Vava Mario Yagalo, serta Novri Setiawan.\r\n\r\n"Saya dan rekan-rekan sudah coba bermain bagus dan mengeluarkan segenap kemampuan kami, tapi memang skor akhir seperti itu dan tidak dapat diubah. Untuk pertandingan selanjutnya, kami akan berusaha lebih keras lagi,” ujar pemain Persija, Amarzukih.', 'Olahraga'),
	(9, 'Gagal Sumbangkan Medali Olimpiade, Ega Janji Tebus di SEA Games', 'Riau Ega Agatha gagal menambah medali untuk kontingen Indonesia di Olimpiade Rio 2016. Meski demikian pemanah berusia 24 tahun ini bertekad meningkatkan prestasinya di ajang selanjutnya.\r\n\r\nEga kandas di babak 16 besar setelah kalah 0-6 dari pemanah Italia, Mauro Nespoli. Dari tiga set yang dimainkan Ega menyerah 25-29, 27-29, dan 26-27.\r\n\r\nPadahal di dua babak sebelumnya, Ega tampil cemerlang. Dia mengalahkan pemanah Tiongkok, Xing Yu dengan skor telak 7-1 pada babak 64 besar. Dari empat set yang dimainkan, Ega menang dalam tiga set dan imbang dalam satu set.\r\n\r\nPada babak selanjutnya, Ega menantang pemanah nomor satu dunia asal Korea Selatan, Kim Woojin. Bermain lepas, Ega justru menang dengan skor 6-2.\r\n\r\nDari empat set yang dimainkan, sukses memenangkan tiga diantaranya. Dia hanya takluk pada set pertama dengan skor 29-27.\r\n\r\n"Maaf jika hasil ini mengecewakan. Saya berjanji akan persembahkan  medali untuk Indonesia di Olimpiade 2020 mendatang," ujar Ega di akun Twitter pribadinya.\r\n\r\n"Target terdekat, Sea Games dan Asian Games, semoga dapat medali. Terima kasih kepada masyarakat Indonesia atas dukungan dan doanya selama ini, maaf saya belum bisa memberikan yang terbaik atau medali untuk Indonesia," ujarnya.', 'Olahraga'),
	(10, 'Ketua DPRD Sarolangun Tertangkap Narkoba, PDIP: Tidak Ada Ampun Baginya', 'PDIP menegaskan akan memberikan sanksi berat bagi kadernya yang tersangkut narkoba. Hal itu terkait penangkapan Ketua DPRD Sarolangun yang juga Ketua DPC PDIP M. Syaihu. "Kalau berkaitan narkoba, korupsi, OTT (operasi tangkap tangan), itu tidak ada ampun," kata Ketua DPP PDIP Andreas Hugo Pareira di Gedung DPR, Jakarta, Jumat (12/8/2016). Andreas menegaskan PDIP akan menegakkan disiplin partai. Kader akan diberi sanksi tegas. "Bisa langsung dipecat, ada aturan mainnya," kata Andreas. Seperti diberitakan sebelumnya, Satuan Reserse Narkoba Polda Jambi menggerebekan di rumah ketua DPRD Sarolangun M Syaihu pada Kamis malam. Dari hasil penggerebekan tersebut polisi mengamankan enam orang dari rumah tersebut. Petugas juga mengamankan empat Mobil mewah dari rumah M Syahiu sebagai barang bukti. Kapolresta Jambi diikonfirmasi melalui Kasatres Narkoba membenarkan adanya penangkapan pria berinisial MS di lokasi tersebut. "Memang ada namanya Syaihu. Tapi entah itu ketua DPRD Sarolangun atau bukan saya no komen soal itu, kata Kompol Hernianto Eko Saputra."Masih kita dalami kasusnya, masih dalam pengembangan jadi saya belum bisa memberi keterangan," katanya.', 'Politik'),
	(11, '10 Besar Kampus dengan Rata-rata Nilai Tertinggi SBMPTN 2016', 'Hasil Seleksi Bersama SBMPTN 2016 diumumkan serentak pada Selasa (28/6/2016). Sejumlah kampus "merajai" nilai rata-rata tertinggi dari peserta seleksi.\r\n\r\nSBMPTN 2016 membagi peserta dalam dua kelompok ujian, yaitu Sainstek dan Soshum.\r\n\r\nBerikut ini 10 besar kampus penerima rata-rata nilai tertinggi untuk kelompok Sainstek:\r\n\r\n1. Institut Teknologi Bandung (ITB), dengan rata-rata nilai 700,10.\r\n2. Universitas Indonesia (UI), dengan rata-rata nilai 667,44.\r\n3. Universitas Gadjah Mada, dengan rata-rata nilai 648,46.\r\n4. Institut Teknologi Sepuluh November (ITS), dengan rata-rata nilai 647,54.\r\n5. Universitas Diponegoro (Undip), dengan rata-rata nilai 620,33.\r\n6. Universitas Padjadjaran, dengan rata-rata nilai 618,24.\r\n7. Universitas Airlangga (Unair), dengan rata-rata nilai 616,67.\r\n8. Institut Pertanian Bogor (IPB), dengan rata-rata nilai 613,68.\r\n9. Universitas Negeri Sebelas Maret (UNS)dengan rata-rata nilai 611,00.\r\n10. UPN Yogyakarta, dengan rata-rata nilai 606,68.\r\n\r\nAdapun untuk kelompok Soshum, 10 besarnya adalah:\r\n\r\n1. Universitas Indonesia (UI), dengan rata-rata nilai 669,52.\r\n2. Universitas Gadjah Mada, dengan rata-rata nilai 652,92.\r\n3. Institut Teknologi Bandung (ITB), dengan rata-rata nilai 651,97.\r\n4. Universitas Padjadjaran, dengan rata-rata nilai 621,78.\r\n5. Universitas Diponegoro (Undip), dengan rata-rata nilai 617,99.\r\n6. Universitas Airlangga (Unair), dengan rata-rata nilai 616,66.\r\n7. Universitas Brawijaya, dengan rata-rata nilai 606,14.\r\n8. UPN Yogyakarta, dengan rata-rata nilai 598,51.\r\n9. UPN Jakarta, dengan rata-rata nilai 597,33.\r\n10. Universitas Negeri Jakarta, dengan rata-rata nilai 594,19. \r\n\r\nHasil seleksi dapat dilihat melalui situs resmi panitia mulai pukul 14.00 WIB. Beberapa saat lagi, peserta juga bisa mengakses informasi tersebut di Kompas.com melalui alamat http://lipsus.kompas.com/sbmptn2016.', 'Pendidikan'),
	(12, 'Unika Semarang Buka Sertifikasi Profesi Insinyur', 'Proyek pembangunan infrastruktur yang digalakkan pemerintah saat ini mulai diiringi dengan penyediaan sarjana teknik maupun profesi keinsinyuran.\r\n\r\nDi Kota Semarang, Jawa Tengah, Jumat (12/8/2016), Universitas Katolik Soegijapranata mulai membuka program studi profesi insinyur. Program ini diperuntukkan khusus bagi lulusan sarjana teknik dengan masa studi selama satu tahun.\r\n\r\nProgram profesi insinyur merupakan mandataris dari Kementerian Riset dan Pendidikan Tinggi agar para insinyur Indonesia mempunyai keahlian dan sertifikat profesi sesuai bidangnya. Mereka selain dididik belajar teknik, mereka juga nantinya akan mendapat gelar profesi insinyur.\r\n\r\n“Program prefesi insinyur ini paketnya satu tahun selesai. Syaratnya harus sarjana teknik dulu, karena saat ini kerja global dibutuhkan sertifikat keahlian khusus,” ujar Wakil Rektor Unika Augustina Sulastri, seusai kegiatan peresmian.\r\n\r\nPendidikan profesi insinyur hari ini resmi diluncurkan oleh Rektor Budi Widianarko. Masa kuliah di kampus tersebut akan dimulai pada 12 September 2016. Selain Unika, ada tiga kampus lain di Jateng yang mendapat tugas serupa. Yaitu Universitas Diponegoro, Universitas Sebelas Maret, dan Universitas Muhammadiah.\r\n\r\nSulastri mengatakan, para sarajana teknis dan calon insinyur ini akan digembleng materi pendidikan. Pendidikan di perguruan tinggi diperlukan sebagai prasyarat mengikuti sertifikasi profesi yang dikeluarkan oleh Persatuan Insinyur Indonesia (PII). Para calon insinyur yang hendak melakukan sertifikat harusnya mengikuti perkuliahan profesi terlebih dulu.\r\n\r\n“Jadi sebelum ikut sertifikasi di PII harus studi sertifikat profesi dulu,” tambah dia.\r\n\r\n“Prodi sertifikasi Profesi hanya bisa diselenggarakan perguruan tinggi untuk menyiapkan tenaga profesional di pasar nasional, hingga ASEAN. Jadi ada kemudahan sertifikasi, tapi ada bekal pendidikan,” ujarnya.\r\n\r\nNamun demikian, sebelum mengambil pendidikan profesi ini, calon mahasiswa harus mempunyai bekal minimal dua tahun bekerja di bidang keinsinyuran. Kampus tidak menerima para sarjana yang baru saja lulus atau fresh graduate.\r\n\r\nRektor Unika Budi Widinarko mengatakan, pembukaan prodi sebagai mandat dari pemerintah pada institusi perguruan tinggi. Setidaknya ada 25 perguruan tinggi negeri dan 15 perguruan tinggi swasta yang ditugaskan pemerintah untuk meningkatkan kompetensi profesi keinsinyuran.', 'Pendidikan'),
	(13, 'Ini Alasan Mendikbud Usulkan "Full Day School"', 'Menteri Pendidikan dan Kebudayaan Muhadjir Effendy menggagas sistem "full day school" untuk pendidikan dasar (SD dan SMP), baik negeri maupun swasta. Alasannya agar anak tidak sendiri ketika orangtua mereka masih bekerja.\r\n\r\n"Dengan sistem full day school ini secara perlahan anak didik akan terbangun karakternya dan tidak menjadi liar di luar sekolah ketika orangtua mereka masih belum pulang dari kerja," kata Mendikbud di Universitas Muhammadiyah Malang (UMM), Minggu (7/8/2016).\r\n\r\nMenurut dia, kalau anak-anak tetap berada di sekolah, mereka bisa menyelesaikan tugas-tugas sekolah sampai dijemput orangtuanya seusai jam kerja.\r\n\r\nSelain itu, anak-anak bisa pulang bersama-sama orangtua mereka sehingga ketika berada di rumah mereka tetap dalam pengawasan, khususnya oleh orangtua.\r\n\r\nUntuk aktivitas lain misalnya mengaji bagi yang beragama Islam, menurut Mendikbud, pihak sekolah bisa memanggil guru mengaji atau ustaz dengan latar belakang dan rekam jejak yang sudah diketahui. Jika mengaji di luar, mereka dikhawatirkan akan diajari hal-hal yang menyimpang.\r\n\r\nMenyinggung penerapan full day school dalam pendidikan dasar tersebut, mantan Rektor UMM itu mengatakan bahwa hal itu saat ini masih terus disosialisasikan di sekolah-sekolah, mulai di pusat hingga di daerah.\r\n\r\n"Nantinya memang harus ada payung hukumnya, yakni peraturan menteri (permen). Namun, untuk saat ini masih sosialisasi terlebih dahulu secara intensif," ujarnya.\r\n\r\nSementara itu, ketika berbicara di hadapan ratusan kader Muhammadiyah Kota Malang, Muhadjir mengatakan, dirinya akan berupaya merestorasi pendidikan dasar dan menengah (SD-SMP), termasuk pendidikan karakter bagi anak didik. Selain itu, ia juga akan membenahi kebijakan-kebijakan yang berkaitan dengan profesionalisme para pendidik.\r\n\r\n"Saya tidak akan mengutak-atik masalah sertifikasi guru. Namun, harapan saya, profesionalisme seorang guru juga harus ditingkatkan terus. Jangan ada guru yang tidak layak, tetapi tetap saja menuntut sertifikasi, bahkan prosesnya minta dipermudah," kata Mendikbud.\r\n\r\nMenyinggung pendidikan di jenjang SMA dan SMK, Muhadjir mengatakan akan mencari formulasi yang tepat karena tidak semua lulusan SMA melanjutkan tahap pendidikan ke perguruan tinggi, alih-alih memilih untuk bekerja. Namun, karena tidak memiliki keterampilan dan keahlian, mereka akhirnya tidak bisa apa-apa di dunia kerja.\r\n\r\nWalau demikian, lulusan SMK pun tidak semuanya langsung bekerja. Ada yang tetap melanjutkan tahap pendidikan ke perguruan tinggi. Meski mereka memiliki keterampilan sesuai minat yang diambil di SMK, jika kualitasnya tidak ditingkatkan dan memiliki keahlian yang memadai, mereka akan tergusur oleh tenaga kerja asing yang memiliki sertifikasi internasional.\r\n\r\n"Kondisi ini yang akan kami carikan solusi agar kesenjangan dalam pendidikan bisa diminimalkan," ujarnya.', 'Pendidikan'),
	(14, 'Tahun Ini 500 Pelajar Indonesia Bersiap Kuliah ke Belanda', 'Sekitar 500 pelajar Indonesia berkumpul di Erasmus Huis Jakarta, Sabtu (30/7/2016), untuk mengikuti pre-departure briefing yang diselenggarakan oleh Nuffic Neso Indonesia. Kegiatan tahunan itu untuk memberikan pembekalan dan dukungan bagi para pelajar yang akan melanjutkan studi di Belanda.\r\n\r\nSebanyak 80 orang alumni Belanda dan 10 orang perwakilan dari Persatuan Pelajar Indonesia (PPI) di Belanda ikut bergabung pada acara tersebut. Mereka membagi berbagai tips studi dan tinggal di Belanda melalui sesi presentasi, kuis atau permainan berhadiah dan diskusi kelompok.\r\n\r\nSesi presentasi para alumni bahkan menjadi lebih menarik karena dikombinasikan dengan drama singkat yang menggambarkan keseharian di Belanda. Para penerima beasiswa StuNed yang sedang belajar di kota Maastricht, Denhaag, Wageningen, dan Groningen pun memberi dukungan dengan cara membuat video penyambutan bagi para pelajar itu. \r\n\r\n"Dibanding tahun-tahun sebelumnya jumlah peserta pre-departure tahun ini meningkat 70 prsen. Itu pun pendaftarannya terpaksa kami tutup karena keterbatasan tempat," ujar Indhira, ketua panitia acara.\r\n\r\nSebagian besar atau 50 persen peserta yang akan melanjutkan studi di Belanda itu mendapatkan beasiswa dari pemerintah Indonesia, sementara 25 persen lainnya mendapat beasiswa dari universitas atau pemerintah Belanda, sementara sisanya melanjutkan studi di Belanda dengan biaya pribadi.\r\n\r\n"Mereka studi di Belanda untuk berbagai jenjang, mulai dari S-1, S-2 dan S-3, termasuk juga kursus singkat," kata Indhira.\r\n\r\nSementara dalam sambutannya, Direktur Nuffic Neso Indonesia, Mervin Bakker, mengatakan bahwa meningkatnya jumlah para pelajar Indonesia yang antusias untuk melanjutkan studi di Belanda merupakan salah satu indikator semakin eratnya hubungan antara kedua negara. Dia berharao para pelajar itu dapat bertukar pikiran dengan masyarakat di Belanda sehingga bisa menjadi duta bagi Indonesia dan sekembalinya dari Belanda.\r\n\r\n"Yang penting, mereka dapat mengamalkan ilmunya bagi Indonesia dan menjadi duta bagi Belanda sehingga persahabatan antara kedua negara semakin harmonis," ujar Mervin.\r\n\r\nDukungan alumni \r\n\r\nMewakili Duta Besar Belanda, Nico Schermers, dalam sambutannya mengatakan bahwa  sistem pendidikan Belanda mempunyai reputasi dunia untuk kualitasnya, keberagamannya, dan keterbukaannya terhadap dunia lain. Amsterdam sendiri merupakan rumah bagi hampir 200 kewarganegaraan berbeda.\r\n\r\n"Pengembangan sumberdaya manusia merupakan hal yang sangat penting, karena bagi kami (Belanda) tidak ada cara yang lebih baik untuk mengembangkan suatu negara selain dengan memberikan investasi pada bidang pendidikan masyarakatnya," ujar Nico.\r\n\r\nSementara itu, Duta besar Indonesia untuk Belanda, I Gusti Agung Wesakapuja, juga memberikan sambutannya dari Denhaag. Melalui rekaman video beliau berpesan bahwa suasana belajar di Belanda menuntut kerja keras. Tetapi, mahasiswa yang bisa belajar di negara itu akan beruntung karena bisa mendapatkan ilmu pengetahunan yang bisa dibawa pulang.\r\n\r\n"Saya berharap ilmu tersebut dapat dimanfaatkan sebaik-baiknya bukan hanya untuk diri sendiri, tetapi juga untuk bangsa dan negara Indonesia supaya lebih maju," ujar Agung.', 'Pendidikan'),
	(15, 'Lagi... Siswa Indonesia Raih Emas Olimpiade Biologi Internasional!', 'Pelajar SMA IPEKA, Wilson Gomarga (18), berhasil membawa pulang medali emas pada kompetisi International Biology Olympiad (IBO) ke-27 di Hanoi, Vietnam, pada 16-23 Juli 2016 lalu. Wilson menyingkirkan 253 peserta dari 68 negara.\r\n\r\nPada ajang tahunan olimpiade internasional tersebut peserta asal Indonesia berasal dari empat sekolah. Indonesia berhasil mendapatkan 4 medali pada ajang IBO ke-27 ini.\r\n\r\n"Ini pertama kalinya saya mengikuti IBO, dan tentunya senang dapat menyumbangkan medali emas mewakili Indonesia," ujar Wilson, Senin (1/8/2016).\r\n\r\nKiprah Wilson di ajang international berawal dari keikutsertaannya pada Olimpiade Sains Nasional (OSN) ke-14 tahun lalu di Yogyakarta. Wilson berhasil membawa pulang medali emas untuk bidang studi yang sama dan mendapat nilai praktik dan teori tertinggi.\r\n\r\nSetelah itu, Wilson dipanggil lagi untuk mengikuti seleksi pada Pelatnas IBO 2016. Saat itu hanya tersisa 9 orang untuk mengikuti seleksi masuk IBO 2016. Wilson pun terpilih masuk pelatnas empat besar mewakili Indonesia di IBO 2016.\r\n\r\nSejak SMP, pelajar kelahiran Jakarta, 22 Juni 1998, itu mengaku sudah menyukai pelajaran biologi. Menurut dia, biologi bukanlah pelajaran hafalan, tapi lebih mirip novel yang harus dimengerti konsepnya supaya enak dan mudah dipahami.\r\n\r\n"Saya ingin mendapatkan kesempatan pendidikan lebih baik lagi ke depan. Saya akan melanjutkan studi yang berkaitan dengan biologi dan kedokteran serta mendalami penerapan yang terdapat dalam bidang ilmu tersebut," kata penyuka olah raga bola tenis meja ini.\r\n\r\nSejauh ini, lanjut dia, pihak sekolah mendukungnya mengikuti ajang tersebut. Para guru membantunya ketika membutuhkan alat-alat peraga untuk berlatih di rumah. \r\n\r\n"Saya dipinjami alat dan sebagainya untuk berlatih," tambahnya.\r\n\r\nKepala Bidang Pengembangan Pendidikan IPEKA, Theo Kurniadi, mengaku memang mendukung murid-muridnya dan mengajak para guru untuk memberikan pendampingan dan bimbingan kepada siswa-siswi.\r\n\r\n"Pada prinsipnya harus lakukan yang terbaik," kata Theo.\r\n\r\nAdapun International Biology Olympiad (IBO) merupakan ajang kompetisi bagi para siswa setingkat SMA dari seluruh dunia yang meliputi tes praktikum dan tes teori di bidang biologi. Kegiatan ini adalah ajang kompetisi tahunan yang dilaksanakan tiap Juli. Setiap negara peserta diwakili empat siswa yang diseleksi secara nasional. Indonesia mengikuti kompetisi ini sejak 2000 di Antalya, Turki.', 'Pendidikan'),
	(16, 'Kawasaki Luncurkan W800 Authentic Classic di GIIAS 2016', 'PT Kawasaki Motor Indonesia kembali ikut berpartisipasi pada event Gaikindo Indonesia International Autoshow atau GIIAS pada tahun ini. Event GIIAS di ICE BSD, Jum\'at (12/8/2016) menjadi momen yang tepat untuk Kawasaki merilis motor varian baru bagi Anda pecinta motor klasik. Varian baru yang diperkenalkan oleh KMI ialah Kawasaki W800 Authentic Classic yang mengusung konsep klasik.\r\n\r\n"Sekarang ini lagi ramai model sport, adventure tapi kami malah meluncurkan W800. Nostalgia masa lalu boleh dong," ujar Supervisor & Sales Promotion KMI Sucipto Wijono di ICE BSD City, Tangerang.\r\n\r\nAura klasik pada W800 sangat kuat. Itu bisa dilihat dari garis bodi yang membulat, seperti tangki, lampu, spakbor hingga speedometer analog. Rem depannya sudah menggunakan cakram, sementara belakang masih tromol. Kawasaki W800 mengandalkan mesin 4-Tak Vertical Twin SOHC 773 cc aircooled. Jantung mekanis tersebut sanggup menyemburkan tenaga 47 Tk dengan torsi 60 Nm. Kesan klasik juga terlihat dari kombinasi yang seimbang antara chasis dengan roda berdiameter besar. Knalpot dengan desain yang sederhana namun memberi kesan elegan.\r\n\r\nKawasaki W800 diciptakan sebagai bentuk penghormatan kepada Kawasaki legendaris W1, brand yang terbentuk selama 45 tahun. Motor ini meluncur di Indonesia dengan harga Rp249.000.000,-, dengan pilihan warna Metallic Ocean Blue dan Ebony (Special Edition). Sebagai informasi, W800 diimpor langsung dari Jepang.\r\n\r\nDeputi Departemen Head Sales & Promotion Division KMI Michael Chandra Tanadhi menyebut, model SE paling banyak yakni 40 unit. "Berkaca pada Estrella yang paling banyak dicari model SE. Mereka lebih suka yang full black, garnish-nya juga hitam semua," jelasnya.\r\n\r\nKMI mengeluarkan varian Kawasaki W800 di Indonesia untuk melengkapi tipe klasik Kawasaki dan memenuhi kepuasan pecinta motor klasik di Indonesia.\r\n\r\nSelain itu, KMI juga memajang 5 motor andalan di booth Kawasaki. Pembelian motor dan apparel Kawasaki bisa dilakukan di booth Kawasaki yang terletak di Hall 1, nomor 1AH, selama GIIAS berlangsung (11 – 21 Agustus 2016).', 'Otomotif'),
	(17, 'Top 3: Ragam Mobil Baru di Bawah Rp 200 Juta', 'Daftar mobil baru berbanderol di bawah Rp 200 juta masuk dalam tiga artikel yang paling disorot pembaca setia Liputan6.com.\r\n\r\nDi samping itu, motor KTM turun harga dan alasan all new Honda BeAT masuh pakai bohlam tak luput dari perhatian. Berikut top 3 artikel otomotif:\r\n\r\n1. Deretan Mobil Baru di Bawah Rp 200 Juta\r\n\r\nPabrikan otomotif sepanjang pekan ini berlomba menampilkan line up andalan mereka di Gaikindo Indonesia International Auto Show (GIIAS) 2016. Beberapa di antara mobil yang dipamerkan pada pameran akbar yang berlokasi di ICE BSD tersebut ada yang model baru, atau meluncur tahun ini.\r\n\r\nBagi sebagian masyarakat Indonesia, pada umumnya mencari mobil dengan harga Rp 200 juta ke bawah. Mobil pada rentang harga ini masih terjangkau dari sisi daya beli serta memiliki fitur yang fungsional untuk pemakaian sehari-hari.\r\n\r\nSelengkapnya, klik di sini.\r\n\r\n2. Harga Motor KTM Resmi Turun 40 Persen, Mau?\r\n\r\nKTM, pabrikan otomotif asal Austria, memastikan mulai hari ini (15/8/2016) akan menjual empat produk mereka lebih murah hingga 40 persen. Hal ini berkaitan dengan rencana pembangunan pabrik perakitan di Gresik, Jawa Timur.\r\n\r\n"KTM Duke dan RC sudah bisa diperoleh dengan harga khusus yang sama dengan harga saat nanti kita CKD," ujar Kristianto Goenadi, Presiden Direktur PT Penta Jaya Laju Motor, distributor KTM untuk Indonesia, di booth KTM di hall 1 ICE, BSD City, Tangerang Selatan, Senin (15/8/2016).\r\n\r\n3. All New BeAT Masih Pakai Bohlam, Ini Penjelasan Honda\r\n\r\nHonda merombak total desain pada All New Honda BeAT eSP. Penampilan bergaya sporty dan futuristik ini sayangnya belum semuanya diimbangi dengan fitur canggih.\r\n\r\nSalah satu fitur \'jadul\' yang masih jadi andalan pada generasi ketiga BeAT yaitu headlamp yang masih memakai lampu pijar alias bohlam. Padahal, skutik terbaru Honda lainnya telah mengaplikasikan lampu LED.', 'Otomotif'),
	(18, 'Orang Dalam Bicara Soal Yamaha R6 Baru', 'Yamaha R6 masuk dalam daftar peremajaan. Informasi yang mulai terkuak sejak Mei lalu menyebut bahwa motor sport kelas menengah ini akan mengisi model 2017. Beberapa perubahan akan terjadi.\r\n\r\nInformasi tentang apa saja yang berubah datang dari orang yang membocorkan informasi soal knalpot lubang ganda pada Honda CBR250RR, sebelum ada informasi resmi tentang hal tersebut. Artinya, informasi tersebut benar-benar akurat. \r\n\r\nSumber anonim tersebut mengatakan kepada morebikes.co.uk bahwa perubahan radikal terjadi di bagian depan dengan dipasangkannya winglet CFD. Sementara bagian headlamp atau lampu utama terlihat lebih tipis. \r\n\r\nSumber tersebut juga mengatakan bahwa R6 mirip dengan R1. Dari informasi tersebut, dibuatlah render atau gambar model seperti yang terlihat pada foto di atas.\r\n\r\nDikatakan pula, mesin masih berkubikasi 600 cc, dengan rasio kompresi 13,1:1. Meski sama, tapi output yang keluar lebih besar, Jika pada versi terkini tenaganya 124,7 Tk pada 14.500 rpm, maka R6 2017 akan menyemburkan tenaga 131,8 Tk.\r\n\r\nLaman autoevolution.com juga pernah menulis bahwa performa motor ini akan meningkat melalui beragam perangkat elektronik seperti kontrol traksi multi level, kontrol wheelie, antilock braking system (ABS), dan suspensi semiaktif.\r\n\r\nInformasi ini sekaligus membantah bahwa Yamaha akan mengikuti jejak Honda yang menghentikan produksi CBR600RR di Eropa karena tak lagi memenuhi standar Euro4. Motor supersport 600 cc ini akan berhenti dijual pada awal tahun. \r\n\r\nKepala Yamaha Inggris, Jeff Turner, melalui laman motorcyclenews.com mengatakan bahwa R6 yang eksis sekarang sebetulnya sudah tidak bisa memenuhi standar Euro4. Namun peningkatan mesin agar sesuai dengan standar baru itu nampaknya tak jadi soal untuk pabrikan sekelas Yamaha. \r\n\r\nYang jadi persoalan justru penjualan yang terbilang kecil. Maklum, harga motor ini relatif mahal. Hal ini juga yang jadi pertimbangan Honda menyuntik mati CBR600RR. \r\n\r\nNah, jika informasi ini benar, maka mungkin Yamaha R6 baru akan dibuka selubungnya pada November 2016, atau bahkan lebih cepat dari itu.', 'Otomotif'),
	(19, 'All New BeAT Masih Pakai Bohlam, Ini Penjelasan Honda', 'Honda merombak total desain pada All New Honda BeAT eSP. Penampilan bergaya sporty dan futuristik ini sayangnya belum semuanya diimbangi dengan fitur canggih. \r\n\r\nSalah satu fitur \'jadul\' yang masih jadi andalan pada generasi ketiga BeAT yaitu headlamp yang masih memakai lampu pijar alias bohlam. Padahal, skutik terbaru Honda lainnya telah mengaplikasikan lampu LED.\r\n\r\n"Untuk LED headlight menurut saya fitur yang menambah keuntungan yang besar. Pada saat mengembangkan BeAT baru ini kami sudah mempertimbangkan untuk memakai LED dan dalam tahap analisis kami menemukan kalau penukaran ke lampu LED biaya maintenance cukup tinggi," ungkap Presiden Direktur PT Astra Honda Motor Toshiyuki Inuma saat peluncuran all new Honda BeAT belum lama ini. \r\n\r\nIa menjelaskan bila pemakai BeAT tersebar bahkan hingga seluruh pelosok sehingga jauh dari jangkauan jaringan bengkel resmi. Untuk memudahkan perawatan maka Honda sengaja menunda pemakaian LED sebagai sistem pencahayaan pada BeAT. \r\n\r\n"BeAT yang kami produksi digunakan dalam area yang cukup luas, bahkan di daerah-daerah yang tidak terjangkau service network kami. Oleh karena itu mempertimbangkan ketersediaan part, struktur bengkel, maka kali ini kami menunda dulu memakai headlamp LED," tutur pria asal Jepang itu. \r\n\r\nPemakaian lampu hemat listrik tersebut sebenarnya telah menjadi tren di jagat otomotif baik roda empat maupun roda dua. Inuma berjanji, akan memperbanyak model dengan lampu LED. \r\n\r\n"Memang jamannya sekarang mengarah ke lampu LED. Kami akan mempertimbangkan memakai LED untuk model-model yang kami kembangkan," pungkasnya.', 'Otomotif'),
	(20, 'Deretan Mobil Baru di Bawah Rp 200 Juta', ' Pabrikan otomotif sepanjang pekan ini berlomba menampilkan line up andalan mereka di Gaikindo Indonesia International Auto Show (GIIAS) 2016. Beberapa di antara mobil yang dipamerkan pada pameran akbar yang berlokasi di ICE BSD tersebut ada yang model baru, atau meluncur tahun ini.\r\n\r\nBagi sebagian masyarakat Indonesia, pada umumnya mencari mobil dengan harga Rp 200 juta ke bawah. Mobil pada rentang harga ini masih terjangkau dari sisi daya beli serta memiliki fitur yang fungsional untuk pemakaian sehari-hari.\r\n\r\nSegmen yang ditawarkan dalam rentang harga kurang dari Rp 200 juta juga beragam dan cukup lengkap. Pabrikan menyediakan model MPV, city car (termasuk hatchback), hingga SUV.\r\n\r\nPenasaran apa saja mobil-mobil tersebut? Berikut ini uraian singkatnya:\r\n\r\nMPV\r\n\r\nSegmen kendaraan keluarga ini paling banyak menawarkan mobil dalam kisaran harga di bawah Rp 200 juta. Tiap merek pada umumnya menyediakan MPV dengan kapasitas 7-penumpang.\r\n\r\n- Daihatsu Sigra Rp 106,6 - 147,35 juta\r\n- Daihatsu Luxio (tipe D dan X manual) Rp 173,3 - 191,45 juta\r\n- Daihatsu Xenia (kecuali varian Sporty) Rp 157,45 - 192,15 juta\r\n- Datsun Go+ Rp 109,85- 126 juta\r\n- Honda Mobilio (tipe S MT) Rp 182 juta\r\n- Nissan Evalia (tipe S Option & SV MT) Rp 180,65 - 195,15 juta\r\n- Suzuki APV (tipe GE, GL, GX, SGX) Rp 172,5 - 195 juta\r\n- Suzuki Ertiga (tipe GA) Rp 184 juta\r\n- Toyota Calya Rp 129,65- Rp 150 juta\r\n- Toyota Avanza (seluruh tipe 1,3 E) Rp 181,2-196,6 juta ', 'Otomotif'),
	(21, 'Ini Kata Menkes Soal Dukun Beranak yang Masih Jadi \'Andalan\' di Beberapa DaerahIni Kata Menkes Soal Dukun Beranak yang Masih Jadi \'Andalan\' di Beberapa Daerah', 'Di beberapa daerah, dukun beranak seolah masih jadi \'andalan\' untuk membantu proses persalinan. Padahal tenaga kesehatan kini sudah banyak yang diterjunkan ke daerah-daerah. Terkait ini, menurut Menkes Dr dr Nila Farid Moelok, Sp.M(K), itu menunjukkan peran dukun beranak yang masih dipercaya warga.\r\n\r\nYang dikhawatirkan sebenarnya adalah apabila ibu yang melahirkan mengalami masalah komplikasi sehingga membutuhkan bantuan medis di rumah sakit. Jika dukun beranak tidak peka terhadap masalah ini dan berusaha menanganinya sendiri, dikhawatirkan terjadi hal yang tidak diinginkan.\r\n\r\nMengingat kepercayaan warga di beberapa daerah yang masih besar terhadap sosok dukun beranak, menurut Menkes Nila, tidak bijak jika sosok dukun serta-merta dipinggirkan. Menurutnya, dukun beranak tetap bisa menemani proses persalinan warga.\r\n\r\n"Dukun tetap mendampingi di rumah singgahnya, kemudian persalinan dilakukan oleh bidan," saran Menkes dalam penganugerahan tenaga kesehatan teladan tingkat nasional tahun 2016 di Hotel Grand Sahid Jaya, Jalan Jenderal Sudirman, Senin (15/8/2016).\r\n\r\nNila menambahkan baik dukun beranak maupun bidan memiliki kelebihan masing-masing. Untuk dukun beranak memiliki kelebihan dekat di hati masyarakat. Sementara bidan memiliki keterampilan namun kurang memiliki kedekatan hati seperti halnya dukun beranak.\r\n\r\ndr Riskiyana Sukandhi Putra, MKes saat masih menjabat Kasub Direktorat Bina Kesehatan Keluarga Berencana Kemenkes, mengatakan peran dukun beranak untuk memberi pertolongan non-medis bisa diwujudkan melalui rumah tunggu. Rumah tunggu merupakan rumah singgah bagi ibu-ibu yang ingin melahirkan. Di rumah tunggu itulah para ibu akan diajarkan hal-hal yang bersifat non-medis.\r\n\r\n"Nanti ibu-ibu ini akan diajarkan oleh dukun bayi ini bagaimana cara memandikan anak, merawat tali pusat, menyusui, terus nanti dikasih tahu anak harus diimunisasi kapan, kalau anak mulai panas nanti diginiin ya bu. Bayangkan dengan tingkat pendidikan yang tidak terlalu tinggi, pengetahuan seperti itu kan pasti berguna sekali," tutur dr Riski.\r\n\r\nLokasi rumah tunggu biasanya berada di dekat puskesmas atau rumah sakit. Sehingga, sambil menunggu persalinan, para ibu bisa belajar bagaimana merawat anaknya. "Terutama yang di daerah, bisa dua tiga atau lima hari sebelum bersalin sudah di sana. Kalau seperti di Rote, untuk ke fasilitas kesehatan butuh waktu lima hari, maka dia harus di rumah singgah seminggu sebelum melahirkan kan," lanjut Riski.', 'Umum'),
	(22, 'Segera Lakukan Hal Ini Jika Ketahuan Kena Hepatitis B Saat Hamil', 'Agar kehamilan bisa dilewati dengan menyenangkan dan tetap sehat, ada beberapa pemeriksaan yang memang sebaiknya dilakukan. Salah satunya adalah skrining hepatitis B. \r\n\r\nJika sudah ditemukan adanya hepatitis B, beda waktu maka beda pula tindakan yang biasanya akan diberikan oleh dokter. \r\n\r\nBeberapa pemeriksaan yang umumnya diberikan untuk hepatitis B yaitu HBsAg dan HBsAb. HBsAg sendiri merupakan singkatan dari Hepatitis-B surface Antigen. Ini menunjukkan ada atau tidaknya virus hepatitis B dalam tubuh seseorang.\r\n\r\nSementara itu, HBsAb atau Anti HBS merupakan singkatan dari Hepatitis-B surface Antibody, yang menunjukkan ada atau tidaknya kekebalan tubuh terhadap hepatitis B.\r\n\r\nMenurut dokter spesialis kebidanan dan kandungan divisi fetomaternal RSU Dr Soetomo Surabaya dan RS Pendidikan Universitas Airlangga, dr Khanisyah Erza Gumilar, SpOG, atau yang akrab disapa dr Erza, jika hasil pemeriksaan menunjukkan HBsAg negatif namun HBsAb positif, tandanya pasien sudah memiliki kekebalan alami terhadap hepatitis B, sehingga tindakan selanjutnya biasanya hanya bersifat follow-up saja.\r\n\r\n"Kalau HBsAg negatif dan HBsAb negatif artinya pasien susceptible atau rentan terkena. Dia wajib diberikan vaksin hepatitis B. Vaksin hepatitis B aman diberikan pada kehamilan," ujar dr Erza kepada detikHealth.\r\n\r\nNamun apabila hasil skrining menunjukkan bahwa HBsAg positif, maka selanjutnya akan dilakukan pemeriksaan untuk mengetahui sifat infeksinya dengan pemeriksaan Anti HBC dan IgM anti HBC. Dari situ akan diketahui apakah infeksi tersebut bersifat akut atau kronis. Selanjutnya, terapi melalui obat-obatan bisa diberikan kepada pasien sesuai sifat infeksinya.', 'Umum'),
	(23, 'Setelah 6 Bulan, Virus Zika Masih Ditemukan dalam Sperma Pasien', 'World Health Organization (WHO) mengeluarkan anjuran untuk menerapkan seks aman atau puasa seks bagi orang yang baru kembali dari daerah terjangkit Zika. Alasannya karena virus penyebab kecacatan pada bayi tersebut dapat bertahan hidup di sperma dan menular lewat seks.\r\n\r\nAgar yakin aman WHO menyarankan seks \'ditahan\' hingga enam bulan karena itu adalah waktu terlama virus diprediksi dapat bertahan. Namun studi terbaru oleh peneliti di Roma, Itali, membuktikan tampaknya hal tersebut keliru.\r\n\r\nDokter dari Spallanzani Institute for Infectious Diseases menemukan seorang pasien pria positif memiliki virus Zika di spermanya meski sudah lewat enam bulan dari sejak menunjukkan gejala infeksi. Menurut peneliti temuan ini menunjukkan kemungkinan virus dapat berkembang biak di kelamin pria.\r\n\r\n"Hasil penelitian ini mengkonfirmasi bahwa virus dapat mereplikasi khususnya di saluran kelamin laki-laki dan bertahan dalam air mani," tulis tim peneliti seperti dikutip dari BBC, Senin (15/8/2016).\r\n\r\nPeneliti mengatakan artinya potensi transmisi virus lewat hubungan seks bisa jadi lebih besar dari yang sebelumnya diperkirakan.\r\n\r\nJuru bicara untuk WHO Christian Lindmeier mengatakan studi tersebut akan segera dipertimbangkan.\r\n\r\n"Situasi wabah Zika masih terus berkembang secara konstan dan setiap bukti baru akan dilihat dan dievaluasi apakah bisa masuk jadi panduan atau harus direvisi," pungkas Lindmeier.', 'Umum'),
	(24, 'Pertolongan Pertama Kulit Lepuh karena Cuaca Panas: Siram Air Mengalir', 'Para jemaah haji di Arab Saudi tak hanya berisiko mengalami heat stroke dan dehidrasi akibat cuaca panas yang ekstrem. Risiko luka bakar dan luka lepuh juga mengintai, terutama pada jemaah haji yang tidak menggunakan pelindung seperti alas kaki.\r\n\r\ndr I Gusti Nyoman Darmaputra, SpKK dari D&I Skin Centre, Denpasar, mengatakan kulit telapak kaki merupakan salah satu organ tubuh yang sensitif terhadap panas. Paparan panas ekstrem membuat cairan dari pembuluh darah keluar ke jaringan kulit dan membentuk gelembung yang dikenal juga sebagai lepuh.\r\n\r\nJika sudah seperti ini, pertolongan pertama dengan menyiram air mengalir harus segera diberikan. Hal ini dilakukan untuk mendinginkan area yang luka sehingga panas tidak merusak ke lapisan kulit dan jaringan yang lebih dalam.\r\n\r\n"Kalau terbentuk lepuh, sebaiknya jangan dipecahkan sendiri agar tidak menjadi mudah terinfeksi. Segera ke unit pelayanan kesehatan untuk penanganan lepuh," tutur dr Darma kepada detikHealth, Senin (15/8/2016).\r\n\r\ndr Darma menjelaskan dari segi medis, luka bakar memiliki tiga tingkat derajat. Derajat pertama menyebabkan kulit berwarna kemerahan disertai rasa nyeri. Luka bakar jenis ini bisa ditemui pada mereka yang berjemur tanpa menggunakan losion atau biasa disebut juga sebagai sunburn.\r\n\r\nDerajat kedua membuat kulit kemerahan, disertai gelembung yang dikenal sebagai lepuh. Pada tingkat ini, pertolongan pertama ditambah penggunaan krim atau salep untuk pengobatan luka bakar masih bisa dilakukan sendiri.\r\n\r\nDerajat ketiga adalah yang paling parah. Luka bakar ini menyebabkan kulit menjadi hitam, kering dan tampak seperti gosong. Setelah pertolongan pertama, pasien harus segera mendapat pertolongan lanjutan di rumah sakit untuk mengetahui apakah luka bakar memengaruhi organ vital atau tidak.\r\n\r\nOrang-orang dengan kulit putih (Kaukasia) lebih rentan mengalami luka bakar akibat sengatan matahari dibandingkan ras lainnya. Hal ini membuat rata-rata orang Indonesia yang berkulit sawo matang bisa dibilang lumayan terlindungi karena memiliki pigmen melanin yang lebih banyak.\r\n\r\nLalu, berapa lama biasanya proses penyembuhan luka bakar akibat sengatan matahari atau cuaca panas ekstrem? "Kalau untuk penyembuhannya memang tergantung tingkat keparahan. Bisa sampai 2 minggu hingga 1 bulan," tutup dr Darma.', 'Umum'),
	(25, 'Agar RS Tak \'Kebanjiran\' Pasien, Yuk Berobat ke Puskesmas Lebih Dulu Saat Sakit', 'Ada kecenderungan beberapa orang langsung berobat ke rumah sakit (RS) saat memiliki keluhan kesehatan. Alhasil RS seperti puskesmas raksasa lantaran semua orang membanjiri rumah sakit.\r\n\r\nPuskesmas sekarang ini sudah jauh lebih baik karena memiliki fasilitas yang cukup lengkap. Karena itu tidak sepantasnya puskesmas dipandang sebelah mata. \r\n\r\nMenkes Dr dr Nila Farid Moelok, Sp.M(K), berharap pasien yang datang ke puskesmas dapat diobati sehingga tidak sedikit-sedikit ke rumas sakit. "Rumah sakit bukan puskesmas raksasa yang menampung semua penderita," ucap Nila dalam penganugerahan tenaga kesehatan teladan di puskesmas tingkat nasional tahun 2016 di Hotel Grand Sahid Jaya, Jalan Jenderal Sudirman, Jakarta, Senin (15/8/2016).\r\n\r\n"Dokter di puskesmas juga ingin memiliki jenjang yang lebih tinggi, seperti dokter layanan primer yang dapat menangani 155 penyakit. Diharapkan dokter ini (dokter layanan primer) dapat memegang orang-orang agar tidak dirujuk ke rumah sakit dan bisa membantu mengobati," sambung Nila.\r\n\r\nNila mencontohkan jika seseorang mengalami mata merah, maka bisa melakukan pengobatan di puskesmas. Dengan dibantu dokter layanan primer, maka pelayanan dapat dilakukan dengan cepat tanpa harus melakukan rujukan ke rumah sakit. Ini dengan catatan jika penyakitnya memang tidak parah.\r\n\r\n"Tenaga kesehatan berperan besar dalam menentukan sukses atau tidaknya pembangunan kesehatan di masyarakat karena dokter dapat mengubah perilaku masyarakat," tutur Nila.\r\n\r\n"Dokter adalah pahlawan di bidangnya, semoga juga dokter di puskesmas mendapatkan kehidupan yang tidak jauh berbeda dengan spesialis yang seperti bumi dengan langit," imbuh Nila\r\n', 'Umum'),
	(26, 'Hujan Deras Tadi Malam, Sebagian Jakarta Dilanda Banjir', 'Hujan deras yang mengguyur sebagian wilayah ibu kota menyebabkan genangan hingga banjir di beberapa titik.\r\n\r\nBerdasarkan twitter @BPBDJakarta, genangan terjadi di delapan titik.\r\n\r\n1. Pukul 21.33 WIB, Jalan Bahari RT 10/07, Kelurahan Gandaria Selatan, tergenang 10-40 cm\r\n\r\n2. Pukul 21.36 WIB, Jalan Rasuna Said, Jakarta Selatan tergenang 10-30 cm\r\n\r\n3. Pukul 21.38 WIB, Jalan Letjen S Parman depan Untar Kelurahan Tomang, Kecamatan Grogol Petamburan, Jakarta Barat tergenang 10-20 cm\r\n\r\n4. Pukul 21.42 WIB, Jalan H. Montong, Kecamatan Ciganjur tergenang 10-30 cm;\r\n\r\n5. Pukul 21.51 WIB, Jalan Kedoya Raya, Jakarta Barat tergenang 10-30 cm;\r\n\r\n6. Pukul 21.53 WIB, Jalan Boulevard Raya, Kelapa Gading, Jakarta Utara, tergenang 10-30 cm\r\n\r\n7. Pukul 22.08 WIB, Jalan Kapuk Raya Kelurahan Kapuk, Jakarta Barat tergenang 20-30 cm\r\n\r\n8. Pukul 22.12 WIB, Jalan Karet Pasar Baru Timur, Kelurahan Karet Tengsin, Kecamatan Tanah Abang, Jakarta Pusat tergenang 20-30 cm.\r\n\r\nBanjir\r\n\r\n1. Pukul 20.38 WIB, Jalan Jagakarsa 2 Gang H Masmun belakang TPU, Jakarta Selatan, terendam banjir setinggi 40 sentimeter. Sebanyak 30 rumah warga terendam\r\n\r\n2. Pukul 21.13 WIB, banjir setinggi 50-100 sentimeter merendam RW 03, Kelurahan Wijaya Kesuma, Kecamatan Grogol Petamburan, Jakarta Barat;\r\n\r\n3. Pukul 21.42 WIB, banjir setinggi 50-120 sentimeter merendam RT 13, 12, 11, 8, 5, dan 2 RW di Kelurahan Ragunan, Kecamatan Pasar Minggu, Jakarta Selatan;\r\n\r\n4. Pukul 21.49 WIB, banjir setinggi 10-70 sentimeter merendam RT 06/07, Pondok Labu, Jakarta Selatan;\r\n\r\n5. Pukul 21.57 WIB, banjir merendam RW 09 Kelurahan Kramat Pela, Kecamatan Kebayoran Baru, Jakarta Selatan.\r\n\r\nPohon tumbang\r\n\r\nPukul 20.45 WIB, sebuah pohon mahoni sempal tumbang di Jalan Arteri Permata Hijau dekat jembatan arah Kebayoran Lama, Jakarta Selatan. Kini, pohon tumbang tersebut tengah ditangani oleh dua unit petugas Dinas Pertamanan DKI Jakarta serta PPSU.\r\n\r\nSelain pohon tumbang, longsor juga terjadi di Jalan Melati 2, RT 09, RW 02, Kelurahan Pondok Labu, Jakarta Selatan, pukul 20.00 WIB. Saat ini, tengah dilakukan penyedotan dan mengevakuasi 75 jiwa warga terdampak.', 'Umum'),
	(27, 'Maudy Koesnaedi Belajar Mendampingi Penderita Kanker', 'Dengan bermain dalam film baru Pinky Promise, artis peran, model, dan pembawa acara Maudy Koesnaedi (41) mendapat pelajaran tentang hidup dengan anak yang menderita kanker.\r\n\r\nDalam film itu, Maudy berperan sebagai seorang ibu yang mengalami dilema dalam mendampingi putrinya yang didiagnosis terkena kanker payudara. \r\n\r\nDalam film tersebut pula, suami Maudy berbeda pendapat dengan anak mereka mengenai pengobatan yang harus dijalani oleh sang anak.\r\n\r\n"Saya punya dilema untuk men-support anak saya yang terkena kanker payudara," kata Maudy mengenai perannya dalam film itu, dalam jumpa pers peluncuran trailer dan poster film tersebut di Plaza Senayan XXI, Jakarta Pusat, Jumat (19/8/2016).\r\n\r\n"Saya tahu betul mendampingi anak saya. Di luar itu, saya sebagai istri harus menghormati suami yang memiliki pendapat lain," sambungnya.\r\n\r\nFilm karya Guntur Soeharjanto itu menggambarkan bagaimana orang-orang terdekat memberi dukungan bagi penderita kanker.\r\n\r\n"Film ini lebih kepada keluarga menempatkan diri menghadapi survivor (penyintas) kanker payudara. Gimana kadang kan penginnya ngebantu dan perhatian, tapi jadinya ngeganggu," ujar ibu satu anak laki-laki ini.\r\n\r\n"Survivor kan punya motivasi dan keyakinan sendiri dalam masalahnya dan kita juga ingin membantunya. Nah, ini buat pembelajaran ke saya, harus lihat dari sisi mananya," ujarnya lagi.\r\n\r\nPinky Promise dibintangi juga oleh Agni Pratista, Dhea Seto, Ira Maya Sopha, Dea Ananda, Chelsea Islan, Alexandra Gottardo, Gunawan, Maudy Koesnaedi, dan Ringgo Agus Rachman.\r\n\r\nFilm itu akan mulai diputar di gedung-gedung bioskop pada 13 Oktober 2016.', 'Umum'),
	(28, 'Anak Buruh Bangunan Ini Ikut Naikan dan Turunkan Merah Putih di Istana', 'Tidak banyak yang mendapat kesempatan seperti yang didapat Reyvelino Sasiang, anggota Paskibraka asal Sulawesi Utara.\r\n\r\nDalam peringatan hari kemerdekaan ke-71 Republik Indonesia di Istana Merdeka, dia ambil bagian pada upacara penaikan serta penurunan bendera Merah Putih.\r\n\r\n"Saya bangga banget, enggak nyangka diberikan kesempatan dua kali ikut upacara," ujar dia saat ditemui usai upacara penurunan bendera di Wisma Negara, 17 Agustus 2016 petang.\r\n\r\nAnak tukang bangunan itu awalnya ditugaskan untuk upacara penurunan bendera Rabu sore saja.\r\n\r\nNamun, buntut dari digugurkannya Gloria Natapraja Hamel dari Paskibraka, membuat Tim Arjuna kehilangan satu personel.\r\n\r\nDiketahui, Gloria seharusnya masuk ke Tim Arjuna, tim yang bertugas menaikan bendera Merah Putih.\r\n\r\nAtas kesepakatan pelatih, Reyvelino ditempatkan di serpihan kiri depan, Kelompok 17, untuk menutupi kekurangan seorang personel.\r\n\r\nKetika upacara penurunan bendera, Reyvelino ikut ambil bagian lagi. Kali ini, dia diposisikan pada posisi penjuru tengah Kelompok 14.\r\n\r\n"Jadi hanya geser posisi saja," ujar dia.\r\n\r\nDari dua kali upacara, pemuda Sangihe, kepulauan terluar di Indonesia itu mengaku paling \'grogi\' saat melaksanakan upacara penaikan bendera.\r\n\r\n"Yang pertama ini saya grogi banget. Kalau yang kedua enggak terlalu grogi. Tapi yang penting hati senang banget ikut pengibaran dan penurunan bendera," ujar dia.\r\n\r\nSayang, orangtua Reyvelino tidak dapat hadir di Istana seperti kebanyakan rekan-rekannya atas alasan terlalu jauh dan harus menjaga adiknya yang masih kecil.\r\n\r\nKeluarga yang mewakili hanya sepupunya yang ada di Jakarta. Namun, setelah menunaikan penaikan bendera, dia langsung menelpon orangtuanya di pelosok Sangihe untuk menyampaikan kebanggaannya.\r\n\r\n"Bapa Mama bilang selamat, kamu yang terbaik bisa dua kali. Orangtua senang banget juga bangga. Itu kelihatan dari ucapan mereka kepada saya," ujar Reyvelino.', 'Umum');
